(2, '', NULL, '', 'Tổ đường Vovinam Việt Võ Đạo dùng để thờ phụng di cốt, chân dung cố Sáng Tổ Nguyễn Lộc, cố Võ sư Chưởng môn Lê Sáng cũng như để cho môn sinh khắp nơi về chiêm bái và tập luyện võ thuật của bản phái. Phòng tập luyện (võ đường) có đặt bàn thờ cố Võ sư Sáng Tổ Nguyễn Lộc, cố Võ sư Chưởng Môn Lê Sáng thật là trang nghiêm với di ảnh, tượng bán thân, các tấm liễn, câu đối , trống, chiêng, giá bát bửu… Trên tường, chung quanh phòng tập được trang trí bằng những bức tranh ghi lại những nét hào hùng trong lịch sử Việt Nam và một số hình ảnh sinh hoạt của Môn Phái khắp nơi từ trong nước đến Hải Ngoại.\n\nTổ Đường hiện tại đứng đầu là Võ sư Nguyễn Văn Sen chánh văn phòng, chuyên lo về văn thư giấy tờ, huấn luyện, đặc huấn, tổ chức lễ lộc, thi cữ… với sự cố vấn và trợ giúp của võ sư Nguyễn Tôn Khoa, võ sư Nguyễn Văn Tuấn.Hàng năm, Tổ đường Vovinam Việt Võ Đạo có hơn 250 võ sinh, môn sinh tập luyện.', 1700309003, 1700309003, '10.7613241', '106.6727684', 2, NULL, NULL, 50, NULL, NULL, ' 0908 908 840 - 0937 759 311', 'Thứ 2-CN:  5H30-7H, 18H-21H', '31 Sư Vạn Hạnh, P.2, Quận 10,HCM', NULL, NULL, 1, 1702350442, 'timeopen=Thứ 2-CN:  5H30-7H, 18H-21H', 'https://cdn.alongwalk.info/vn/wp-content/uploads/2022/03/15114644/image-5-dia-chi-hoc-vo-vovinam-dang-cap-nhat-o-tp-hcm-164729440466068.jpg', 1),
(3, 'Huỳnh Hữu Lợi', NULL, 'Tin Võ Tam Bình', 'Thời gian tập luyện:<br/>\nThứ 3-5: 17H-20H <br/>\nThứ 7-CN: 6H30-8H', 1700309003, 1700309003, '10.8686457', '106.7354794', 1, NULL, NULL, 50, NULL, NULL, '0937759311', 'Thứ 3-5: 17H-20H .Thứ 7-CN: 8H- 10H', '640 Tô Ngọc Vân, Tam Binh, Thủ Đức, Thành phố Hồ Chí Minh', NULL, NULL, 1, 1711675539, 'owner=Huỳnh Hữu Lợi', 'http://giasuthethao.com/upload/news/z47144880109479f7c12294a45ab580c81426f46085a95-2104.jpg', 1),
