INSERT INTO `table_courses` (`id`, `id_teachers`, `id_list`, `id_item`, `id_cat`, `id_sub`, `id_tags`, `noibat`, `tb`, `photo`, `icon`, `options`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `gioithieuvi`, `tenen`, `tenvi`, `tenko`, `tenkhongdauko`, `motako`, `noidungko`, `taptin`, `link`, `link_video`, `thoigian`, `giamoi`, `giatien`, `lichhocvi`, `ghichuvi`, `stt`, `hienthi`, `type`, `ngaytao`, `ngaysua`, `luotxem`, `id_club`) VALUES
(8, '', 3, 0, 9, 0, NULL, 1, 0, 'cpo-6962.png', NULL, '{\"p\":\"cpo-6962.png\",\"w\":null,\"h\":null,\"m\":null}', 'giam-doc-san-xuat', '', '', '&lt;p&gt;&lt;strong&gt;&lt;em&gt;Hãy đến và trải nghiệm chương trình huấn luyện “Xây dựng đội ngũ Black-Belt” để được học hỏi 8 điều sau:&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;&lt;strong&gt;Thế nào là đội ngũ “Black​-Belt” để giúp bạn tái lập đội nhóm theo phương cách của nhà vô địch.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Kỹ thuật xây dựng đội nhóm Black-Belt chuyên nghiệp để tất cả các thành viên đều hiểu sự hài hòa của sức mạnh cá nhân và tập thể trong việc tối đa hóa hiệu quả kinh doanh.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;4 lý do khiến ước mơ và những dự định của bạn đang ở bên “nhà người khác” để giúp bạn thiết lập mục tiêu của nhà vô địch ngay bây giờ.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Nghệ thuật tối ưu hóa hiệu quả làm việc của đội nhóm Black-Belt để biến thách thức kinh tế thành cơ hội phát triển kinh doanh và khẳng định vị thế của một Đội Nhóm Black-Belt vô địch với tinh thần của Team Power.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Tại sao Team​​​​​work không thể giúp bạn chiến thắng các mục tiêu đã đề ra để giúp bạn thay đổi cách cách xây dựng đội nhóm với 5 nguyên tắc làm việc của một đội nhóm đẳng cấp đai đen.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Khám phá 8 nguyên tắc Lãnh Đạo Đội Nhóm để giúp bạn trở thành Thủ Lĩnh Đai Đen trong trái tim của đồng đội.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Đối diện 3 kiểu phản ứng trước cơ hội dành cho nhà vô địch để giúp bạn vững vàng biến cơ hội thành kết quả kinh doanh vượt trội.&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Kỹ thuật đột phá của các Nhà Vô Địch Thế Giới nhằm giúp bạn vượt qua tiếng nói nhỏ và kiên định thực hiện mục tiêu đề ra của một nhà lãnh đạo đẳng cấp “Black-Belt”.&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ol&gt;\r\n', '', 'GIÁM ĐỐC SẢN XUẤT', '', '', 'CMO - GIÁM ĐỐC SẢN XUẤT', '', '', '', '', NULL, NULL, NULL, NULL, 0, 0, '', '', 1, 0, 'khoa-hoc', 1638249181, 1657851458, 105, 1),
(9, '', 3, 0, 9, 0, NULL, 1, 0, 'coo-8079.png', NULL, '{\"p\":\"coo-8079.png\",\"w\":null,\"h\":null,\"m\":null}', 'cco-giam-doc-kinh-doanh', '', '', '&lt;p&gt;CCO - GIÁM ĐỐC KINH DOANH&lt;/p&gt;\r\n', '', '&lt;p&gt;Thấu Hiểu Hành Vi Khách Hàng&lt;/p&gt;\r\n', '', '', 'CCO - GIÁM ĐỐC KINH DOANH', '', '', '', '', NULL, NULL, NULL, NULL, 0, 0, '', '', 2, 0, 'khoa-hoc', 1638249325, 1657766688, 16, 1),
(10, '', 3, 0, 9, 0, NULL, 1, 0, 'coo-2398.png', NULL, '{\"p\":\"awaken-financial2-1024x576-5850.jpg\",\"w\":null,\"h\":null,\"m\":null}', 'cmo-giam-doc-marketing', '', '', '&lt;h2&gt;CMO - GIÁM ĐỐC MARKETING&lt;/h2&gt;\r\n', '', 'CMO - GIÁM ĐỐC MARKETING', '', '', 'CMO - GIÁM ĐỐC MARKETING', '', '', '', '', NULL, NULL, NULL, NULL, 0, 0, '', '', 3, 0, 'khoa-hoc', 1638249345, 1657775878, 3, 1),
