(13, '17,18,19', 3, 0, 9, 0, NULL, 1, 0, 'cfo-4498.png', NULL, '{\"p\":\"cfo-4498.png\",\"w\":null,\"h\":null,\"m\":null}', 'cfo-giam-doc-tai-chinh', '', '', '&lt;ul&gt;\r\n	&lt;li style=&quot;text-align:justify;&quot; value=&quot;5&quot;&gt;&lt;!--[if--&gt;&lt;!--[endif]--&gt;\r\n	&lt;p&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/khoa-hoc-giam-doc-tai-chinh/&quot;&gt;&lt;strong&gt;Khóa học &lt;/strong&gt;&lt;strong&gt;Giám đốc tài chính chuyên nghiệp&lt;/strong&gt;&lt;/a&gt;&lt;a&gt; (&lt;strong&gt;CFO&lt;/strong&gt;) &lt;/a&gt;do &lt;strong&gt;Trường doanh nhân PTI&lt;/strong&gt; thiết kế và đào tạo trong thời gian 03 tháng, 28 buổi đào tạo tài chính riêng biệt về các kỹ năng, kiến thức cũng như tuy duy mà một &lt;strong&gt;&lt;a&gt;CFO&lt;/a&gt; &lt;/strong&gt;cần phẩn có, chi tiết như sau:&lt;/p&gt;\r\n\r\n	&lt;table align=&quot;left&quot; border=&quot;1&quot; cellpadding=&quot;0&quot; cellspacing=&quot;0&quot; width=&quot;728&quot;&gt;\r\n		&lt;tbody&gt;\r\n			&lt;tr&gt;\r\n				&lt;td rowspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;STT&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td rowspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;CHUYÊN ĐỀ/SUBJECT&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;3&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;THỜI LƯỢNG&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;Buổi&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;Tiết&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;01&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/khoa-hoc-tai-chinh-danh-cho-lanh-dao/&quot;&gt;Chân dung một CFO&lt;/a&gt; chuyên nghiệp&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Portrait of a professional CFO\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Vai trò, vị trí của giám đốc tài chính trong bộ máy tổ chức Doanh nghiệp;&lt;/li&gt;\r\n					&lt;li&gt;Các công cụ tài chính của doanh nghiệp;&lt;/li&gt;\r\n					&lt;li&gt;Các tiền đề và quyết định chủ yếu của tài chính doanh nghiệp.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;02&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;08&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;02&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Tổ chức tài chính doanh nghiệp&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Corporate financial organization\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Kế toán và tài chính;&lt;/li&gt;\r\n					&lt;li&gt;Chức năng nhiệm vụ và tổ chức công tác tài chính.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;01&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;04&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;03&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Phân tích tài chính doanh nghiệp &amp; chiến lược tài chính doanh nghiệp&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Corporate financial analysis and strategy\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Phân tích báo cáo tài chính thông qua các hệ số tài chính;&lt;/li&gt;\r\n					&lt;li&gt;Phân tích Dupont, mô hình tài trợ vốn lưu động;&lt;/li&gt;\r\n					&lt;li&gt;Chính sách vay nợ của doanh nghiệp.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;03&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;12&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;04&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Hệ thống đòn bẩy doanh nghiệp&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Corporate leverage system\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Phân tích hòa vốn và ý nghĩa;&lt;/li&gt;\r\n					&lt;li&gt;Tác động của đòn bẩy kinh doanh tới lợi nhuận của doanh nghiệp;&lt;/li&gt;\r\n					&lt;li&gt;Đòn bẩy và đo lường mức độ ảnh hưởng của đòn bẩy kinh doanh;&lt;/li&gt;\r\n					&lt;li&gt;Đòn bẩy tài chính và đo lường mức độ ảnh hưởng của đòn bẩy tài chính.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;02&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;08&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;05&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Quản trị thời gian của tiền&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Time management of money\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Giá trị thời gian của tiền;&lt;/li&gt;\r\n					&lt;li&gt;Giá trị tương lai và giá trị hiện tại;&lt;/li&gt;\r\n					&lt;li&gt;Sử dụng phương pháp dòng tiền chiết khấu trong việc ra quyết định tài chính.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;01&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;04&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;06&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/khoa-hoc-phan-tich-hieu-qua-von-dau-tu-trong-doanh-nghiep/&quot;&gt;&lt;strong&gt;Quyết định đầu tư vốn&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;/ &lt;/strong&gt;Capital investment decisions\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Dòng tiền của dự án đầu tư;&lt;/li&gt;\r\n					&lt;li&gt;Các nguyên tắc xác định dòng tiền của dự án đầu tư;&lt;/li&gt;\r\n					&lt;li&gt;Các phương pháp đánh giá và lựa chọn dự án đầu tư;&lt;/li&gt;\r\n					&lt;li&gt;Tác động của vay nợ tới hiệu quả dự án đầu tư.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;03&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;12&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;07&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Phân phối lợi nhuận và chính sách cổ tức&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Profit distribution and dividend policy\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Nguyên tắc phân phối lợi nhuận của doanh nghiệp;&lt;/li&gt;\r\n					&lt;li&gt;Quy định phân phối lợi nhuận của công ty mà Nhà nước làm chủ sở hữu;&lt;/li&gt;\r\n					&lt;li&gt;Các hình thức &amp; chính sách cổ tức của công ty cổ phần;&lt;/li&gt;\r\n					&lt;li&gt;Quy trình chi trả cổ tức của công ty.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;02&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;08&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;08&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Lập kế hoạch tài chính&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Financial planning\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Tổng quan về lập kế hoạch tài chính;&lt;/li&gt;\r\n					&lt;li&gt;Các công cụ và phương pháp lập kế hoạch tài chính;&lt;/li&gt;\r\n					&lt;li&gt;Tình huống lập kế hoạch tài chính.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;02&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;08&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;09&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Kế toán doanh nghiệp&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Corporate Accounting\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Kế toán tài chính doanh nghiệp;&lt;/li&gt;\r\n					&lt;li&gt;Kế toán quản trị doanh nghiệp.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;04&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;16&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;10&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Thuế &amp; các chính sách Thuế&lt;/strong&gt;&lt;strong&gt;/ &lt;/strong&gt;Tax &amp; tax policies\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Tổng quan hệ thống thuế hiện hành của Việt Nam;&lt;/li&gt;\r\n					&lt;li&gt;Một số loại thuế chủ yếu liên quan đến hoạt động của doanh nghiệp;&lt;/li&gt;\r\n					&lt;li&gt;Hóa đơn, chứng từ.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;02&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;08&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;11&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/khoa-hoc-quan-ly-con-nguoi/&quot;&gt;&lt;strong&gt;Quản lý đội ngũ&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;/ &lt;/strong&gt;Team management\r\n				&lt;ul&gt;\r\n					&lt;li&gt;Con người và đội ngũ kế toán tài chính;&lt;/li&gt;\r\n					&lt;li&gt;Kỹ năng quản lý lãnh đạo đội ngũ.&lt;/li&gt;\r\n				&lt;/ul&gt;\r\n				&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;02&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;08&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;12&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Chuyên đề hội thảo&lt;/strong&gt;Seminar &amp; Workshop&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;01&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;04&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;13&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Hội thảo kinh tế &amp; kinh doanh&lt;/strong&gt;Economics &amp; Business Workshop&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;02&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;08&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;14&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Lễ trao “Chứng nhận tốt nghiệp”&lt;/strong&gt;“Graduation Certificate” Ceremony&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;01&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;04&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n			&lt;tr&gt;\r\n				&lt;td&gt; &lt;/td&gt;\r\n				&lt;td&gt;&lt;strong&gt;Tổng cộng&lt;/strong&gt;&lt;/td&gt;\r\n				&lt;td colspan=&quot;2&quot;&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;28&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n				&lt;td&gt;\r\n				&lt;p align=&quot;center&quot;&gt;&lt;strong&gt;112&lt;/strong&gt;&lt;/p&gt;\r\n				&lt;/td&gt;\r\n			&lt;/tr&gt;\r\n		&lt;/tbody&gt;\r\n	&lt;/table&gt;\r\n\r\n	&lt;p&gt;Tải BROCHURE &lt;strong&gt;khóa học Giám đốc tài chính CFO&lt;/strong&gt; &lt;a href=&quot;https://khoahocceo.com/wp-content/uploads/2021/06/kh%C3%B3a-h%E1%BB%8Dc-CFO-Gi%C3%A1m-%C4%90%E1%BB%91c-T%C3%A0i-Ch%C3%ADnh.pdf&quot;&gt;&lt;strong&gt;tại đây&lt;/strong&gt;&lt;/a&gt;&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li style=&quot;text-align:justify;&quot;&gt;&lt;!--![endif]--&gt;&lt;!--![endif]--&gt;&lt;!--![endif]--&gt;&lt;!--![endif]--&gt;&lt;!--![endif]--&gt;&lt;!--![if--&gt;&lt;!--![if--&gt;&lt;!--![if--&gt;&lt;!--![if--&gt;&lt;!--![if--&gt;&lt;/li&gt;\r\n	&lt;li&gt; &lt;/li&gt;\r\n&lt;/ul&gt;\r\n', NULL, '&lt;p&gt;&lt;strong&gt;Khóa học Giám đốc tài chính&lt;/strong&gt; cung cấp cho các học viên những kiến thức và kỹ năng cần thiết của một giám đốc tài chính chuyên nghiệp (CFO) từ việc &lt;strong&gt;hoạch định chiến lược tài chính dài hạn&lt;/strong&gt; cho đến những quyết định cấp thời nhằm nắm bắt các cơ hội &lt;strong&gt;đầu tư tài chính&lt;/strong&gt; một cách nhanh nhất và hiệu quả nhất cho doanh nghiệp. Học viên được cấp chứng chỉ sau khi hoàn thành khóa học.&lt;/p&gt;\r\n', '&lt;h3&gt;Giám đốc tài chính là gì?&lt;/h3&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;CFO&lt;/strong&gt; là tên viết tắt dịch từ &lt;strong&gt;Chief Finacial Officer&lt;/strong&gt;, và tên tiếng Việt là &lt;strong&gt;Giám đốc tài chính&lt;/strong&gt;. Giám đốc tài chính CFO là người đứng đầu về quản lý tài chính của công ty, doanh nghiệp, đồng thời chịu trách nhiệm chính trước Tổng giám đốc về các công việc liên quan đến quản lý tài chính chung.&lt;/p&gt;\r\n\r\n&lt;p&gt;Hay nói một cách dễ hiểu hơn thì &lt;strong&gt;Giám đốc tài chính CFO&lt;/strong&gt; là người quản lý cấp cao trong việc theo dõi dòng tiền, phân tích tài chính đồng thời đưa ra các dự báo trong tương lai để có hướng ứng phó kịp thời.&lt;/p&gt;\r\n\r\n&lt;p&gt;Do vậy để trở thành một Giám đốc tài chính giỏi thì yêu cầu bạn phải hội tụ đủ các yếu tố về sức, trí, dũng thì mới có thể cáng đáng và điều hành một tập đoàn lớn. Với một vị trí quan trọng cùng những trọng trách lớn như vậy thì không những bạn phải là người có năng lực mà còn phải có tầm nhìn, chiến lược đúng đắn bởi sự thành công của doanh nghiệp phụ thuộc rất nhiều vào một CFO.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Làm thế nào để trở thành một CFO chuyên nghiệp? Khi nào Việt Nam ta có một thế hệ CFO chuyên nghiệp? Chương trình CFO của Trường doanh nhân PTI sẽ là một lời đáp cho những câu hỏi quan trọng này.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;h3&gt;Khóa học Giám đốc tài chính&lt;/h3&gt;\r\n\r\n&lt;p&gt;Nắm bắt được thực tế và nhu cầu của các doanh nghiệp Việt Nam, &lt;strong&gt;Trường PTI&lt;/strong&gt; đã xây dựng chương trình đào tạo CFO &lt;strong&gt;“&lt;a href=&quot;https://khoahocpti.edu.vn/khoa-hoc-giam-doc-tai-chinh/&quot;&gt;Khóa học Giám đốc Tài chính chuyên nghiệp&lt;/a&gt;“&lt;/strong&gt; nhằm trang bị những kiến thức cốt lõi mà một CFO phải có: &lt;em&gt;nắm được đầy đủ mọi hoạt động quản trị kế toán cho một doanh nghiệp, theo dõi thông tin bộ máy tài chính, chuyển thông tin kế toán thành “thông tin tài chính”. Dựa trên kết quả đó Giám đốc tài chính thoát khỏi việc điều hành tác nghiệp để tiến tới mức độ cao hơn đó là vận dụng các công cụ tài chính nhằm thực hiện tối đa hóa vốn trong doanh nghiệp.&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;h3&gt;Tham gia chương trình&lt;/h3&gt;\r\n\r\n&lt;p&gt;Chương trình &lt;strong&gt;đào tạo CFO Giám đốc tài chính &lt;/strong&gt;chuyên nghiệp này phù hợp với các đối tượng tham dự sau:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Cấp Lãnh đạo Doanh nghiệp (HĐQT, HĐTV, Ban Tổng Giám Đốc, Ban Giám Đốc);&lt;/li&gt;\r\n	&lt;li&gt;Giám đốc Tài chính (CFO) của các doanh nghiệp;&lt;/li&gt;\r\n	&lt;li&gt;Những người có hoài vọng trở thành Giám Đốc Tài chính trong tương lai.&lt;/li&gt;\r\n	&lt;li&gt;Kế toán trưởng, Kế toán tổng hợp, chuyên viên kế toán, chuyên viên tài chính, chuyên viên phân tích đầu tư của các doanh nghiệp mong muốn sớm trở thành Giám Đốc Tài chính;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h3&gt;Mục tiêu chương trình&lt;/h3&gt;\r\n\r\n&lt;p&gt;Sau khi hoàn tất thành công chương trình &lt;strong&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/khoa-hoc-giam-doc-tai-chinh/&quot;&gt;khóa học CFO Giám đốc tài chính &lt;/a&gt;&lt;/strong&gt;chuyên nghiệp, học viên có thể:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Biết được Giám đốc tài chính chuyên nghiệp là một người như thế nào (chân dung của một CFO);&lt;/li&gt;\r\n	&lt;li&gt;Biết cách đạt được hoài vọng của mình là trở thành một Giám đốc tài chính chuyên nghiệp trong tương lai.&lt;/li&gt;\r\n	&lt;li&gt;Những tư duy và nhận thức cốt lõi mà một Giám đốc tài chính chuyên nghiệp cần phải có trong môi trường kinh doanh toàn cầu;&lt;/li&gt;\r\n	&lt;li&gt;Những mô hình, công cụ và phương pháp quản trị tài chính cập nhật nhất của thế giới mà một CFO chuyên nghiệp cần phải có.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '', 'CFO - GIÁM ĐỐC TÀI CHÍNH', '', '', '', '', NULL, NULL, NULL, NULL, 14000000, 18800000, '&lt;h3&gt;Lịch khai giảng tại TPHCM&lt;/h3&gt;\r\n\r\n&lt;p&gt;Địa điểm tổ chức &lt;strong&gt;khóa học đào tạo Giám đốc Tài Chính (CFO) tại TPHCM&lt;/strong&gt;: Tầng 1, Tòa nhà Rivera Park, Số 7/28 Đường Thành Thái, Phường 14, Quận 10, TP.Hồ Chí Minh (&lt;a href=&quot;https://goo.gl/maps/Pesgm8E8o3sGGUzC6&quot;&gt;Xem bản đồ&lt;/a&gt;)&lt;/p&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;1&quot; cellspacing=&quot;0&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;KHÓA HỌC&lt;/td&gt;\r\n			&lt;td&gt;THỜI LƯỢNG&lt;/td&gt;\r\n			&lt;td&gt;NGÀY KHAI GIẢNG&lt;/td&gt;\r\n			&lt;td&gt;NGÀY KẾT THÚC&lt;/td&gt;\r\n			&lt;td&gt;THỨ&lt;/td&gt;\r\n			&lt;td&gt;THỜI GIAN&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;CFO – Giám đốc Tài chính chuyên nghiệp&lt;/td&gt;\r\n			&lt;td&gt;3 tháng&lt;/td&gt;\r\n			&lt;td&gt;02/04/2022&lt;/td&gt;\r\n			&lt;td&gt;19/06/2022&lt;/td&gt;\r\n			&lt;td&gt;Thứ 7, Chủ nhật (tuần 1 &amp; tuần 3)&lt;/td&gt;\r\n			&lt;td&gt;Sáng: 8h30 – 11h30\r\n			&lt;p&gt;Chiều: 13h30 – 16h30&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;CFO – Giám đốc Tài chính chuyên nghiệp&lt;/td&gt;\r\n			&lt;td&gt;3 tháng&lt;/td&gt;\r\n			&lt;td&gt;11/07/2022&lt;/td&gt;\r\n			&lt;td&gt;04/10/2022&lt;/td&gt;\r\n			&lt;td&gt;Thứ 2, thứ 3&lt;/td&gt;\r\n			&lt;td&gt;Tối: 18h00 – 21h00&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', '', 4, 0, 'khoa-hoc', 1638249416, 1658112338, 76, 1),
(14, '', 2, 0, 4, 0, NULL, 0, 0, 'ceo-live-learning-1126.jpg', NULL, '{\"p\":\"ceo-live-learning-1126.jpg\",\"w\":null,\"h\":null,\"m\":null}', 'khoa-hoc-ceo-truc-tuyen-giam-doc-dieu-hanh-doanh-nghiep', '', '', '&lt;p&gt;Học tiếng anh gia tốc&lt;/p&gt;\r\n', NULL, '&lt;p&gt;Học tiếng anh gia tốc&lt;/p&gt;\r\n', '', '', 'Khóa Học CEO Trực Tuyến - Giám Đốc Điều Hành Doanh Nghiệp', '', '', '', '', NULL, NULL, NULL, NULL, 0, 0, '', '', 1, 0, 'khoa-hoc', 1638249575, 1657852172, 23, 1),
(20, '', 2, 0, 6, 0, '', 0, 0, 'khoa-hoc-quan-ly-cap-trung-truc-tuyen-3570.jpg', '', '{\"p\":\"khoa-hoc-quan-ly-cap-trung-truc-tuyen-3570.jpg\",\"w\":null,\"h\":null,\"m\":null}', 'khoa-hoc-nang-luc-quan-tri-cho-quan-ly-cap-trung-truc-tuyen-live-learning', '', '', '&lt;h2&gt;GIỚI THIỆU KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;p&gt;Những người giỏi chuyên môn chưa hẳn đã quản lý tốt. Một nhà quản lý không có kinh nghiệm dễ mắc phải những lỗi sau: đồng nhất tầm nhìn, mục tiêu của chủ doanh nghiệp với tầm nhìn và mục tiêu của chính mình hoặc coi nhiệm vụ của mình là thực thi tầm nhìn, mục tiêu của chủ doanh nghiệp; sa lầy vào công việc chuyên môn; đặt nhầm trọng tâm quản lý vào con người thay vì các hệ thống quy trình; nhận thức không đúng về các chiến lược mà nhà quản lý cần xây dựng… Vậy làm sao để khắc phục những ngộ nhận về quản lý đó và trở thành nhà quản lý chuyên nghiệp?&lt;/p&gt;\r\n\r\n&lt;p&gt;Nhằm giúp các nhà quản lý xác định đúng vị trí và vai trò của mình, nâng cao năng lực quản trị, Tổ chức Giáo dục Đào tạo PTI biên soạn chương trình đào tạo “MMM – Năng lực quản trị cho Quản lý cấp trung. Chương trình do các chuyên gia hàng đầu của PTI biên soạn dựa theo khảo sát hoạt động thực tiễn của nhiều doanh nghiệp và tập đoàn lớn tại Việt Nam và trên thế giới.&lt;/p&gt;\r\n\r\n&lt;h2&gt;NỘI DUNG KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;table width=&quot;449&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;&lt;strong&gt;Nội Dung Khóa Học Quản Lý Cấp Trung Trực Tuyến&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;&lt;strong&gt;Phần 01: Lập kế hoạch – Tổ chức thực hiện&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Khái quát về lập kế hoạch;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Phương pháp lập kế hoạch.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Xác định mục tiêu;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Chuẩn bị nguồn lực.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Truyền đạt kế hoạch.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Phương pháp tổ chức công việc (quy trình, định biên nhân sự, lập mô tả công việc…&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Tổ chức công việc cá nhân.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt; &lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;&lt;strong&gt;Phần 02: Giám sát, đánh giá hiệu quả làm việc&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Giám sát quá trình thực hiện công việc của nhân viên.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Những khó khăn trong thực hiện đánh giá hiệu quả làm việc.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Mục đích và lợi ích của việc đánh giá hiệu quả làm việc.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Quy trình và công cụ thực hiện đánh giá hiệu quả làm việc.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Cách xây dựng hệ thống KPI công việc.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Đánh giá hiệu quả làm việc theo tiêu chí. &lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt; &lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;&lt;strong&gt;Phần 03: Tạo động lực cho nhân viên&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Công cụ phân tích động lực.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Vai trò của doanh nghiệp;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Vai trò của người quản lý.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Nghệ thuật động viên theo Maslow;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Nghệ thuật động viên theo Herzberg.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Các cách động viên nhân viên hiệu quả.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt; &lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;&lt;strong&gt;Phần 04: Huấn luyện, kèm cặp nhân viên&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Nguyên tắc huấn luyện &amp; đào tạo nhân viên.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Cách đào tạo &amp; phát triển nhân viên dự phòng.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Các mong đợi của người học; Quy trình hướng dẫn công việc.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Kèm cặp và lợi ích của kèm cặp nhân viên đối với người quản lý.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Các phương pháp kèm cặp; Các kỹ năng cần thiết; Duy trì hoạt động kèm cặp. &lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt; &lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;&lt;strong&gt;Phần 05: Kỹ năng giao việc ủy quyền&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Các bước ủy thác và phân công công việc.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Các công việc không được ủy thác; Mức độ ủy quyền.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Xử lý từ chối của nhân viên khi ủy thác.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Các nguyên tắc ủy thác công việc. &lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt; &lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;&lt;strong&gt;Phần 06: Giải quyết vấn đề &amp; ra quyết định&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Quy trình giải quyết vấn đề;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Xác định vấn đề. Xác định nguyên nhân; Ứng dụng công cụ trong giải quyết vấn đề.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Ra quyết định trong lãnh đạo; Những phương pháp ra quyết định hiệu quả.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Cơ sở ra quyết định; Đánh giá hiệu quả các quyết định.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;449&quot;&gt;Thực hành.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;h2&gt;LỊCH KHAI GIẢNG&lt;/h2&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;1&quot; cellspacing=&quot;0&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;KHÓA HỌC&lt;/td&gt;\r\n			&lt;td&gt;THỜI LƯỢNG&lt;/td&gt;\r\n			&lt;td&gt;NGÀY KHAI GIẢNG&lt;/td&gt;\r\n			&lt;td&gt;NGÀY KẾT THÚC&lt;/td&gt;\r\n			&lt;td&gt;THỨ&lt;/td&gt;\r\n			&lt;td&gt;THỜI GIAN&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;MMM – Năng lực quản trị cho Quản lý cấp trung(Live Learning)&lt;/td&gt;\r\n			&lt;td&gt;06 buổi&lt;/td&gt;\r\n			&lt;td&gt;24/11/2021&lt;/td&gt;\r\n			&lt;td&gt;09/12/2021&lt;/td&gt;\r\n			&lt;td&gt;Thứ 4, Thứ 5&lt;/td&gt;\r\n			&lt;td&gt;Tối: 19h00 – 22h00&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;h2&gt;MỤC TIÊU CHƯƠNG TRÌNH ĐÀO TẠO&lt;/h2&gt;\r\n\r\n&lt;p&gt;Khóa học được thiết kế nhằm mục đích cung cấp cho học viên những kiến thức, kỹ năng và thái độ cần thiết để phát triển năng lực quản lý &amp; Lãnh đạo trong một môi trường làm việc chuyên nghiệp. Vào cuối khóa, các học viên được mong đợi sẽ có thể:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Thừa nhận, thích nghi và chủ động giải quyết hiệu quả các công việc hàng ngày trong vai trò trách nhiệm của người quản lý &amp; lãnh đạo;&lt;/li&gt;\r\n		&lt;li&gt;Thực hiện các bước hoạch định công việc và ủy thác công việc hiệu quả;&lt;/li&gt;\r\n		&lt;li&gt;Lựa chọn phong cách lãnh đạo phù hợp;&lt;/li&gt;\r\n		&lt;li&gt;Sử dụng các kỹ năng giao tiếp, động viên để kích thích và thúc đẩy nhân viên làm việc hiệu quả;&lt;/li&gt;\r\n		&lt;li&gt;Huấn luyện, hướng dẫn trên công việc và đánh giá kết quả công việc của nhân viên;&lt;/li&gt;\r\n		&lt;li&gt;Xác định các cách tiếp cận và giải quyết hiệu quả các sự cố hoặc mâu thuẫn, khó khăn trong công việc;&lt;/li&gt;\r\n		&lt;li&gt;Biết cách xây dựng đội ngũ nhân viên và dẫn dắt đội hoàn thành mục tiêu chung;&lt;/li&gt;\r\n		&lt;li&gt;Lập kế hoạch hoàn thiện để nâng cao năng lực quản lý của bản thân và đáp ứng được yêu cầu công việc.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;ĐỐI TƯỢNG THAM GIA KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Khóa học được thiết kế cho các cấp Giám đốc chi nhánh, Trưởng bộ phận, trưởng/ phó phòng ban, cấp giám sát, quản lý, tổ trưởng, quản đốc hoặc các nhân viên được dự kiến đề bạt lên các vị trí giám sát, quản lý.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;GIẢNG VIÊN KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;Lê Quang Hạnh&lt;/strong&gt;&lt;/h3&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Chuyên gia – Giảng viên&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Lê Quang Hạnh là một chuyên gia về quản trị, quản lý điều hành doanh nghiệp. Ông từng trải qua nhiều vị trí quản lý cấp cao tại các doanh nghiệp lớn trong nước và quốc tế. Hiện nay, ông đang là Phó Chủ tịch Tài chính &amp; Kiểm soát, Tập đoàn Sản phẩm người tiêu dùng quốc tế và giảng dạy tại nhiều tổ chức uy tín. Lĩnh vực chuyên môn của ông: Lãnh đạo; Quản lý tài chính và kế toán; Dịch vụ khách hàng; Quản lý hệ thống ERP-SAP; Giao tiếp và Lập kế hoạch chiến lược.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Các khóa học đã đào tạo:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;CHƯƠNG TRÌNH ĐÀO TẠO TẠI HÀ NỘI&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/nang-cao-nang-luc-quan-ly-cap-trung/&quot;&gt;Nâng cao năng lực quản trị cho Quản lý cấp trung&lt;/a&gt;&lt;/li&gt;\r\n	&lt;li&gt;Tinh hoa quản trị&lt;/li&gt;\r\n	&lt;li&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/tai-chinh-danh-cho-nha-quan-tri-khong-chuyen/&quot;&gt;Tài chính dành cho các nhà quản trị không chuyên&lt;/a&gt;&lt;/li&gt;\r\n	&lt;li&gt;MMM – Năng lực quản trị cho Quản lý cấp trung(Live Learning)&lt;/li&gt;\r\n	&lt;li&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/hoc-truc-tuyen-qua-zoom/khoa-hoc-ceo-truc-tuyen-giam-doc-dieu-hanh-doanh-nghiep/&quot;&gt;CEO – Giám đốc điều hành chuyên nghiệp&lt;/a&gt;(Live Learning)&lt;/li&gt;\r\n	&lt;li&gt;Chiến lược kinh doanh thời Covid (Live Learning)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;CHƯƠNG TRÌNH ĐÀO TẠO TẠI TP HỒ CHÍ MINH&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/khoa-hoc-dao-tao-giang-vien-noi-bo/&quot;&gt;Đào tạo Giảng viên nội bộ&lt;/a&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/nang-cao-nang-luc-quan-ly-cap-trung/&quot;&gt;Nâng cao năng lực quản trị cho Quản lý cấp trung&lt;/a&gt;&lt;/li&gt;\r\n	&lt;li&gt;Chiến lược công ty thời đại dịch &amp; suy thoái kinh tế&lt;/li&gt;\r\n	&lt;li&gt;Quản trị tài chính thời đại dịch &amp; suy thoái kinh tế&lt;/li&gt;\r\n	&lt;li&gt;Kỹ năng giao tiếp hiệu quả&lt;/li&gt;\r\n	&lt;li&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/tai-chinh-danh-cho-nha-quan-tri-khong-chuyen/&quot;&gt;Tài chính dành cho các nhà quản trị không chuyên&lt;/a&gt;&lt;/li&gt;\r\n	&lt;li&gt;Chiến lược cạnh tranh&lt;/li&gt;\r\n	&lt;li&gt;Kỹ năng lãnh đạo hiệu quả&lt;/li&gt;\r\n	&lt;li&gt;Kỹ năng làm việc hiệu quả&lt;/li&gt;\r\n	&lt;li&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/ky-nang-thuyet-trinh-chuyen-nghiep/&quot;&gt;Kỹ năng Thuyết trình chuyên nghiệp&lt;/a&gt;&lt;/li&gt;\r\n	&lt;li&gt;MMM – Năng lực quản trị cho Quản lý cấp trung(Live Learning)&lt;/li&gt;\r\n	&lt;li&gt;&lt;a href=&quot;https://khoahocpti.edu.vn/hoc-truc-tuyen-qua-zoom/khoa-hoc-ceo-truc-tuyen-giam-doc-dieu-hanh-doanh-nghiep/&quot;&gt;CEO – Giám đốc điều hành chuyên nghiệp&lt;/a&gt;(Live Learning)&lt;/li&gt;\r\n	&lt;li&gt;Chiến lược kinh doanh thời Covid(Live Learning)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;5&lt;/strong&gt; / &lt;strong&gt;5&lt;/strong&gt; ( &lt;strong&gt;13&lt;/strong&gt; bình chọn )&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Học phí chương trình:&lt;/strong&gt; &lt;strong&gt;4,200,000đ&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Học phí ưu đãi:&lt;/strong&gt; &lt;strong&gt;3,200,000đ&lt;/strong&gt;&lt;br /&gt;\r\n&lt;strong&gt;Tư Vấn Đào Tạo&lt;/strong&gt;&lt;br /&gt;\r\nMobile: &lt;a href=&quot;tel:0907080758&quot;&gt;0907 080 758&lt;/a&gt; | E-mail: &lt;a href=&quot;mailto:info@khoahocpti.edu.vn&quot;&gt;info@khoahocpti.edu.vn&lt;/a&gt;&lt;/p&gt;\r\n', '', '', '', '', 'Khóa Học Năng Lực Quản Trị Cho Quản Lý Cấp Trung Trực Tuyến (Live Learning)', '', '', '', '', '', '', '', '', 0, 0, '', '', 1, 0, 'khoa-hoc', 1657852261, 1657856734, 2, 1),
(21, '', 3, 0, 10, 0, '', 0, 0, 'khoa20hoc20phong20thuy20danh20cho20doanh20nhan-12-592x400-7928.jpg', '', '{\"p\":\"khoa20hoc20phong20thuy20danh20cho20doanh20nhan-12-592x400-7928.jpg\",\"w\":null,\"h\":null,\"m\":null}', 'khoa-hoc-khoa-hoc-phong-thuy-danh-cho-doanh-nhan', '', '', '&lt;h2&gt;GIỚI THIỆU KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;p&gt;Chắc hẳn ai cũng biết rằng để thành công, ngoài khả năng chuyên môn, tài chính hay kinh nghiệm của bản thân, chúng ta phải đạt được “thiên thời – địa lợi – nhân hòa”. 3 yếu tố này được giải thích thấu đáo trong triết lý phong thủy, nhờ phong thủy có thể thay đổi được “địa lợi” và “nhân hòa”. Trong cuộc sống cơ hội đến chỉ có một và không phải ai cũng có thể dễ dàng nhận ra và nắm bắt lấy. Vậy phải làm thế nào để nắm bắt được những quy luật vận động của tự nhiên và con người để từ đó đưa ra các chiến lược  phù hợp?&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Hãy cùng chúng tôi đi tìm câu trả lời&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Con người và sinh thể tồn tại trong vũ trụ luôn chịu tác động bởi các nguồn năng lượng có trong vũ trụ. Phong thủy, môn khoa học thực nghiệm sẽ giúp con người thích nghi với môi trường sống thông qua việc sắp xếp, bài trí, tổ chức không gian sao cho thuận lợi và hợp lý nhất để đem lại sức khỏe, hạnh phúc và thịnh vượng. Vì thế phong thủy được ứng dụng vào tất cả yếu tố làm nên sự thành bại của một doanh nhân hay doanh nghiệp.&lt;/p&gt;\r\n\r\n&lt;p&gt;Theo các nhà phong thủy có uy tín, bạn không thể trở thành người hiểu biết về phong thủy xuất sắc chỉ trong một khóa học ngắn song bạn có thể nắm được những kiến thức tổng quát về phong thủy và áp dụng vào cuộc sống, hoạt động kinh doanh của bạn. Vấn đề là bạn có thể gặp được các chuyên gia phong thủy và nghe các bài giảng, những lời chia sẻ, các lời tư vấn của các chuyên gia đó không?&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Đây là cơ hội dành cho bạn!!!&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Chương trình “&lt;strong&gt;Phong thủy ứng dụng dành cho doanh nhân&lt;/strong&gt;” do Trường đào tạo Doanh nhân PTI xây dựng và tổ chức với sự tham gia của doanh nhân Nguyễn Ngoan sẽ mang đến cho bạn những kiến thức tổng quát và kinh nghiệm chuyên sâu giúp ứng dụng thực tiễn triết lý phong thủy vào kinh doanh.&lt;/p&gt;\r\n\r\n&lt;h4&gt;Đối tượng tham gia&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lãnh đạo, giám đốc, trưởng phòng các doanh nghiệp muốn phát triển công ty theo hướng bền vững hoặc cần tái cấu trúc công ty: chọn người tài, chọn đối tác làm ăn, chọn ngành nghề để đầu tư, nhằm tăng trưởng trong giai đoạn tiếp theo trong thời hội nhập TPP.&lt;/li&gt;\r\n	&lt;li&gt;Doanh nhân bắt đầu khởi nghiệp. Những cá nhân đam mê nghiên cứu với mong muốn mở rộng tri thức của mình theo nhiều hướng, và ứng dụng vào đời sống hàng ngày.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;Mục tiêu chương trình :&lt;/h4&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Sau khi hoàn thành khóa học, học viên có thể:&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Phân tích và thấu hiểu bản thân bạn, đối tác và nhân viên.&lt;/li&gt;\r\n	&lt;li&gt;Lựa chọn và quản lý đối tác, nhân viên tạo sức mạnh đội ngũ .&lt;/li&gt;\r\n	&lt;li&gt;Ứng dụng phong thủy vào việc xây dựng chiến lược kinh doanh và quản trị.&lt;/li&gt;\r\n	&lt;li&gt;Định hướng lĩnh vực đầu tư phát triễn trong tương lai của doanh nghiệp.&lt;/li&gt;\r\n	&lt;li&gt;Đặt tên công ty/ thương hiệu theo phong thủy.&lt;/li&gt;\r\n	&lt;li&gt;Thiết kế logo, bộ nhận diện thương hiệu theo cấu trúc âm dương ngũ hành.&lt;/li&gt;\r\n	&lt;li&gt;Tính toán chọn ngày giờ tung sản phẩm, tổ chức event, các sự kiện quan trọng.&lt;/li&gt;\r\n	&lt;li&gt;Hoặc xác định giúp con cái trong hôn nhân, gia đạo, công danh, sự nghiệp…&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;NỘI DUNG KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;table width=&quot;668&quot;&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;&lt;strong&gt;STT&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;&lt;strong&gt;NỘI DUNG&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 1&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Kiến thức phong thủy tổng quát&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 2&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Những ngành học liên quan đến phong thủy\r\n			&lt;p&gt;(thiên văn học, địa lý học, khí động học, tướng pháp học, đạo học)&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 3&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Cấu tạo vũ trụ (âm dương, ngũ hành và bát quái)&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 4&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Ứng dụng âm dương trong ẩm thực và đời sống (BĐS, nhà cửa, ẩm thực và đầu tư)&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 5&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Khám phá bản thân (thấu hiểu chính mình để thành công)&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 6&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Cung và Mạng của con người&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 7&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Phân định phương hướng – bát trạch&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 8&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Then chốt của Phong thủy&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;111&quot;&gt;Phần 9&lt;/td&gt;\r\n			&lt;td width=&quot;557&quot;&gt;Thiên thời – Địa lợi – Nhân hòa&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;4.9&lt;/strong&gt; / &lt;strong&gt;5&lt;/strong&gt; ( &lt;strong&gt;14&lt;/strong&gt; bình chọn )&lt;/p&gt;\r\n\r\n&lt;h2&gt;LỊCH KHAI GIẢNG KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;h3&gt;Lịch khai giảng tại TPHCM&lt;/h3&gt;\r\n\r\n&lt;p&gt;Địa điểm tổ chức&lt;strong&gt; khóa học Phong thủy dành cho Doanh Nhân &lt;/strong&gt;tại &lt;strong&gt;TPHCM&lt;/strong&gt; : Tầng 1, Tòa nhà Rivera Park, Số 7/28 Đường Thành Thái, Phường 14, Quận 10, TP.Hồ Chí Minh (&lt;a href=&quot;https://goo.gl/maps/Pesgm8E8o3sGGUzC6&quot;&gt;Xem bản đồ&lt;/a&gt;)&lt;/p&gt;\r\n\r\n&lt;table border=&quot;1&quot; cellpadding=&quot;1&quot; cellspacing=&quot;0&quot;&gt;\r\n	&lt;thead&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;KHÓA HỌC&lt;/td&gt;\r\n			&lt;td&gt;THỜI LƯỢNG&lt;/td&gt;\r\n			&lt;td&gt;NGÀY KHAI GIẢNG&lt;/td&gt;\r\n			&lt;td&gt;NGÀY KẾT THÚC&lt;/td&gt;\r\n			&lt;td&gt;THỨ&lt;/td&gt;\r\n			&lt;td&gt;THỜI GIAN&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/thead&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Khoa học phong thủy dành cho Doanh Nhân&lt;/td&gt;\r\n			&lt;td&gt;06 buổi&lt;/td&gt;\r\n			&lt;td&gt;13/05/2022&lt;/td&gt;\r\n			&lt;td&gt;15/05/2022&lt;/td&gt;\r\n			&lt;td&gt;Thứ 6, Thứ 7, Chủ Nhật&lt;/td&gt;\r\n			&lt;td&gt;Sáng: 8h30 – 11h30\r\n			&lt;p&gt;Chiều: 13h30 – 16h30&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Khoa học phong thủy dành cho Doanh Nhân&lt;/td&gt;\r\n			&lt;td&gt;06 buổi&lt;/td&gt;\r\n			&lt;td&gt;19/08/2022&lt;/td&gt;\r\n			&lt;td&gt;28/08/2022&lt;/td&gt;\r\n			&lt;td&gt;Thứ 6, Thứ 7, Chủ Nhật&lt;/td&gt;\r\n			&lt;td&gt;Sáng: 8h30 – 11h30\r\n			&lt;p&gt;Chiều: 13h30 – 16h30&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Khoa học phong thủy dành cho Doanh Nhân&lt;/td&gt;\r\n			&lt;td&gt;06 buổi&lt;/td&gt;\r\n			&lt;td&gt;18/11/2022&lt;/td&gt;\r\n			&lt;td&gt;20/11/2022&lt;/td&gt;\r\n			&lt;td&gt;Thứ 6, Thứ 7, Chủ Nhật&lt;/td&gt;\r\n			&lt;td&gt;Tối: 18h00 – 21h00&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', '', '', '', '', 'KHÓA HỌC KHOA HỌC PHONG THỦY DÀNH CHO DOANH NHÂN', '', '', '', '', '', '', '', '', 0, 0, '', '', 1, 0, 'khoa-hoc', 1657855013, 0, 7, 1),
(22, '', 3, 0, 11, 0, '', 0, 0, 'nhan-tuong-hoc-1185x800-6860.jpg', '', '{\"p\":\"nhan-tuong-hoc-1185x800-6860.jpg\",\"w\":null,\"h\":null,\"m\":null}', 'khoa-hoc-nhan-tuong-hoc-trong-quan-tri-nhan-su', '', '', '&lt;h2&gt;NỘI DUNG KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;73&quot;&gt;&lt;strong&gt;TT&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;640&quot;&gt;&lt;strong&gt;NỘI DUNG CHƯƠNG TRÌNH&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;73&quot;&gt;&lt;strong&gt;&lt;u&gt;1&lt;/u&gt;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;640&quot;&gt;Khuôn mặt không biết nói dối&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;73&quot;&gt;&lt;strong&gt;&lt;u&gt;2&lt;/u&gt;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;640&quot;&gt;Những điều cơ bản của nhân diện&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;73&quot;&gt;&lt;strong&gt;&lt;u&gt;3&lt;/u&gt;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;640&quot;&gt;Bách tuế đồ&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;73&quot;&gt;&lt;strong&gt;&lt;u&gt;4&lt;/u&gt;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;640&quot;&gt;12 Cung của khuôn mặt&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;73&quot;&gt;&lt;strong&gt;&lt;u&gt;5&lt;/u&gt;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;640&quot;&gt;Nốt ruồi trong nhân diện&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;73&quot;&gt;&lt;strong&gt;&lt;u&gt;6&lt;/u&gt;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;640&quot;&gt;Thực hành nhân diện&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td width=&quot;73&quot;&gt;&lt;strong&gt;&lt;u&gt;7&lt;/u&gt;&lt;/strong&gt;&lt;/td&gt;\r\n			&lt;td width=&quot;640&quot;&gt;Kết hợp văn hóa Đông – Tây&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n', '', '&lt;h2&gt;GIỚI THIỆU KHÓA HỌC&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;“Hữu tâm, vô tướng, tướng do tâm sinh Hữu tướng, vô tâm, tướng do tâm diệt” &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Nhân tướng họ&lt;/strong&gt;c là bộ môn giúp con người lánh được tai họa tìm đến  bình an và hạnh phúc…  Cái đích mà bộ môn hướng đến rất sáng, giúp người học hiểu và tự hoàn thiện bản thân, rèn tâm, sửa tướng. Việc học tập, tích lũy kiến thức về Nhân tướng học cũng giúp cho mỗi chúng ta hiểu biết về người khác để giúp đỡ họ trong cuộc sống.&lt;/p&gt;\r\n\r\n&lt;p&gt;Trong kinh doanh: Biết người, biết ta, trăm trận trăm thắng. Chắt lọc những tinh hoa của Nhân tướng học, nhận diện học vào quản trị nhân sự là một việc rất cần thiết và vô cùng thiết thực, nhằm giúp các nhà Lãnh đạo, nhà Quản lý áp dụng một cách đơn giản nhất, không bị nhuốm màu mê tín.&lt;/p&gt;\r\n\r\n&lt;p&gt;Chương trình đào tạo “&lt;strong&gt;Nhân tướng học trong quản trị nhân sự&lt;/strong&gt;” do các chuyên gia của Tổ chức Giáo dục Đào tạo PTI thiết kế, tổ chức sẽ giúp người học hiểu rõ được bản thân mình, cách thay đổi vận mệnh thông qua việc thay đối nhân tướng, vận dụng nhân tướng học để giữ người và dùng người, trọng dụng nhân tài cũng như học nghệ thuật đối nhân xử thế của người xưa ứng dụng vào quản lý điều hành doanh nghiệp.&lt;/p&gt;\r\n\r\n&lt;h4&gt;Đối tượng tham gia&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Các cấp lãnh đạo doanh nghiệp như: Chủ tịch HĐQT, Phó Chủ tịch HĐQT,  Tổng giám đốc, Phó Tổng giám đốc&lt;/li&gt;\r\n	&lt;li&gt;Giám đốc/Phó Giám đốc, trưởng/phó phòng các khối chức năng: Nhân sự, Hành chính – kế toán, Kinh doanh, Truyền thông…&lt;/li&gt;\r\n	&lt;li&gt;Cá nhân có niềm yêu thích với bộ môn Nhân tướng học, phong thủy, tướng tay.&lt;/li&gt;\r\n	&lt;li&gt;Đặc biệt là những cá nhân thường xuyên thay đổi nơi sống, thường xuyên tiếp xúc, làm việc, giao tiếp với con người.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;Mục tiêu chương trình :&lt;/h4&gt;\r\n\r\n&lt;p&gt;&lt;em&gt;Sau khi hoàn thiện chương trình đào tạo, học viên có thể:&lt;/em&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Hiểu đúng được vai trò của Nhân tướng học trong công việc và cuộc sống.&lt;/li&gt;\r\n	&lt;li&gt;Phân biệt giữa giá trị của môn Nhân tướng học với những điều mê tín dị đoan trong xã hội.&lt;/li&gt;\r\n	&lt;li&gt;Điều chỉnh bản thân, hướng tâm xây dựng những điều tốt đẹp trong cuộc sống.&lt;/li&gt;\r\n	&lt;li&gt;Biết cách ứng dụng được ngay kiến thức từ Nhân tướng học vào cuộc sống, hoạt động kinh doanh như: chọn bạn giao lưu, chọn bạn đời, tuyển dụng, chọn đối tác làm ăn… dự liệu trước được phần nào rủi ro, vững tin ở bản thân và người khác…&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '', '', 'KHÓA HỌC NHÂN TƯỚNG HỌC TRONG QUẢN TRỊ NHÂN SỰ', '', '', '', '', '', '', '', '', 0, 0, '', '', 1, 0, 'khoa-hoc', 1657855241, 0, 1, 1),
