(31, '42', 3, 0, 11, 0, '', 0, 0, 'vovinam-5654.png', '', '{\"p\":\"vovinam-5654.png\",\"w\":null,\"h\":null,\"m\":null}', 'vo-vovinam-3-thang-tang-vo-phuc', '', '', '', '', '', '', '', 'Võ Vovinam Tự Vệ 3 THÁNG TẶNG VÕ PHỤC ', '', '', '', '', '', '', '', '', 1050000, 1050000, '', '', 3, 1, 'khoa-hoc', 1686136743, 1710127700, 595, 1),
(32, '42', 3, 0, 11, 0, '', 0, 0, 'noi-dung-khoa-tin-hoc-can-ban-k01-7637-5412.png', '', '{\"p\":\"noi-dung-khoa-tin-hoc-can-ban-k01-7637-5412.png\",\"w\":null,\"h\":null,\"m\":null}', 'tin-hoc-can-ban-k01', '', '', '&lt;p&gt;&lt;strong&gt;Học viên &lt;/strong&gt;đào tạo theo phương pháp&lt;em&gt; hướng dẫn thực hành trực tiếp theo khả năng của từng học viên&lt;/em&gt;, giúp học viên học được thoải mái và hiệu quả. Nội dung học sẽ nặng về &lt;strong&gt;thực hành thực tế&lt;/strong&gt; đảm bảo học viên học xong có thể làm thực tế được.&lt;/p&gt;\r\n\r\n&lt;p&gt;Sau khóa học THCB &lt;strong&gt;K01 &lt;/strong&gt;học viên có thể:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Hiểu các khái niệm cơ bản về máy tính&lt;/li&gt;\r\n	&lt;li&gt;Biết cách bật/tắt máy, gõ văn bản, Tiếng Việt&lt;/li&gt;\r\n	&lt;li&gt;Biết quản lý File và thư mục&lt;/li&gt;\r\n	&lt;li&gt;Biết quản lý Hệ Điều Hành Windows&lt;/li&gt;\r\n	&lt;li&gt;Biết sử dụng Internet để đọc báo, xem phim, giải trí&lt;/li&gt;\r\n	&lt;li&gt;Biết tìm kiếm thông tin google&lt;/li&gt;\r\n	&lt;li&gt;Biết sử dụng Email&lt;/li&gt;\r\n	&lt;li&gt;Biết sử dụng Facebook&lt;/li&gt;\r\n	&lt;li&gt;Biết sử dụng Chat Skype, Yahoo, FB Messenger…&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569254&quot;&gt;&lt;/a&gt;Buổi 1 - Tổng Quan&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tổng quan&lt;/li&gt;\r\n		&lt;li&gt;Cách bật / tắt&lt;/li&gt;\r\n		&lt;li&gt;Cách sử dụng bàn phím + chuột&lt;/li&gt;\r\n		&lt;li&gt;Các thao tác của sổ/ thanh Taskbar…&lt;/li&gt;\r\n		&lt;li&gt;Mở xem phim/nghe nhạc…&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Bật/Tăt/Gõ/Mở/Đóng&lt;/li&gt;\r\n		&lt;li&gt;Nghe nhạc/Phim offline&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569255&quot;&gt;&lt;/a&gt;Buổi 2 - Quản lý File&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (Quản lý File)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;File và thư mục&lt;/li&gt;\r\n		&lt;li&gt;Sử dụng Window Explore&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tạo cây thư mục&lt;/li&gt;\r\n		&lt;li&gt;Thao tác copy/xóa/đổi tên…&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569256&quot;&gt;&lt;/a&gt;Buổi 3 - Tiện ích&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (Tiện ích)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Paint&lt;/li&gt;\r\n		&lt;li&gt;Wordpad + Notepad + Cách gõ tiếng việt&lt;/li&gt;\r\n		&lt;li&gt;Snipping&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Vẽ, gõ Văn bản, Copy màn hình&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569257&quot;&gt;&lt;/a&gt;Buổi 4 - Quản trị&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (quản trị)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Thay đổi màu , kích cở màn hình&lt;/li&gt;\r\n		&lt;li&gt;Thay đổi ngày giờ&lt;/li&gt;\r\n		&lt;li&gt;Xem cấu hình máy&lt;/li&gt;\r\n		&lt;li&gt;Xem Driver&lt;/li&gt;\r\n		&lt;li&gt;Cài/Gở phần mềm&lt;/li&gt;\r\n		&lt;li&gt;Xem và Cài đặt máy in cục bộ&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569259&quot;&gt;&lt;/a&gt;Buổi 5 - Internet 1&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (Internet 1)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tổng quan&lt;/li&gt;\r\n		&lt;li&gt;Duyệt Web bằng IE&lt;/li&gt;\r\n		&lt;li&gt;Tìm kiếm bằng Google&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Dùng IE đọc báo&lt;/li&gt;\r\n		&lt;li&gt;Tìm kiếm google&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569260&quot;&gt;&lt;/a&gt;Buổi 6 - Internet 2&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (Internet 2)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Firefox và chrome&lt;/li&gt;\r\n		&lt;li&gt;Bookmark/Favorite&lt;/li&gt;\r\n		&lt;li&gt;Clear cache&lt;/li&gt;\r\n		&lt;li&gt;Youtube&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Sử dung Firefox, Chrome&lt;/li&gt;\r\n		&lt;li&gt;Sử dụng Youtube&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569261&quot;&gt;&lt;/a&gt;Buổi 7 &amp; 8 - Email&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (E-mail)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tổng quan email&lt;/li&gt;\r\n		&lt;li&gt;Tạo và thao tác Gmail&lt;/li&gt;\r\n		&lt;li&gt;Tạo và thao tác Yahoo mail&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tạo và sử dụng Gmail / Yahoo mail&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569262&quot;&gt;&lt;/a&gt;Buổi 9 - Chat&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (Chat)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Skype&lt;/li&gt;\r\n		&lt;li&gt;Yahoo Messenger&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tạo và sử dụng Skype / YM&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;_Toc327569263&quot;&gt;&lt;/a&gt;Buổi 10 - Mạng xã hội&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (Facebook)\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tạo Account&lt;/li&gt;\r\n		&lt;li&gt;Upload ảnh/ Post….&lt;/li&gt;\r\n		&lt;li&gt;Tìm kiếm.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;Thực hành\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tạo và sử dụng Facebook&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '', '&lt;p&gt;&lt;strong&gt;Học viên &lt;/strong&gt;đào tạo theo phương pháp&lt;em&gt; hướng dẫn thực hành trực tiếp theo khả năng của từng học viên&lt;/em&gt;, giúp học viên học được thoải mái và hiệu quả. Nội dung học sẽ nặng về &lt;strong&gt;thực hành thực tế&lt;/strong&gt; đảm bảo học viên học xong có thể làm thực tế được.&lt;/p&gt;\r\n', '&lt;p&gt;&lt;strong&gt;Học viên &lt;/strong&gt;đào tạo theo phương pháp&lt;em&gt; hướng dẫn thực hành trực tiếp theo khả năng của từng học viên&lt;/em&gt;, giúp học viên học được thoải mái và hiệu quả. Nội dung học sẽ nặng về &lt;strong&gt;thực hành thực tế&lt;/strong&gt; đảm bảo học viên học xong có thể làm thực tế được.&lt;/p&gt;\r\n', '', 'TIN HỌC CĂN BẢN K01', '', '', '', '', '', '', '', '', 1500000, 2000, '', '', 1, 0, 'khoa-hoc', 1687675628, 0, 37, 1);
INSERT INTO `table_courses` (`id`, `id_teachers`, `id_list`, `id_item`, `id_cat`, `id_sub`, `id_tags`, `noibat`, `tb`, `photo`, `icon`, `options`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `gioithieuvi`, `tenen`, `tenvi`, `tenko`, `tenkhongdauko`, `motako`, `noidungko`, `taptin`, `link`, `link_video`, `thoigian`, `giamoi`, `giatien`, `lichhocvi`, `ghichuvi`, `stt`, `hienthi`, `type`, `ngaytao`, `ngaysua`, `luotxem`, `id_club`) VALUES
(33, '42', 3, 0, 11, 0, '', 0, 0, 'soan-thao-van-ban-word-6498-2894.png', '', '{\"p\":\"soan-thao-van-ban-word-6498-2894.png\",\"w\":null,\"h\":null,\"m\":null}', 'soan-van-ban-word-k02', '', '', '&lt;p&gt;Sau khóa học soạn thạo văn bản bằng Word (&lt;strong&gt;K11&lt;/strong&gt;) học viên có thể:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Làm  thành thạo các văn bản thực tế như hợp đồng, công văn, báo giá, đơn từ, phiếu điền thông tin…&lt;/li&gt;\r\n	&lt;li&gt;Tự làm được hoàn thiện một văn bản dài như: đồ án tốt nghiệp, đề án khả thi, hồ sơ dự thầu, kế hoạch kinh doanh…&lt;/li&gt;\r\n	&lt;li&gt;Biết cách trộn văn bản để làm giấy mời hoặc gửi mail cùng lúc cho nhiều bạn bè, khách hàng…&lt;/li&gt;\r\n	&lt;li&gt;Thành thạo việc thiết lập trang và in ấn tài liệu.&lt;/li&gt;\r\n	&lt;li&gt;Biết cách kết xuất ra các dạng khác như PDF.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Nội dung đào tạo của khóa tin học văn phòng K11 sẽ như sau:&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 1 - Các thao tác cơ bản&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Giới thiệu chung: mục đích khóa học, cách thức học&lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu tổng quát về máy tính, phần mềm&lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu màn hình Word 2010&lt;/li&gt;\r\n	&lt;li&gt;Thao tác với tập tin Word: New, Save, Save as, Close, Open&lt;/li&gt;\r\n	&lt;li&gt;Cách thức nhập liệu&lt;/li&gt;\r\n	&lt;li&gt;Các phím &amp; tổ hợp phím&lt;/li&gt;\r\n	&lt;li&gt;Định dạng font chữ&lt;/li&gt;\r\n	&lt;li&gt;Định dạng đoạn – Paragraph cơ bản (đầu dòng, left, right)&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 2 - Định dạng văn bản&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Định dạng đoạn nâng cao: đóng khung, màu nền, khoảng cách dòng, khoảng cách đoạn&lt;/li&gt;\r\n	&lt;li&gt;Cách thức đặt TAB&lt;/li&gt;\r\n	&lt;li&gt;Bullets &amp; Number&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 3 - Xử lý hình ảnh&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Chèn ảnh có sẵn (picture)&lt;/li&gt;\r\n	&lt;li&gt;Chèn ảnh nghệ thuật (ClipArt)&lt;/li&gt;\r\n	&lt;li&gt;Chèn hình vẽ (Shape)&lt;/li&gt;\r\n	&lt;li&gt;Chèn biểu đồ (Chart)&lt;/li&gt;\r\n	&lt;li&gt;Chụp hình màn hình (Screenshot)&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 4 - WordArt &lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Chữ nghệ thuật (WordArt)&lt;/li&gt;\r\n	&lt;li&gt;Hộp văn bản (Text Box)&lt;/li&gt;\r\n	&lt;li&gt;Công thức toán học (Equation)&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 5 - Định dạng Header &amp; Footer&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Tạo ký tự HOA đầu đoạn văn (Drop Cap)&lt;/li&gt;\r\n	&lt;li&gt;Tạo cột báo&lt;/li&gt;\r\n	&lt;li&gt;Chèn các ký tự đặt biệt (Symbol)&lt;/li&gt;\r\n	&lt;li&gt;Tạo Bookmark, Hyperlink, Reference&lt;/li&gt;\r\n	&lt;li&gt;Header/Footer: tạo đầu trang, cuối trang&lt;/li&gt;\r\n	&lt;li&gt;Thao tác với trang (Page): kích thước, hướng, thêm, xóa…&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 6 - Thao tác trên bản&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Tạo bảng&lt;/li&gt;\r\n	&lt;li&gt;Thao tác trên bảng: chọn, thêm, bớt hàng/cột/ô, căn lề…&lt;/li&gt;\r\n	&lt;li&gt;Trang trí: đóng khung, chọn kiểu bảng…&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 7 -  Định dạng Mục lục&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (Style &amp; Index)&lt;/li&gt;\r\n	&lt;li&gt;Tạo stype&lt;/li&gt;\r\n	&lt;li&gt;Gán style&lt;/li&gt;\r\n	&lt;li&gt;Style &amp; Bullets and number&lt;/li&gt;\r\n	&lt;li&gt;Làm mục lục cho tài liệu (Table of Contents)&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 8 - Bảo mật tài liệu&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Template&lt;/li&gt;\r\n	&lt;li&gt;Tìm kiếm và thay thế&lt;/li&gt;\r\n	&lt;li&gt;Kiểm tra chính tả&lt;/li&gt;\r\n	&lt;li&gt;Track sự thay đổi&lt;/li&gt;\r\n	&lt;li&gt;Thêm ghi chú (Comment)&lt;/li&gt;\r\n	&lt;li&gt;Review tài liệu&lt;/li&gt;\r\n	&lt;li&gt;Mật khẩu bảo vệ (Pass)&lt;/li&gt;\r\n	&lt;li&gt;Show/Hide ký tự đặc biệt&lt;/li&gt;\r\n	&lt;li&gt;Thực hành (tổng hợp và nâng cao)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 9 - Gửi thư hàng loạt&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết (Mail Merge)&lt;/li&gt;\r\n	&lt;li&gt;Tạo dữ liệu nguồn&lt;/li&gt;\r\n	&lt;li&gt;Tạo mẫu&lt;/li&gt;\r\n	&lt;li&gt;Trộn&lt;/li&gt;\r\n	&lt;li&gt;Thực hành (tổng hợp và nâng cao)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Buổi 10 - Bản quyền &amp; In ấn&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Tạo màu nền&lt;/li&gt;\r\n	&lt;li&gt;Đóng khung&lt;/li&gt;\r\n	&lt;li&gt;Watermark&lt;/li&gt;\r\n	&lt;li&gt;Footnote và Endnote&lt;/li&gt;\r\n	&lt;li&gt;Thiết lập trang in&lt;/li&gt;\r\n	&lt;li&gt;In ấn&lt;/li&gt;\r\n	&lt;li&gt;Thực hành (tổng hợp và nâng cao)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '', '&lt;p&gt;Microsoft Word là một chương trình soạn thảo văn bản khá phổ biến hiện nay. Nó cho phép người dùng làm việc với văn bản thô (text), các hiệu ứng như phông chữ, màu sắc, cùng với hình ảnh đồ họa (graphics) và nhiều hiệu ứng đa phương tiện (multimedia) khác như âm thanh, video khiến cho việc soạn thảo văn bản được thuận tiện hơn.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ngoài ra, cũng có các công cụ như kiểm tra chính tả, ngữ pháp của nhiều ngôn ngữ khác nhau để hỗ trợ người sử dụng. Các phiên bản của Word thường lưu tên tập tin với đuôi .doc hoặc .docx và có thể mở rộng thêm các định dạng như .txt, .html,…&lt;/p&gt;\r\n\r\n&lt;p&gt;Thành thạo kiến thức về Microsoft Word sẽ giúp bạn hoàn thiện những kỹ năng văn phòng, tạo nền tảng cho việc phát triển và thăng tiến sự nghiệp trong tương lai.&lt;/p&gt;\r\n', '&lt;p&gt;Microsoft Word là một chương trình soạn thảo văn bản khá phổ biến hiện nay. Nó cho phép người dùng làm việc với văn bản thô (text), các hiệu ứng như phông chữ, màu sắc, cùng với hình ảnh đồ họa (graphics) và nhiều hiệu ứng đa phương tiện (multimedia) khác như âm thanh, video khiến cho việc soạn thảo văn bản được thuận tiện hơn.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ngoài ra, cũng có các công cụ như kiểm tra chính tả, ngữ pháp của nhiều ngôn ngữ khác nhau để hỗ trợ người sử dụng. Các phiên bản của Word thường lưu tên tập tin với đuôi .doc hoặc .docx và có thể mở rộng thêm các định dạng như .txt, .html,…&lt;/p&gt;\r\n\r\n&lt;p&gt;Thành thạo kiến thức về Microsoft Word sẽ giúp bạn hoàn thiện những kỹ năng văn phòng, tạo nền tảng cho việc phát triển và thăng tiến sự nghiệp trong tương lai.&lt;/p&gt;\r\n', '', ' SOẠN VĂN BẢN WORD K02', '', '', '', '', '', '', '', '', 1500000, 2000000, '', '', 1, 0, 'khoa-hoc', 1687675889, 0, 51, 1),
(34, '42', 3, 0, 11, 0, '', 0, 0, 'excel-danh-cho-van-phong-3485-7941.png', '', '{\"p\":\"excel-danh-cho-van-phong-3485-7941.png\",\"w\":null,\"h\":null,\"m\":null}', 'excel-van-phong-k03', '', '', '&lt;p&gt;&lt;strong&gt;FC&lt;/strong&gt; đào tạo theo phương pháp&lt;em&gt; hướng dẫn thực hành trực tiếp theo khả năng của từng học viên&lt;/em&gt;, giúp học viên học được thoải mái và hiệu quả. Nội dung học sẽ nặng về &lt;strong&gt;thực hành thực tế&lt;/strong&gt; đảm bảo học viên học xong có thể làm thực tế được.&lt;/p&gt;\r\n\r\n&lt;p&gt;Sau khóa học bảng tính Excel &lt;b&gt;K02 &lt;/b&gt;học viên có thể:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Nắm rõ và vận dụng thành thạo đa số các hàm thông dụng trong Excel như các hàm thống kê (sum, count. max, min), các hàm có điều kiện (sumif, countif), các hàm điều kiện (if, and, or), các hàm tra tìm (hlookup, vlookup, match, index), các hàm database (dsum, dmin, dmax), các hàm chuỗi và ngày…&lt;/li&gt;\r\n	&lt;li&gt;Làm được các bảng tính tính toán như: bảng lương, bảng nhập xuất tồn, bảng dự toán, sổ sách bán hàng, sổ sách kế toán…&lt;/li&gt;\r\n	&lt;li&gt;Thành thạo vẽ các dạng biểu đồ phân tích và thống kê&lt;/li&gt;\r\n	&lt;li&gt;Thành thạo các thao tác liên quan dữ liệu như sắp xếp, lọc, rút trích,  phân tích dữ liệu đa chiều (PIVOT Table)…&lt;/li&gt;\r\n	&lt;li&gt;Thành thạo việc thiết lập trang, chọn vùng in và in ấn các bảng tính.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 1 - Các thao tác cơ bản trên Excel&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Giới thiệu chung Excel&lt;/li&gt;\r\n	&lt;li&gt;Các thành phần trong màn hình Excel&lt;/li&gt;\r\n	&lt;li&gt;Workbook/Worksheet/Row/Col/Cell&lt;/li&gt;\r\n	&lt;li&gt;Thao tác với tập tin Word: New, Save, Save as, Close, Open&lt;/li&gt;\r\n	&lt;li&gt;Các kiểu dữ liệu&lt;/li&gt;\r\n	&lt;li&gt;Công thức đơn giản&lt;/li&gt;\r\n	&lt;li&gt;Đóng khung&lt;/li&gt;\r\n	&lt;li&gt;Định dạng Font&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 2 - Hàm điều kiện &amp; thống kê&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Công thức và Hàm&lt;/li&gt;\r\n	&lt;li&gt;Hàm IF, biểu thức điều kiện&lt;/li&gt;\r\n	&lt;li&gt;Hàm RANK&lt;/li&gt;\r\n	&lt;li&gt;Hàm thống kê: SUM, MAX, MIN, AVG, COUNT&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 3 -  Hàm logic&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Biểu thức logic&lt;/li&gt;\r\n	&lt;li&gt;Các phép toán quan hệ AND và OR&lt;/li&gt;\r\n	&lt;li&gt;Sử dụng IF với AND và OR&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 4 - Địa chỉ tham chiếu&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Địa chỉ tương đối&lt;/li&gt;\r\n	&lt;li&gt;Địa chỉ tuyệt đối/Hỗn hợp&lt;/li&gt;\r\n	&lt;li&gt;Hàm tra cứu VLOOKUP, HLOOKUP&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 5 - Hàm xử lý chuỗi&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Lý thuyết&lt;/li&gt;\r\n	&lt;li&gt;Hàm INDEX, MATCH, OFFSET&lt;/li&gt;\r\n	&lt;li&gt;Hàm liên quan đến chuỗi: LEFT, RIGHT, MID…&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 6 -  Lọc dữ liệu&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Sắp xếp&lt;/li&gt;\r\n	&lt;li&gt;Lọc tự động (Auto Filter)&lt;/li&gt;\r\n	&lt;li&gt;Lọc nâng cao (Advanced Filter)&lt;/li&gt;\r\n	&lt;li&gt;Tổng theo nhóm (SubTotal)&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 7 - Các hàm về Database&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Database trong excel&lt;/li&gt;\r\n	&lt;li&gt;Vùng điều kiện&lt;/li&gt;\r\n	&lt;li&gt;Các hàm database: DSUM, DMAX, DAVERAGE, DMAX, DCOUNT&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 8 - Đồ thị thông dụng&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Đồ thị&lt;/li&gt;\r\n	&lt;li&gt;Vẽ đồ thị trong Excel&lt;/li&gt;\r\n	&lt;li&gt;Thay đổi, định dạng đồ thị&lt;/li&gt;\r\n	&lt;li&gt;Đồ thị đặc biệt Sparklines, Trendline…&lt;/li&gt;\r\n	&lt;li&gt;Thực hành (Tổng hợp và nâng cao)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 9 - Đồ thị phần tiếp theo&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Phân tích dữ liệu?&lt;/li&gt;\r\n	&lt;li&gt;Tạo dữ liệu nguồn&lt;/li&gt;\r\n	&lt;li&gt;Phân tích bằng Pivot table&lt;/li&gt;\r\n	&lt;li&gt;Làm sạch dữ liệu (Data Cleaning)&lt;/li&gt;\r\n	&lt;li&gt;Thực hành (Tổng hợp và nâng cao)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Buổi 10 - Định dạng &amp; kiểm tra dữ liệu&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Định dạng theo điều kiện (Conditional Formating)&lt;/li&gt;\r\n	&lt;li&gt;Kiểm tra hợp lệ dữ liệu (Data Validation)&lt;/li&gt;\r\n	&lt;li&gt;Xem lại /Duyệt nội dung (Review)&lt;/li&gt;\r\n	&lt;li&gt;In ấn&lt;/li&gt;\r\n	&lt;li&gt;Thực hành (Tổng hợp và nâng cao)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '', '&lt;p&gt;Khóa học Excel cơ bản được biên soạn dựa trên những tình huống thực tế trong công việc sát với doanh nghiệp có tính ứng dụng cao.&lt;/p&gt;\r\n', '&lt;p&gt;Khóa học Excel cơ bản được biên soạn dựa trên những tình huống thực tế trong công việc sát với doanh nghiệp có tính ứng dụng cao.&lt;/p&gt;\r\n', '', 'EXCEL VĂN PHÒNG K03', '', '', '', '', '', '', '', '', 1500000, 2000000, '', '', 1, 0, 'khoa-hoc', 1687676049, 0, 45, 1),
(35, '42', 3, 0, 11, 0, '', 0, 0, 'ung-dung-cntt-co-ban-3338.png', '', '{\"p\":\"ung-dung-cntt-co-ban-3338.png\",\"w\":null,\"h\":null,\"m\":null}', 'ung-dung-cntt-co-ban', '', '', '&lt;h4 class=&quot;panel-title&quot; style=&quot;float:left; padding-top:3px; width: 95%&quot;&gt;&lt;strong&gt;1. Hiểu biết về Công nghệ thông tin cơ bản&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Kiến thức cơ bản về máy tính và mạng máy tính&lt;/li&gt;\r\n	&lt;li&gt;Các ứng dụng của công nghệ thông tin - truyền thông (CNTT -TT)&lt;/li&gt;\r\n	&lt;li&gt;An toàn lao động và bảo vệ môi trường trong sử dụng công nghệ thông tin - truyền thông&lt;/li&gt;\r\n	&lt;li&gt;Các vấn đề an toàn thông tin cơ bản khi làm việc với máy tính&lt;/li&gt;\r\n	&lt;li&gt;Một số vấn đề cơ bản liên quan đến pháp luật trong sử dụng công nghệ thông tin&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;div&gt;&lt;strong&gt;2. Sử dụng máy tính cơ bản&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Các hiểu biết cơ bản để bắt đầu làm việc với máy tính&lt;/li&gt;\r\n	&lt;li&gt;Làm việc với hệ điều hành&lt;/li&gt;\r\n	&lt;li&gt;Thao tác trong Windows Explorer&lt;/li&gt;\r\n	&lt;li&gt;Thao tác trên màn hình Desktop&lt;/li&gt;\r\n	&lt;li&gt;Control panel&lt;/li&gt;\r\n	&lt;li&gt;Kiểu gõ Tiếng Việt&lt;/li&gt;\r\n	&lt;li&gt;Sử dụng máy in&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;div&gt;&lt;strong&gt;3. Microsoft Word cơ bản &lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Tổng quan về Microsoft Word&lt;/li&gt;\r\n	&lt;li&gt;Một số thao tác cơ bản và thông dụng&lt;/li&gt;\r\n	&lt;li&gt;Định dạng ký tự&lt;/li&gt;\r\n	&lt;li&gt;Định dạng đoạn văn bản&lt;/li&gt;\r\n	&lt;li&gt;ĐỊnh dạng trang tài liệu&lt;/li&gt;\r\n	&lt;li&gt;Chèn đối tượng vào văn bản&lt;/li&gt;\r\n	&lt;li&gt;Tham chiếu&lt;/li&gt;\r\n	&lt;li&gt;Lập bảng biểu (Table)&lt;/li&gt;\r\n	&lt;li&gt;Hoàn tất văn bản&lt;/li&gt;\r\n	&lt;li&gt;Soạn thông điệp và văn bản hành chính&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;div&gt;&lt;strong&gt;4. Microsoft Powerpoint cơ bản&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Giới thiệu&lt;/li&gt;\r\n	&lt;li&gt;Các thao tác thêm, xóa slide, chèn hình ảnh&lt;/li&gt;\r\n	&lt;li&gt;Sử dụng định dạng Themes có sẵn&lt;/li&gt;\r\n	&lt;li&gt;Định dạng background&lt;/li&gt;\r\n	&lt;li&gt;Bảng&lt;/li&gt;\r\n	&lt;li&gt;Đưa biểu đồ, sơ đồ tổ chức vào trong trang thuyết trình&lt;/li&gt;\r\n	&lt;li&gt;Thiết lập ứng dụng&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;div&gt;&lt;strong&gt;5. Microsoft Excel cơ bản&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Tổng quan về Microsoft Excel&lt;/li&gt;\r\n	&lt;li&gt;Định dạng dữ liệu trong Excel&lt;/li&gt;\r\n	&lt;li&gt;Hàm trong bảng tính Excel&lt;/li&gt;\r\n	&lt;li&gt;Biểu đồ&lt;/li&gt;\r\n	&lt;li&gt;Kết xuất và phân phối trang tính, bảng tính&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;div&gt;&lt;strong&gt;6. Sử dụng Internet&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Kiến thức cơ bản về Internet&lt;/li&gt;\r\n	&lt;li&gt;Sử dụng trình duyệt web&lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu các công cụ tìm kiếm trên web (google, bing)&lt;/li&gt;\r\n	&lt;li&gt;Kỹ năng tìm kiếm&lt;/li&gt;\r\n	&lt;li&gt;Sử dụng thư điện tử&lt;/li&gt;\r\n	&lt;li&gt;Một số dạng truyền thông số thông dụng&lt;/li&gt;\r\n	&lt;li&gt;An toàn thông tin&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;div&gt;&lt;strong&gt;7. Ôn tập và thi&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Học viên sẽ có buổi ôn tập và thi tập trung tại phòng máy thực hành tại Trung Tâm, áp dụng cho cả 2 hình thức học offline và online&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '', '&lt;div class=&quot;nganh-noi-dung&quot;&gt;\r\n&lt;ul&gt;\r\n	&lt;li style=&quot;text-align: justify;&quot;&gt;Khóa học &lt;strong&gt;Ứng dụng CNTT cơ bản&lt;/strong&gt; trang bị những kiến thức Tin học cơ bản, mang tính ứng dụng cao trong học tập, công việc và cuộc sống&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify;&quot;&gt;Rèn luyện kỹ năng, sử dụng hiệu quả Word, Excel, Powerpoint, Windows, Internet, Google Drive-Google Docs&lt;/li&gt;\r\n	&lt;li style=&quot;text-align: justify;&quot;&gt;Là khóa học nền tảng, giúp Học viên dễ dàng đạt kết quả cao trong kỳ thi và được Cấp chứng chỉ Ứng dụng CNTT theo chuẩn của Bộ Giáo dục và Đào tạo&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;/div&gt;\r\n', '&lt;div class=&quot;panel-body nganh-tieu-de-muc&quot;&gt;\r\n&lt;div&gt;&lt;strong&gt;Sau khi hoàn thành khóa học, học viên sẽ có khả năng&lt;/strong&gt;&lt;/div&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Nhanh chóng nắm vững tất cả kiến thức cơ bản về máy tính&lt;/li&gt;\r\n	&lt;li&gt;Xử lý thuần thục các thao tác làm việc và tiện ích trên môi trường Windows&lt;/li&gt;\r\n	&lt;li&gt;Soạn thảo và trình bày văn bản chuyên nghiệp với Microsoft Word&lt;/li&gt;\r\n	&lt;li&gt;Tạo lập và trình bày dễ dàng các bảng tính trong Excel&lt;/li&gt;\r\n	&lt;li&gt;Hiểu rõ và biết cách ứng dụng trong thực tế các hàm và công thức tính toán trên Excel&lt;/li&gt;\r\n	&lt;li&gt;Xây dựng các bài trình chiếu chuyên nghiệp với PowerPoint&lt;/li&gt;\r\n	&lt;li&gt;Hiểu rõ về mạng máy tính, hệ điều hành Windows&lt;/li&gt;\r\n	&lt;li&gt;Thao tác nhanh chóng trên Internet nhằm tiếp cận dễ dàng khoa học kỹ thuật mới  &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;/div&gt;\r\n', '', 'Ứng dụng CNTT cơ bản', '', '', '', '', '', '', '', '', 1500000, 2000000, '', '&lt;div class=&quot;panel-group khoang-cach-5&quot; id=&quot;accordion3&quot;&gt;\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot;&gt; &lt;/div&gt;\r\n&lt;/div', 1, 0, 'khoa-hoc', 1687677556, 1689755645, 70, 1),
(36, '', 3, 0, 11, 0, '', 0, 0, 'uyen-thi-chung-chi-ung-dung-cntt-co-ban-6523.png', '', '{\"p\":\"uyen-thi-chung-chi-ung-dung-cntt-co-ban-6523.png\",\"w\":null,\"h\":null,\"m\":null}', 'luyen-thi-chung-chi-ung-dung-cntt-co-ban', '', '', '', '', '&lt;ul&gt;\r\n	&lt;li&gt;Chương trình &lt;strong&gt;Luyện thi chứng chỉ ứng dụng CNTT cơ bản giúp HV ô&lt;/strong&gt;n tập &amp; Hệ thống lại kiến thức của chương trình Ứng dụng CNTT Cơ bản&lt;/li&gt;\r\n	&lt;li&gt;Giúp học viên thi đạt và nhận Chứng chỉ Ứng dụng CNTT Cơ bản&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '&lt;h3&gt;ĐỐI TƯỢNG THAM GIA&lt;/h3&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Các cán bộ, nhân viên, sinh viên có trình độ CNTT&lt;strong&gt; tương đương Chứng chỉ A&lt;/strong&gt; có nhu cầu được cấp chứng chỉ&lt;strong&gt; Ứng dụng CNTT cơ bản &lt;/strong&gt;để phục vụ cho nhu cầu công việc, học tập&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h3&gt;MỤC TIÊU&lt;/h3&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Hệ thống &amp; ôn tập lại kiến thức của chương trình Ứng dụng CNTT cơ bản.&lt;/li&gt;\r\n	&lt;li&gt;Giúp học viên có thể thi đạt và nhận chứng chỉ ứng dụng CNTT cơ bản.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h3&gt;THỜI LƯỢNG - HỌC PHÍ&lt;/h3&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Thời gian học: 4 buổi&lt;/li&gt;\r\n	&lt;li&gt;Tổng số tiết: 18 tiết, học trực tiếp trên máy&lt;/li&gt;\r\n	&lt;li&gt;Học phí: 900.000 VND/khoá &lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:14px;&quot;&gt;&lt;strong&gt;Điều kiện học:&lt;/strong&gt; HV đã có Chứng chỉ A hoặc phải đạt trình độ tương đương Chứng chỉ A&lt;/span&gt;&lt;/p&gt;\r\n', '', 'Luyện thi chứng chỉ ứng dụng CNTT cơ bản', '', '', '', '', '', '', '', '', 900000, 1300000, '', '', 1, 0, 'khoa-hoc', 1687689141, 1689755943, 91, 1),
(37, '42', 3, 0, 11, 0, '', 0, 0, 'tu-duy-logic-thong-qua-lap-trinh-website-cho-tre-em-3937.jpg', '', '{\"p\":\"tu-duy-logic-thong-qua-lap-trinh-website-cho-tre-em-3937.jpg\",\"w\":null,\"h\":null,\"m\":null}', 'tu-duy-logic-thong-qua-lap-trinh-website-cho-tre-em', '', '', '&lt;h4&gt;Buổi 1: Sơ lược về web        &lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu khóa học&lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu về sự phát triển của lập trình web        &lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu tool sử dụng: Sublime Text        &lt;/li&gt;\r\n	&lt;li&gt;Các loại Browser        &lt;/li&gt;\r\n	&lt;li&gt;GIới thiệu Google Chrome        &lt;/li&gt;\r\n	&lt;li&gt;Làm quen với ngôn ngữ đánh dấu        &lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu HTML        &lt;/li&gt;\r\n	&lt;li&gt;Thực hiện cài đặt Sublime Text&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;Buổi 2: HTML cơ bản&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Cách viết HTML, thuộc tính (attribute)&lt;/li&gt;\r\n	&lt;li&gt;Các loại tag hiển thị trong HTML&lt;/li&gt;\r\n	&lt;li&gt;Các loại tag input&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang HTML sử dụng tất cả các tag đã học&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang sử dụng select box, radio button&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang có sử dụng 1 số attribute như input, img, a&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 3: HTML cơ bản - Table&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Hiểu được cấu trúc của bảng trong HTML và biết cách sử dụng các thẻ kẻ bảng&lt;/li&gt;\r\n	&lt;li&gt;Biết cách sử dụng Table trong trang web để trình bày nội dung&lt;/li&gt;\r\n	&lt;li&gt;Biết cách sử dụng Table để dàn trang&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 4: HTML cơ bản - Form&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu về Form&lt;/li&gt;\r\n	&lt;li&gt;Các thành cơ bản của form&lt;/li&gt;\r\n	&lt;li&gt;Các thành phần nâng cao&lt;/li&gt;\r\n	&lt;li&gt;Phương thức trao đổi dữ liệu GET/POST&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết form&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 5: CSS cơ bản - Phần 1&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu CSS&lt;/li&gt;\r\n	&lt;li&gt;Cú pháp của CSS&lt;/li&gt;\r\n	&lt;li&gt;Sử dụng và Phân loại CSS&lt;/li&gt;\r\n	&lt;li&gt;Selector trong CSS và phạm vi ảnh hưởng&lt;/li&gt;\r\n	&lt;li&gt;Các loại CSS thông dụng&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết CSS chỉnh màu sắc, font chữ, ... cho trang HTML đã tạo trước đó&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết CSS cho table đã tạo trước đó và căn chỉnh lề&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 6: Css nâng cao&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;CSS cho Table&lt;/li&gt;\r\n	&lt;li&gt;Box model&lt;/li&gt;\r\n	&lt;li&gt;Thuộc tính display và visibility&lt;/li&gt;\r\n	&lt;li&gt;Thuộc tính position&lt;/li&gt;\r\n	&lt;li&gt;Thuộc tính float&lt;/li&gt;\r\n	&lt;li&gt;Canh chỉnh phần tử&lt;/li&gt;\r\n	&lt;li&gt;Thực hành&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 7: Javascript &amp; Dom HTML - Phần 1&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu về Javascript&lt;/li&gt;\r\n	&lt;li&gt;Nhúng Javascript vào trang web&lt;/li&gt;\r\n	&lt;li&gt;Kiểu dữ liệu &amp; cú pháp trong Javascript&lt;/li&gt;\r\n	&lt;li&gt;Xử lý sự kiện&lt;/li&gt;\r\n	&lt;li&gt;DOM HTML với Javascript&lt;/li&gt;\r\n	&lt;li&gt;Ví dụ và thực hành&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 8: Javascript &amp; Dom HTML - Phần 2&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu về Javascript&lt;/li&gt;\r\n	&lt;li&gt;Nhúng Javascript vào trang web&lt;/li&gt;\r\n	&lt;li&gt;Kiểu dữ liệu &amp; cú pháp trong Javascript&lt;/li&gt;\r\n	&lt;li&gt;Xử lý sự kiện&lt;/li&gt;\r\n	&lt;li&gt;DOM HTML với Javascript&lt;/li&gt;\r\n	&lt;li&gt;Ví dụ và thực hành&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 9: PHP Căn Bản - Phần 1&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu PHP&lt;/li&gt;\r\n	&lt;li&gt;Cơ chế hoạt động của WebServer&lt;/li&gt;\r\n	&lt;li&gt;Cú pháp &amp; Quy ước trong PHP&lt;/li&gt;\r\n	&lt;li&gt;Ví dụ và thực hành&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 10: PHP Căn Bản - Phần 2&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu PHP&lt;/li&gt;\r\n	&lt;li&gt;Cơ chế hoạt động của WebServer&lt;/li&gt;\r\n	&lt;li&gt;Cú pháp &amp; Quy ước trong PHP&lt;/li&gt;\r\n	&lt;li&gt;Ví dụ và thực hành&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 11: PHP &amp; Web Form - Phần 1&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Hiểu được cách thức gửi dữ liệu đến web server thông quan web form&lt;/li&gt;\r\n	&lt;li&gt;Biết cách sử dụng các thẻ của web form&lt;/li&gt;\r\n	&lt;li&gt;Hiểu và phân biệt hai cách truyền dữ liệu GET và POST&lt;/li&gt;\r\n	&lt;li&gt;Biết cách nhận dữ liệu GET/POST bằng PHP&lt;/li&gt;\r\n	&lt;li&gt;Ví dụ và thực hành&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 12: PHP &amp; Web Form - Phần 2&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Hiểu được cách thức gửi dữ liệu đến web server thông quan web form&lt;/li&gt;\r\n	&lt;li&gt;Biết cách sử dụng các thẻ của web form&lt;/li&gt;\r\n	&lt;li&gt;Hiểu và phân biệt hai cách truyền dữ liệu GET và POST&lt;/li&gt;\r\n	&lt;li&gt;Biết cách nhận dữ liệu GET/POST bằng PHP&lt;/li&gt;\r\n	&lt;li&gt;Ví dụ và thực hành&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 13: Hoàn thiện WebsiteHoàn thiện giao diện website&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Xây dựng 1 web có giao diện HTML, CSS được phân bố rõ ràng&lt;/li&gt;\r\n	&lt;li&gt;Các thành phần dữ liệu, component được thêm vào trang web&lt;/li&gt;\r\n	&lt;li&gt;Sử dụng JS đơn giản để thêm, bớt các thành phần trên trang web&lt;/li&gt;\r\n	&lt;li&gt;Hoàn thiện Website&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 14: Trình bày sản phẩm&lt;/h4&gt;\r\n', '', '&lt;p&gt;Việc học lập trình không chỉ giúp trẻ em phát triển &lt;strong&gt;TƯ DUY LOGIC - TOÁN HỌC - THẨM MỸ&lt;/strong&gt;, mà còn khuyến khích sáng tạo, hợp tác và giải quyết vấn đề. Ngoài ra, nó còn tạo cơ hội nghề nghiệp và giúp trẻ em tiếp cận công nghệ một cách sớm nhất.&lt;/p&gt;\r\n', '&lt;h3&gt;&lt;span style=&quot;color:#3300ff;&quot;&gt;&lt;strong&gt;ĐÂY LÀ KHÓA HỌC GIẢN LƯỢC ĐƯỢC ĐÀO TẠO TRÌNH ĐỘ ĐẠI HỌC CHO HỌC VIÊN DỄ TIẾP CẬN&lt;/strong&gt;&lt;/span&gt;&lt;/h3&gt;\r\n\r\n&lt;p&gt;Học lập trình có nhiều lợi ích đáng kể cho trẻ em. Dưới đây là một số lợi ích quan trọng của việc học lập trình trong giai đoạn phát triển của trẻ:&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#e74c3c;&quot;&gt;Phát triển tư duy logic: &lt;/span&gt;&lt;/strong&gt;Lập trình yêu cầu trẻ em suy nghĩ một cách logic và có khả năng phân tích và giải quyết vấn đề. Việc học lập trình khuyến khích trẻ em tư duy logic từ việc lập trình các thuật toán đơn giản cho đến xây dựng các ứng dụng phức tạp hơn.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#e74c3c;&quot;&gt;Tăng cường kỹ năng toán học:&lt;/span&gt; &lt;/strong&gt;Lập trình liên quan mật thiết đến các khái niệm toán học như biểu thức, công thức, số học, logic boolean và hình học. Khi trẻ em học lập trình, họ thường phải áp dụng những kiến thức toán học vào thực tế, từ đó nâng cao khả năng giải quyết vấn đề toán học của mình.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#e74c3c;&quot;&gt;Khuyến khích sáng tạo và sự sẵn lòng thử nghiệm:&lt;/span&gt;&lt;/strong&gt; Việc học lập trình cho phép trẻ em thể hiện sự sáng tạo và khả năng tự tạo ra những gì mình muốn. Bằng cách viết mã, trẻ em có thể tạo ra các ứng dụng, trò chơi và các dự án cá nhân. Điều này khuyến khích trẻ em tư duy sáng tạo, học cách thử nghiệm và sửa lỗi để đạt được kết quả mong muốn.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#e74c3c;&quot;&gt;Xây dựng kỹ năng giải quyết vấn đề:&lt;/span&gt; &lt;/strong&gt;Lập trình yêu cầu trẻ em phân tích vấn đề và tìm ra cách giải quyết một cách có hệ thống. Trẻ em phải học cách chia nhỏ vấn đề thành các bước nhỏ hơn và áp dụng các giải pháp tương ứng. Kỹ năng này không chỉ hữu ích trong lập trình mà còn có thể áp dụng vào nhiều lĩnh vực khác trong cuộc sống.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#e74c3c;&quot;&gt;Mở rộng khả năng giao tiếp và hợp tác:&lt;/span&gt;&lt;/strong&gt; Khi học lập trình, trẻ em thường tham gia vào các dự án nhóm, chia sẻ ý tưởng và làm việc cùng nhau để đạt được mục tiêu chung. Điều này giúp trẻ em rèn kỹ năng giao tiếp, hợp tác và làm việc nhóm.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;&lt;span style=&quot;color:#e74c3c;&quot;&gt;Định hướng nghề nghiệp:&lt;/span&gt;&lt;/strong&gt; Việc học lập trình từ khi còn nhỏ giúp trẻ em tiếp cận sớm với công nghệ và tạo ra cơ hội cho họ trong tương lai. Lập trình là một kỹ năng quan trọng và ngành công nghệ thông tin đang trở thành lĩnh vực có nhiều việc làm tiềm năng.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h3&gt;MỤC TIÊU KHÓA HỌC&lt;/h3&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Giúp Học viên tiếp cận với lập trình từ sớm.&lt;/li&gt;\r\n	&lt;li&gt;Hiểu được kiến thức cơ bản của lập trình.&lt;/li&gt;\r\n	&lt;li&gt;Hiểu được lộ trình phát triển Web&lt;/li&gt;\r\n	&lt;li&gt;Hiểu và thực hành thành công các kiến thức về HTML, CSS trong  lập trình web&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Hiểu và thực hành thành công các kiến thức về ngôn ngữ Javascript&lt;/li&gt;\r\n	&lt;li&gt;Hiểu và thực hành thành công các kiến thức về ngôn ngữ PHP&lt;/li&gt;\r\n	&lt;li&gt;Tự tin xây dựng thành công 1 website cho riêng mình&lt;/li&gt;\r\n	&lt;li&gt;Nâng cao kỹ năng thuyết trình và bảo vệ sản phẩm của mình&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h3&gt;ĐỐI TƯỢNG THAM GIA KHÓA HỌC&lt;/h3&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Trẻ từ 10 tuổi – 18 tuổi muốn có kiến thức về lập trình và tự xây dựng được 1 website cho riêng mình.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '', 'Tư duy logic thông qua lập trình website cho trẻ em', '', '', '', '', '', '', '', '', 2950000, 3500000, '', '', 1, 1, 'khoa-hoc', 1689672784, 1689826298, 943, 1),
(38, '', 0, 0, 0, 0, '', 0, 0, '', '', '{\"p\":\"\",\"w\":null,\"h\":null,\"m\":null}', 'tu-duy-thiet-ke-va-lap-trinh-web-co-ban', '', '', '&lt;h4&gt;Buổi 1: Sơ lược về webGiới thiệu khóa học        &lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu về sự phát triển của lập trình web        &lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu tool sử dụng: Sublime Text        &lt;/li&gt;\r\n	&lt;li&gt;Các loại Browser        &lt;/li&gt;\r\n	&lt;li&gt;GIới thiệu Google Chrome        &lt;/li&gt;\r\n	&lt;li&gt;Làm quen với ngôn ngữ đánh dấu        &lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu HTML        &lt;/li&gt;\r\n	&lt;li&gt;Thực hiện cài đặt Sublime Text&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;Buổi 2: HTML cơ bảnCách viết HTML, thuộc tính (attribute)&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Các loại tag hiển thị trong HTML&lt;/li&gt;\r\n	&lt;li&gt;Các loại tag input&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang HTML sử dụng tất cả các tag đã học&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang sử dụng select box, radio button&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang có sử dụng 1 số attribute như input, img, a&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 3: Tổ chức chia khối trên Web (HTML)Cách viết HTML, thuộc tính (attribute)&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Các loại tag hiển thị trong HTML&lt;/li&gt;\r\n	&lt;li&gt;Các loại tag input&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang HTML sử dụng tất cả các tag đã học&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang sử dụng select box, radio button&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết 1 trang có sử dụng 1 số attribute như input, img, a&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 4: CSS cơ bản - Phần 1&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu về CSS&lt;/li&gt;\r\n	&lt;li&gt;Các chức năng của CSS&lt;/li&gt;\r\n	&lt;li&gt;Cú pháp của CSS&lt;/li&gt;\r\n	&lt;li&gt;Các cách viết CSS&lt;/li&gt;\r\n	&lt;li&gt;Thực hành gắn CSS vào trang HTML&lt;/li&gt;\r\n	&lt;li&gt;Thực hành sử dụng Selector&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 5: CSS cơ bản - Phần 2&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Các chức năng của CSS&lt;/li&gt;\r\n	&lt;li&gt;Cú pháp của CSS&lt;/li&gt;\r\n	&lt;li&gt;Các đơn vị kích cỡ&lt;/li&gt;\r\n	&lt;li&gt;Color&lt;/li&gt;\r\n	&lt;li&gt;Các loại CSS thông dụng&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết CSS chỉnh màu sắc, font chữ, ... cho trang HTML đã tạo trước đó&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết CSS cho table đã tạo trước đó và căn chỉnh lề&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 6: Chia khối trên CSS (Layout)&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Khái niệm về div&lt;/li&gt;\r\n	&lt;li&gt;Căn lề trên div bằng margin và padding&lt;/li&gt;\r\n	&lt;li&gt;Các loại CSS căn lề&lt;/li&gt;\r\n	&lt;li&gt;Thực hành viết trang HTML sử dụng các loại căn lề&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 7: Bootstrap - Phần 1&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu về Bootstrap&lt;/li&gt;\r\n	&lt;li&gt;Cách thêm bootstrap vào trang&lt;/li&gt;\r\n	&lt;li&gt;Layout trong Bootstrap&lt;/li&gt;\r\n	&lt;li&gt;Một số thuộc tính cơ bản trên Bootstrap&lt;/li&gt;\r\n	&lt;li&gt;Grid trên bootstrap&lt;/li&gt;\r\n	&lt;li&gt;Thực hành: Giới thiệu về cách sử Component trong Bootstrap&lt;/li&gt;\r\n	&lt;li&gt;Thực hành: Thêm bootstrap vào trang HTML&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 8: Bootstrap - Phần 2&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu về các Component trong Bootstrap&lt;/li&gt;\r\n	&lt;li&gt;Alert, Popover, Toast&lt;/li&gt;\r\n	&lt;li&gt;Accordian, Collapse&lt;/li&gt;\r\n	&lt;li&gt;Button, Button Groups&lt;/li&gt;\r\n	&lt;li&gt;Deployment truyền thống&lt;/li&gt;\r\n	&lt;li&gt;Thực hành: Thêm các thành phần đã học vào trang HTML&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 9: Bootstrap - Phần 3&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;DropDown box&lt;/li&gt;\r\n	&lt;li&gt;Form và các thuộc tính của Form&lt;/li&gt;\r\n	&lt;li&gt;Selectbox, Radio Button&lt;/li&gt;\r\n	&lt;li&gt;Hướng dẫn sử dụng Modal&lt;/li&gt;\r\n	&lt;li&gt;Thực hành: Thêm thành phần vào trong trang&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 10: Bootstrap - Phần 4&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Sử dụng Carousel&lt;/li&gt;\r\n	&lt;li&gt;Các thuộc tính của Carousel&lt;/li&gt;\r\n	&lt;li&gt;Thực hành: Thêm thành phần Carousel vào HTML&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 11: Animation&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Giới thiệu về pseudo code trong CSS&lt;/li&gt;\r\n	&lt;li&gt;Giới thiệu về transition trong CSS&lt;/li&gt;\r\n	&lt;li&gt;Thực hành: Thêm animation, transition vào trang web&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 12: Một số thành phần thường dùng&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Thiết kế 1 thành phần gồm có nhiều thành phần con&lt;/li&gt;\r\n	&lt;li&gt;Các loại thành phần quen thuộc trên web&lt;/li&gt;\r\n	&lt;li&gt;Thực hành: Thêm các thành phần vào Web&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 13: Hoàn thiện WebsiteHoàn thiện giao diện website&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Xây dựng 1 web có giao diện HTML, CSS được phân bố rõ ràng&lt;/li&gt;\r\n	&lt;li&gt;Các thành phần dữ liệu, component được thêm vào trang web&lt;/li&gt;\r\n	&lt;li&gt;Sử dụng JS đơn giản để thêm, bớt các thành phần trên trang web&lt;/li&gt;\r\n	&lt;li&gt;Hoàn thiện Website&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;br /&gt;\r\nBuổi 14: Trình bày sản phẩm&lt;/h4&gt;\r\n', '', '&lt;p&gt;Việc học lập trình không chỉ giúp trẻ em phát triển tư duy logic và kỹ năng toán học, mà còn khuyến khích sáng tạo, hợp tác và giải quyết vấn đề. Ngoài ra, nó còn tạo cơ hội nghề nghiệp và giúp trẻ em tiếp cận công nghệ một cách sớm nhất.&lt;/p&gt;\r\n', '&lt;p&gt;Học lập trình có nhiều lợi ích đáng kể cho trẻ em. Dưới đây là một số lợi ích quan trọng của việc học lập trình trong giai đoạn phát triển của trẻ:&lt;/p&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;Phát triển tư duy logic: Lập trình yêu cầu trẻ em suy nghĩ một cách logic và có khả năng phân tích và giải quyết vấn đề. Việc học lập trình khuyến khích trẻ em tư duy logic từ việc lập trình các thuật toán đơn giản cho đến xây dựng các ứng dụng phức tạp hơn.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;Tăng cường kỹ năng toán học: Lập trình liên quan mật thiết đến các khái niệm toán học như biểu thức, công thức, số học, logic boolean và hình học. Khi trẻ em học lập trình, họ thường phải áp dụng những kiến thức toán học vào thực tế, từ đó nâng cao khả năng giải quyết vấn đề toán học của mình.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;Khuyến khích sáng tạo và sự sẵn lòng thử nghiệm: Việc học lập trình cho phép trẻ em thể hiện sự sáng tạo và khả năng tự tạo ra những gì mình muốn. Bằng cách viết mã, trẻ em có thể tạo ra các ứng dụng, trò chơi và các dự án cá nhân. Điều này khuyến khích trẻ em tư duy sáng tạo, học cách thử nghiệm và sửa lỗi để đạt được kết quả mong muốn.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;Xây dựng kỹ năng giải quyết vấn đề: Lập trình yêu cầu trẻ em phân tích vấn đề và tìm ra cách giải quyết một cách có hệ thống. Trẻ em phải học cách chia nhỏ vấn đề thành các bước nhỏ hơn và áp dụng các giải pháp tương ứng. Kỹ năng này không chỉ hữu ích trong lập trình mà còn có thể áp dụng vào nhiều lĩnh vực khác trong cuộc sống.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;Mở rộng khả năng giao tiếp và hợp tác: Khi học lập trình, trẻ em thường tham gia vào các dự án nhóm, chia sẻ ý tưởng và làm việc cùng nhau để đạt được mục tiêu chung. Điều này giúp trẻ em rèn kỹ năng giao tiếp, hợp tác và làm việc nhóm.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;Tạo cơ hội nghề nghiệp: Việc học lập trình từ khi còn nhỏ giúp trẻ em tiếp cận sớm với công nghệ và tạo ra cơ hội cho họ trong tương lai. Lập trình là một kỹ năng quan trọng và ngành công nghệ thông tin đang trở thành lĩnh vực có nhiều việc làm tiềm năng.&lt;/p&gt;\r\n	&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h3&gt;MỤC TIÊU KHÓA HỌC&lt;/h3&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Giúp Học viên tiếp cận với lập trình từ sớm.&lt;/li&gt;\r\n	&lt;li&gt;Hiểu được kiến thức cơ bản của lập trình.&lt;/li&gt;\r\n	&lt;li&gt;Hiểu được lộ trình phát triển Web&lt;/li&gt;\r\n	&lt;li&gt;Hiểu và thực hành thành công các kiến thức về HTML, CSS trong  lập trình web&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Hiểu và thực hành thành công các kiến thức về Bootstrap&lt;/li&gt;\r\n	&lt;li&gt;Tự tin xây dựng thành công 1 website cho riêng mình&lt;/li&gt;\r\n	&lt;li&gt;Nâng cao kỹ năng thuyết trình và bảo vệ sản phẩm của &lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h3&gt;ĐỐI TƯỢNG THAM GIA KHÓA HỌC&lt;/h3&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Trẻ từ 10 tuổi – 18 tuổi muốn có kiến thức về lập trình và tự xây dựng được 1 website cho riêng mình.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n', '', 'Tư duy thiết kế và lập trình web cơ bản', '', '', '', '', '', '', '', '', 0, 0, '', '', 1, 0, 'khoa-hoc', 1689822376, 0, 4, 1),
