(45, '42', 3, 0, 11, 0, '', 0, 0, 'iot-robot-1279.png', '', '{\"p\":\"iot-robot-1279.png\",\"w\":null,\"h\":null,\"m\":null}', 'khoa-hoc-tu-duy-lap-trinh-iot-robot-cho-tre-em', '', '', '&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://giasuthethao.com/upload/elfinder/iot-robot.PNG&quot; /&gt;&lt;/p&gt;\r\n', '', '&lt;p&gt;Bạn có muốn con mình trở thành những nhà sáng tạo công nghệ tương lai? Đăng ký ngay Khóa học Tư duy Lập trình IoT - Robot cho trẻ em và mở ra cánh cửa tới thế giới công nghệ kỳ diệu! : &lt;strong&gt;Phát Triển Tư Duy Sáng Tạo, Kỹ Năng Giải Quyết Vấn Đề, Kiến Thức Công Nghệ Tiên Tiến, Phát Triển Kỹ Năng Làm Việc Nhóm, Hướng Nghiệp Tương Lai, Trải Nghiệm Học Tập Thực Tế&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;h4&gt; &lt;/h4&gt;\r\n', '&lt;p&gt;Bạn có muốn con mình trở thành những nhà sáng tạo công nghệ tương lai? Đăng ký ngay Khóa học Tư duy Lập trình IoT - Robot cho trẻ em và mở ra cánh cửa tới thế giới công nghệ kỳ diệu!&lt;/p&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Lợi Ích Khi Tham Gia Khóa Học:&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;Phát Triển Tư Duy Sáng Tạo:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Khơi dậy trí tưởng tượng và khả năng sáng tạo của trẻ thông qua việc lập trình và xây dựng các dự án IoT và robot độc đáo.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;Kỹ Năng Giải Quyết Vấn Đề:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Rèn luyện kỹ năng phân tích và giải quyết vấn đề thực tiễn, giúp trẻ tự tin đối mặt với các thử thách trong cuộc sống.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;Kiến Thức Công Nghệ Tiên Tiến:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Cung cấp kiến thức về các công nghệ hiện đại như Internet of Things (IoT), lập trình, và robot học. Trẻ sẽ học cách kết nối và điều khiển các thiết bị thông minh.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;Phát Triển Kỹ Năng Làm Việc Nhóm:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Thúc đẩy kỹ năng giao tiếp và làm việc nhóm, giúp trẻ học cách hợp tác và chia sẻ ý tưởng với bạn bè.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;Hướng Nghiệp Tương Lai:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Định hướng nghề nghiệp trong các lĩnh vực công nghệ cao, tạo nền tảng vững chắc cho sự phát triển tương lai của trẻ.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;strong&gt;Trải Nghiệm Học Tập Thực Tế:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n	&lt;ul&gt;\r\n		&lt;li&gt;Tham gia các dự án thực tế và các buổi thuyết trình, giúp trẻ áp dụng kiến thức vào thực tiễn và phát triển kỹ năng thuyết trình.&lt;/li&gt;\r\n	&lt;/ul&gt;\r\n	&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Thông Tin Khóa Học:&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;strong&gt;Đối tượng:&lt;/strong&gt; Trẻ em từ 7-15 tuổi&lt;/li&gt;\r\n	&lt;li&gt;&lt;strong&gt;Thời gian:&lt;/strong&gt; 4.5 tuần, 2 buổi/tuần&lt;/li&gt;\r\n	&lt;li&gt;\r\n	&lt;p&gt;&lt;b&gt;***VỀ ĐỘ TUỔI: Từ 07 TUỔI TRỞ LÊN&lt;/b&gt;&lt;/p&gt;\r\n\r\n	&lt;p&gt;&lt;b&gt;***VỀ HỌC PHÍ:&lt;/b&gt;&lt;/p&gt;\r\n\r\n	&lt;p&gt;- Học phí: &lt;b&gt;1.500.000đ&lt;/b&gt; ( Đối với học viên là môn sinh vovinam CLB Tin Võ Phường Tam Bình, học viên cũ,&lt;/p&gt;\r\n	hoặc đăng ký theo nhóm từ 4 học viên trở lên - Học theo nhóm &lt;b&gt;)&lt;/b&gt;\r\n\r\n	&lt;p&gt;- Học phí: &lt;b&gt;2.000.000đ&lt;/b&gt; ( Đối với học viên là môn sinh vovinam trên địa bàn Thủ Đức hoặc đăng ký theo nhóm từ 2 học viên trở lên&lt;b&gt;)&lt;/b&gt;&lt;/p&gt;\r\n\r\n	&lt;p&gt;- Học phí: &lt;b&gt;2.400.000đ&lt;/b&gt; ( Học viên không phải là môn sinh vovinam&lt;b&gt;)&lt;/b&gt;&lt;/p&gt;\r\n\r\n	&lt;p&gt;- Học phí: &lt;b&gt;3.000.000đ/khóa&lt;/b&gt; ( Học viên 1 kèm 1 tại nhà , chưa tính chi phí đi lại&lt;b&gt;)&lt;/b&gt;&lt;/p&gt;\r\n\r\n	&lt;p&gt; &lt;/p&gt;\r\n\r\n	&lt;p&gt;&lt;b&gt;ĐẶC BIỆT: &lt;i&gt;Trên địa chỉ phường: có chính sách miễn, giảm về học phí cho các em thuộc diện hộ nghèo và hộ cân nghèo trên địa bàn phường Tam Bình (Phải có giấy xác nhận của phường)&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n	&lt;p&gt; &lt;/p&gt;\r\n	&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Đăng Ký Ngay Hôm Nay!&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;p&gt;Đừng bỏ lỡ cơ hội để con bạn bước vào thế giới công nghệ hiện đại với Khóa học Tư duy Lập trình IoT - Robot. Đăng ký ngay để nhận được ưu đãi đặc biệt!&lt;/p&gt;\r\n', '', 'Khoá học tư duy lập trình IOT - Robot cho trẻ em', '', '', '', '', '', '', '', '', 1500000, 2500000, '', '', 1, 1, 'khoa-hoc', 1716187386, 1716188861, 2, 1);
