(3, 0, 0, 0, 0, '', 0, 0, 'screenshot1621050550-8981.png', '', '{\"p\":\"screenshot1621050550-8981.png\",\"w\":580,\"h\":332,\"m\":\"image\\/png\"}', 'mitumark-sale', '', '', '&lt;p&gt;Mục đích của doanh nghiệp và tác động đến người tiêu &lt;b&gt;dùng&lt;/b&gt;. &lt;b&gt;Khuyến&lt;/b&gt; &lt;b&gt;mãi&lt;/b&gt; mang nghĩa là &quot;&lt;b&gt;khuyến&lt;/b&gt; khích mua hàng hoá, dịch vụ&quot;, do đó mục đích chính của &lt;b&gt;khuyến&lt;/b&gt; &lt;b&gt;mãi&lt;/b&gt; là kích cầu tiêu &lt;b&gt;dùng&lt;/b&gt;, thúc đẩy người tiêu &lt;b&gt;dùng&lt;/b&gt; mua và mua nhiều hơn các hàng hoá, dịch vụ mà doanh nghiệp cung cấp hoặc phân phối.&lt;/p&gt;\r\n', '', '&lt;p&gt;Mục đích của doanh nghiệp và tác động đến người tiêu &lt;b&gt;dùng&lt;/b&gt;. &lt;b&gt;Khuyến&lt;/b&gt; &lt;b&gt;mãi&lt;/b&gt; mang nghĩa là &quot;&lt;b&gt;khuyến&lt;/b&gt; khích mua hàng hoá, dịch vụ&quot;, do đó mục đích chính của &lt;b&gt;khuyến&lt;/b&gt; &lt;b&gt;mãi&lt;/b&gt; là kích cầu tiêu &lt;b&gt;dùng&lt;/b&gt;, thúc đẩy người tiêu &lt;b&gt;dùng&lt;/b&gt; mua và mua nhiều hơn các hàng hoá, dịch vụ mà doanh nghiệp cung cấp hoặc phân phối.&lt;/p&gt;\r\n', '', 'Mitumark sale', '', '', '', '', '', '', '', '', 1, 1, 'khuyen-mai', 1621050890, 1621059730, 7, NULL, NULL, '', '', '', '', NULL, 0),
(4, 0, 0, 0, 0, '', 0, 0, '', '', '{\"p\":\"\",\"w\":null,\"h\":null,\"m\":null}', 'chinh-sach-dai-ly', '', '', '&lt;p&gt;Dựa vào doanh số đạt được và khả năng thanh toán của khách hàng trong từng khu vực địa lý, Mitumark sẽ phân cấp đại lý bán lẻ.&lt;br /&gt;\r\nĐại lý bán lẻ cấp 1: Là đại lý bán lẻ có doanh số tháng đạt 80tr/tháng hoặc có doanh số cao nhất trong một vùng địa lý (tỉnh, thành phố).&lt;br /&gt;\r\nĐại lý bán lẻ cấp 2: Là đại lý bán lẻ có doanh số bán hàng dưới 50tr/tháng hoặc có doanh số thấp hơn đại lý bán lẻ cấp 1.&lt;/p&gt;\r\n', '', '', '', 'Chính sách đại lý', '', '', '', '', '', '', '', '', 1, 1, 'chinh-sach', 1621050989, 0, 2, NULL, NULL, '', '', '', '', NULL, 0),
