(13, 0, 0, 0, 0, '', 0, 0, 'thao-phuong-8932.jpg', '', '', 'thao-phuong', '', '', 'Nhận được quá nhiều sau những bài học của vua bán hàng thế giới Blair Singer từ người thầy tuyệt vời - chị Theresa Hương! Xin gửi lời cảm ơn sâu sắc đến những ĐỒNG ĐỘI trong ngôi nhà chung SALESDOGS. Tôi đã được khai mở trí tuệ và sống thật với chính mình bên cạnh những con người tuyệt vời!', '', 'Nhà phân phối mỹ phẩm', '', 'Thảo phương', '', '', '', '', '', '', '', '', 1, 0, 'trai-nghiem', 1638335873, 1638860292, 0, NULL, NULL, '', '', '', '', NULL, 0),
(12, 0, 0, 0, 0, '', 0, 0, 'le-viet-canh-7258.jpg', '', '', 'le-viet-canh', '', '', '...Và Chỉ Sau 6 Tháng Tôi Gặp Thầy, Số Tiền Tôi Làm Ra Bằng Hơn 13 Năm Cộng Lại, Thật Vi Diệu!, và hơn thế nữa tôi có quy tắc giúp Gia Đình Tôi luôn khỏe mạnh và Hạnh Phúc... Tôi Luôn Biết Ơn Thầy Và Các Đồng Đội!', '', 'Chuyên gia môi giới Bất Động Sản', '', 'Lê viết cảnh', '', '', '', '', '', '', '', '', 1, 0, 'trai-nghiem', 1638335815, 1638860372, 0, NULL, NULL, '', '', '', '', NULL, 0),
(14, 0, 0, 0, 0, '', 0, 0, 'event-2-3864.jpg', '', '{\"p\":\"event-2-3864.jpg\",\"w\":800,\"h\":534,\"m\":\"image\\/jpeg\"}', 'ky-nang-thuyet-trinh-kinh-doanh-uy-luc', '', '', '&lt;div class=&quot;container&quot;&gt;\r\n&lt;div class=&quot;row&quot;&gt;\r\n&lt;div class=&quot;col-md-12&quot;&gt;\r\n&lt;div class=&quot;card&quot;&gt;\r\n&lt;div class=&quot;card-body&quot;&gt;\r\n&lt;p&gt;Xin chào, Tôi là Blair Singer, là một giáo viên đã và đang giảng dạy về bán hàng và huấn luyện trong hơn 30 năm, tôi có thể cho bạn biết điều duy nhất tốt hơn là để trở thành một nhân viên bán hàng tuyệt vời trong tình huống bán hàng một-một, là trở thành một nhân viên bán hàng vĩ đại có thể bán từ một đến NHIỀU THỨ.&lt;br /&gt;\r\nĐó là kỹ năng mà mỗi giám đốc điều hành, các nhà lãnh đạo trong ngành, các nhà lãnh đạo chính trị, kinh doanh, tôn giáo, và cộng đồng đều học được là ... LÀM THẾ NÀO ĐỂ ĂN NÓI VÀ THUYẾT TRÌNH và BÁN HÀNG trước những người khác.&lt;br /&gt;\r\nTrong hơn ba mươi năm qua, tôi đã thấy rằng khả năng thuyết trình để trở thành máy tạo thu nhập lớn nhất với chi phí thấp nhất cho mỗi khách hàng, mỗi lần giao dịch kinh doanh bất cứ thứ gì tôi từng thấy.&lt;br /&gt;\r\nVà công thức bí mật mà đích thân tôi đã kiếm được hàng triệu đôla trong tất cả các hoạt động kinh doanh của tôi là: Khi bạn dạy người khác và tạo giá trị cho doanh nghiệp và cuộc sống của họ, điều rất thú vị sẽ xảy ra ...&lt;br /&gt;\r\nNó được gọi là có qua có lại. Bạn cung cấp cho người nghe giá trị và thông tin để giúp họ và họ đáp lại bằng cách tin tưởng vào sự lãnh đạo của bạn và mua sản phẩm, dịch vụ, ý tưởng và tầm nhìn ... gần như bị thu hút bởi một thỏi nam châm.&lt;br /&gt;\r\nDạy trước rồi bán&lt;br /&gt;\r\nTôi đã trải qua gần 30 năm để uyên thông được điều này. Trong vài năm đầu, tôi đã dành ra vài trăm nghìn đô la để học các kỹ năng này .... Tôi vẫn còn tệ, bởi vì không ai thực sự tạo ra một chương trình giảng dạy có hệ thống.&lt;br /&gt;\r\nCho đến bây giờ .... Tôi đã tổng hợp lại để tạo ra một chương trình sát thủ được giảng dạy bởi các huấn luyện viên ưu tú của tôi. Họ sẽ cung cấp cho bạn tất cả các công cụ bạn cần để có thể cung cấp KỸ NĂNG THUYẾT TRÌNH KINH DOANH UY LỰC trong một khoảng thời gian ngắn.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n', '', 'Khả năng thực hiện một BÀI THUYẾT TRÌNH KINH DOANH UY LỰC để truyền cảm hứng cho khán giả Hành động và Mua hàng là cách nhanh nhất để giúp cho thu nhập và thành công của bạn.', '', 'KỸ NĂNG THUYẾT TRÌNH KINH DOANH UY LỰC', '', '', '', '', '', '', '', '', 1, 1, 'event', 1638409796, 1639365635, 57, '2021-12-10 20:22:00', '2021-12-15 23:30:00', 'Đồng Nai', '8:00', 'Blair Singer', '18:30', 0, 0),
