(34, 0, 0, 0, 0, '', 0, 0, '5f058129b7ea63b43afb-4057.jpg', '', '{\"p\":\"5f058129b7ea63b43afb-4057.jpg\",\"w\":1200,\"h\":1600,\"m\":\"image\\/jpeg\"}', 'huynh-huu-loi', '', '', '&lt;h3&gt;&lt;strong&gt;Huấn luyện viên vovinam chuyên:&lt;/strong&gt;&lt;/h3&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Dạy khoá học&lt;strong&gt; võ thuật vovinam ngoại khoá cho các trường QUỐC TẾ&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;Dạy&lt;strong&gt; võ tự vệ&lt;/strong&gt; cho nữ giới&lt;/li&gt;\r\n	&lt;li&gt;Dạy&lt;strong&gt; đốt calo, xả stress, giảm cân&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;Dạy v&lt;strong&gt;õ tập nơi cho nhân viên công ty, cơ quan, trường học&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;Công ty TNHH TM&amp;DV FasCon chuyên:&lt;/strong&gt;&lt;/h3&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;&lt;strong&gt;Thiết kế website thương mại điên tử bán hàng, công ty, cửa hàng.&lt;/strong&gt;..&lt;/li&gt;\r\n	&lt;li&gt;Dịch vụ &lt;strong&gt;LẮP RÁP - BẢO TRÌ - NÂNG CẤP MÁY TÍNH - LAPTOP - CAMERA - MÁY CHẤM CÔNG&lt;/strong&gt;&lt;/li&gt;\r\n	&lt;li&gt;&lt;em&gt;&lt;strong&gt;Đào tạo TIN HỌC VĂN PHÒNG - LẬP TRÌNH  - STEAM CHO HỌC SINH, SINH VIÊN, NGƯỜI ĐI LÀM&lt;/strong&gt;&lt;/em&gt;&lt;/li&gt;\r\n&lt;/ol&gt;\r\n', '', '&lt;p&gt;Ths. CNTT ĐH KHTN - HLV Vovinam - Giám đốc công ty TNHH TM&amp;DV FasCon &lt;/p&gt;\r\n', '', 'Huỳnh Hữu Lợi', '', '', '', '', '', '', '', '', 2, 1, 'giang-vien', 1696318929, 1696323106, 75, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', 0, 0),
(35, 0, 0, 0, 0, '', 0, 0, '17298b5d289dfcc3a58c-2614.jpg', '', '{\"p\":\"17298b5d289dfcc3a58c-2614.jpg\",\"w\":1067,\"h\":1600,\"m\":\"image\\/jpeg\"}', 'linh-nguyen', '', '', '&lt;h3&gt;Chúng tôi cung cấp khoá học:&lt;/h3&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Dạy vẽ luyện thi Kiến Trúc (lớp 10 - 12)&lt;/li&gt;\r\n	&lt;li&gt;Vẽ tượng, chân dung, toàn thân. Vẽ chì.&lt;/li&gt;\r\n	&lt;li&gt;Thiếu nhi thì dạy vẽ màu sáp, màu nước, acrylic.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n', '', '&lt;p&gt;Cử nhân Kiến Trúc - Nội Thất . HLV Vovinam. Giáo viên dạy vẽ luyện thi Kiến Trúc - Mỹ Thuật.&lt;/p&gt;\r\n', '', 'Linh Nguyễn', '', '', '', '', '', '', '', '', 1, 0, 'giang-vien', 1696323243, 1696323744, 47, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', 0, 0),
(36, 0, 0, 0, 0, '', 0, 0, 'z47144880109479f7c12294a45ab580c81426f46085a95-2104.jpg', '', '{\"p\":\"z47144880109479f7c12294a45ab580c81426f46085a95-2104.jpg\",\"w\":1280,\"h\":640,\"m\":\"image\\/jpeg\"}', 'ky-thi-thang-cap-vovinam-viet-vo-dao-thanh-pho-thu-duc-khoa-04-nam-2023', '', '', '&lt;h2 style=&quot;text-align: center;&quot;&gt;CLB Tin Võ Tam Bình Thông Báo&lt;/h2&gt;\r\n\r\n&lt;h3&gt;Đối tượng và điều kiện dự thi: &lt;/h3&gt;\r\n\r\n&lt;p&gt;2.1 Đối tượng: - Dành cho các môn sinh đã học hết chương trình huấn luyện Vovinam – Việt Võ Đạo tại các câu lạc bộ trực thuộc bộ môn Vovinam – Việt Võ Đạo thành phố Thủ Đức.&lt;/p&gt;\r\n\r\n&lt;p&gt;2.2 Điều kiện: - Môn sinh có đủ sức khỏe, đúng niên hạn thi thăng cấp, có trình theo chuyên môn theo quy định của môn phái Vovinam – Việt Võ Đạo, không vi phạm đạo đức, tác phong, kỷ luật tại các câu lạc bộ. - Được sự đồng ý của huấn luyện viên phụ trách tại các câu lạc bộ trực thuộc bộ môn Vovinam – Việt Võ Đạo thành phố Thủ Đức, nộp đầy đủ hồ sơ theo quy định.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Thời gian và địa điểm:&lt;/h3&gt;\r\n\r\n&lt;p&gt;- Thời gian: &lt;strong&gt;Lúc 07g30 ngày 26/11/2023 (Chủ nhật).&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;- Địa điểm: &lt;strong&gt;Nhà thi đấu TT.TDTT thành phố Thủ Đức (Cơ sở 2 - Số 26, Chương Dương, phường Linh Chiểu, thành phố Thủ Đức).&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;h3&gt;Địa điểm nộp hồ sơ:&lt;/h3&gt;\r\n\r\n&lt;p&gt;- Thời gian:  &lt;strong&gt;trước ngày 01/11/2023  &lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;- Địa điểm:  CLB Tin Võ Tam Bình ( 640 Tô Ngọc Vân, Phường Tam Bình, TP. Thủ Đức)&lt;/p&gt;\r\n\r\n&lt;p&gt;- Hotline hỗ trợ: HLV Huỳnh Hữu Lợi: 0937759311&lt;/p&gt;\r\n\r\n&lt;h3&gt;Hồ sơ dự thi:&lt;/h3&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;Đơn xin dự thi theo mẫu trong group zalo&lt;/li&gt;\r\n	&lt;li&gt;4 tấm hình 2x3 ( file ảnh gửi về email websinhvien.net@gmail.com)&lt;/li&gt;\r\n	&lt;li&gt;Lệ phí thi: 250.000&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;h3&gt;I .LÝ THUYẾT TRÌNH ĐỘ TỰ VỆ VIỆT VÕ ĐẠO THI THĂNG CẤP LAM ĐAI (Xanh đậm) &lt;/h3&gt;\r\n\r\n&lt;p&gt;&lt;br /&gt;\r\n1.Vovinam là gì ?&lt;br /&gt;\r\n-Vovinam là từ viết tắt của cụm từ &lt; Võ việt nam &gt;&lt;br /&gt;\r\n- Về nội dung vovinam có hai phần :&lt;br /&gt;\r\n- Võ thuật Việt Nam (Việt võ thuật )&lt;br /&gt;\r\n- Vó đạo Việt Nam ( Việt võ đạo )&lt;br /&gt;\r\n2. Khi &lt; Nghiêm Lễ&gt; Việt võ đạo sinh đặc bàn tay phải lên trái tim với ý nghĩa gì ?&lt;br /&gt;\r\nKhi Nghiêm Lễ Việt võ đạo sinh đặt bàn tay lên trái tim có ý nghĩa là bàn tay thép đặt lên trái tim&lt;br /&gt;\r\ntừ ái ,đưc dung đi đôi với long nhân ,Võ thuật gắn liền với võ đạo ,việt võ đạo sinh chỉ được dung võ để&lt;br /&gt;\r\ncảnh cáo cảm hóa người ,chứ không phải để trừng phạt trả thù người .&lt;br /&gt;\r\n3.Vovinam Việt võ đạo có mấy màu đai ?&lt;br /&gt;\r\nViệt vó đạo có (4) màu đai : xanh , vàng , đỏ ,trắng .&lt;br /&gt;\r\n4. Vovinam thành lập năm nào, ỏ đâu ?&lt;br /&gt;\r\nVovinam được thành lập năm 1938 ,tại Hà Nội , do Cố võ sư sáng tổ Nguyễn Lộc Thành lập&lt;/p&gt;\r\n\r\n&lt;h4&gt;I .VÕ THUẬT TRÌNH ĐỘ TỰ VỆ VIỆT VÕ ĐẠO THI THĂNG CẤP LAM ĐAI (Xanh đậm) &lt;/h4&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;https://giasuthethao.com/upload/elfinder/vovinam/tu-ve.PNG&quot; style=&quot;width: 100%; float: left;&quot; /&gt;&lt;/p&gt;\r\n', '', 'CLB Tin Võ Tam Bình Thông Báo Kỳ thi thăng cấp Vovinam - Việt Võ Đạo thành phố Thủ Đức Khóa 04 năm 2023', '', 'Kỳ thi thăng cấp Vovinam - Việt Võ Đạo thành phố Thủ Đức Khóa 04 năm 2023 ', '', '', '', '', '', '', '', '', 1, 1, 'tin-tuc', 1698203451, 1698205443, 309, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', 0, 0),
