INSERT INTO `table_news` (`id`, `id_list`, `id_item`, `id_cat`, `id_sub`, `id_tags`, `noibat`, `tb`, `photo`, `icon`, `options`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `tenen`, `tenvi`, `tenko`, `tenkhongdauko`, `motako`, `noidungko`, `taptin`, `link`, `link_video`, `thoigian`, `stt`, `hienthi`, `type`, `ngaytao`, `ngaysua`, `luotxem`, `start`, `end`, `event_location`, `start_time`, `event_lecturer`, `end_time`, `color`, `id_club`) VALUES
(38, 16, 0, 0, 0, '', 0, 0, 'ngvanchieu-2651.jpg', '', '{\"p\":\"ngvanchieu-2651.jpg\",\"w\":200,\"h\":300,\"m\":\"image\\/jpeg\"}', 'nguyen-van-chieu', '', '', '&lt;p&gt;&lt;b&gt;Nguyễn Văn Chiếu&lt;/b&gt; (4 tháng 11 năm 1949 – 4 tháng 2 năm 2020, tên thánh: &lt;b&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Th%C3%A1nh_Ph%C3%AAr%C3%B4&quot; title=&quot;Thánh Phêrô&quot;&gt;Phê-rô&lt;/a&gt;&lt;/b&gt;) là một &lt;a href=&quot;https://vi.wikipedia.org/wiki/V%C3%B5_s%C6%B0&quot; title=&quot;Võ sư&quot;&gt;võ sư&lt;/a&gt; người Việt Nam. Ông nguyên là Chánh Chưởng Quản Hội Đồng Võ Sư Chưởng Quản Môn phái Vovinam Việt Võ Đạo&lt;sup id=&quot;cite_ref-5&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-5&quot;&gt;[5]&lt;/a&gt;&lt;/sup&gt;, được &lt;a href=&quot;https://vi.wikipedia.org/wiki/T%E1%BA%A5n_phong&quot; title=&quot;Tấn phong&quot;&gt;tấn phong&lt;/a&gt; &lt;a href=&quot;https://vi.wikipedia.org/wiki/H%E1%BB%87_th%E1%BB%91ng_%C4%91%E1%BA%B3ng_c%E1%BA%A5p_Vovinam_Vi%E1%BB%87t_V%C3%B5_%C4%90%E1%BA%A1o&quot; title=&quot;Hệ thống đẳng cấp Vovinam Việt Võ Đạo&quot;&gt;đẳng cấp&lt;/a&gt; &lt;a href=&quot;https://vi.wikipedia.org/wiki/H%E1%BB%87_th%E1%BB%91ng_%C4%91%E1%BA%B3ng_c%E1%BA%A5p_Vovinam_Vi%E1%BB%87t_V%C3%B5_%C4%90%E1%BA%A1o&quot; title=&quot;Hệ thống đẳng cấp Vovinam Việt Võ Đạo&quot;&gt;Bạch đai Chánh Chưởng Quản Môn phái Vovinam Việt Võ Đạo&lt;/a&gt; ngày &lt;a href=&quot;https://vi.wikipedia.org/wiki/27_th%C3%A1ng_9&quot; title=&quot;27 tháng 9&quot;&gt;27 tháng 9&lt;/a&gt; năm &lt;a href=&quot;https://vi.wikipedia.org/wiki/2015&quot; title=&quot;2015&quot;&gt;2015&lt;/a&gt;. Ông cũng từng giữ chức vụ Trưởng phòng Thể dục Thể thao &lt;a href=&quot;https://vi.wikipedia.org/wiki/Qu%E1%BA%ADn_8&quot; title=&quot;Quận 8&quot;&gt;Quận 8&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh&quot; title=&quot;Thành phố Hồ Chí Minh&quot;&gt;Thành phố Hồ Chí Minh&lt;/a&gt;.&lt;sup id=&quot;cite_ref-Sự_kiện_lớn_trong_môn_phái_Vovinam_6-0&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-S%E1%BB%B1_ki%E1%BB%87n_l%E1%BB%9Bn_trong_m%C3%B4n_ph%C3%A1i_Vovinam-6&quot;&gt;[6]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Tiểu sử[&lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;veaction=edit&amp;amp;section=1&quot; title=&quot;Sửa đổi phần “Tiểu sử”&quot;&gt;sửa&lt;/a&gt; | &lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;action=edit&amp;amp;section=1&quot; title=&quot;Sửa mã nguồn tại đề mục: Tiểu sử&quot;&gt;sửa mã nguồn&lt;/a&gt;]&lt;/h2&gt;\r\n\r\n&lt;p&gt;Thân phụ Nguyễn Văn Chiếu là ông Nguyễn Văn Ba (1926 – 29 tháng 7 năm 2014).&lt;sup id=&quot;cite_ref-7&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-7&quot;&gt;[7]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Nguyên quán của Nguyễn Văn Chiếu là huyện &lt;a href=&quot;https://vi.wikipedia.org/wiki/Long_H%E1%BB%93&quot; title=&quot;Long Hồ&quot;&gt;Long Hồ&lt;/a&gt;, tỉnh &lt;a href=&quot;https://vi.wikipedia.org/wiki/V%C4%A9nh_Long&quot; title=&quot;Vĩnh Long&quot;&gt;Vĩnh Long&lt;/a&gt; nhưng ông được sinh ra tại &lt;a href=&quot;https://vi.wikipedia.org/wiki/S%C3%A0i_G%C3%B2n&quot; title=&quot;Sài Gòn&quot;&gt;Sài Gòn&lt;/a&gt;.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-1&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt; Ông còn có một người em.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-2&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt; Gia đình ông là gia đình lao động nghèo.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-3&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Vào giữa năm 1965, 16 tuổi, Nguyễn Văn Chiếu bắt đầu tập Vovinam với võ sư Trịnh Ngọc Minh tại võ đường số 550 đường Trần hưng Đạo, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Qu%E1%BA%ADn_5&quot; title=&quot;Quận 5&quot;&gt;quận 5&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/S%C3%A0i_G%C3%B2n&quot; title=&quot;Sài Gòn&quot;&gt;Sài Gòn&lt;/a&gt;.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-4&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt; Sau đó ông tập dưới sự hướng dẫn của thầy &lt;a href=&quot;https://vi.wikipedia.org/wiki/L%C3%AA_S%C3%A1ng&quot; title=&quot;Lê Sáng&quot;&gt;Lê Sáng&lt;/a&gt; (chưởng môn phái Vovinam từ 1960 – 2010) tại Tổng cục Huấn luyện Vovinam Việt Võ Đạo tại số 31 đường Sư Vạn Hạnh, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Qu%E1%BA%ADn_10&quot; title=&quot;Quận 10&quot;&gt;Quận 10&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh&quot; title=&quot;Thành phố Hồ Chí Minh&quot;&gt;Thành phố Hồ Chí Minh&lt;/a&gt;.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-5&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt;&lt;sup id=&quot;cite_ref-8&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-8&quot;&gt;[8]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Miệt mài tập luyện nên vào năm 1967, ông đã đến bậc võ sư tam đẳng huyền đai khi mới 18 tuổi.&lt;sup id=&quot;cite_ref-nguoiduatin_9-0&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-nguoiduatin-9&quot;&gt;[9]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Năm &lt;a href=&quot;https://vi.wikipedia.org/wiki/1969&quot; title=&quot;1969&quot;&gt;1969&lt;/a&gt;, ông bắt đầu dạy Vovinam tại thành phố &lt;a href=&quot;https://vi.wikipedia.org/wiki/Quy_Nh%C6%A1n&quot; title=&quot;Quy Nhơn&quot;&gt;Quy Nhơn&lt;/a&gt;, tỉnh &lt;a href=&quot;https://vi.wikipedia.org/wiki/B%C3%ACnh_%C4%90%E1%BB%8Bnh&quot; title=&quot;Bình Định&quot;&gt;Bình Định&lt;/a&gt;, đất võ cổ truyền Việt Nam. Được sự ủng hộ của các võ sư võ cổ truyền Bình Định, sau 5 năm, ông đã mở được 12 võ đường khác nhau.&lt;sup id=&quot;cite_ref-nguoiduatin_9-1&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-nguoiduatin-9&quot;&gt;[9]&lt;/a&gt;&lt;/sup&gt; Ở Bình Định, ông đã đào tạo được các học trò xuất sắc là các võ sư Đinh Văn Hòa, Trương Quang Bính, Đỗ Thị Ngọc Long, Nguyễn Thị Lạc.&lt;sup id=&quot;cite_ref-vovinamus_chieu_3-1&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-vovinamus_chieu-3&quot;&gt;[3]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Năm 1975, ông rời Quy Nhơn về lại Sài Gòn, làm một nhân viên ở phòng Thể dục thể thao của &lt;a href=&quot;https://vi.wikipedia.org/wiki/Qu%E1%BA%ADn_8&quot; title=&quot;Quận 8&quot;&gt;quận 8&lt;/a&gt;&lt;sup id=&quot;cite_ref-thanhnien2015_10-0&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thanhnien2015-10&quot;&gt;[10]&lt;/a&gt;&lt;/sup&gt;, một quận vùng ven Sài Gòn và nỗ lực vận động mở lớp dạy Vovinam vào cuối năm 1976.&lt;sup id=&quot;cite_ref-vovinamus_chieu_3-2&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-vovinamus_chieu-3&quot;&gt;[3]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Năm &lt;a href=&quot;https://vi.wikipedia.org/wiki/1978&quot; title=&quot;1978&quot;&gt;1978&lt;/a&gt;, ông là người đầu tiên khôi phục Vovinam ở &lt;a href=&quot;https://vi.wikipedia.org/wiki/Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh&quot; title=&quot;Thành phố Hồ Chí Minh&quot;&gt;Thành phố Hồ Chí Minh&lt;/a&gt; &lt;a href=&quot;https://vi.wikipedia.org/wiki/S%E1%BB%B1_ki%E1%BB%87n_30_th%C3%A1ng_4_n%C4%83m_1975&quot; title=&quot;Sự kiện 30 tháng 4 năm 1975&quot;&gt;sau ngày 30 tháng 4 năm 1975&lt;/a&gt;, khi đó thầy ông là võ sư chưởng môn &lt;a href=&quot;https://vi.wikipedia.org/wiki/L%C3%AA_S%C3%A1ng&quot; title=&quot;Lê Sáng&quot;&gt;Lê Sáng&lt;/a&gt; đang bị chính quyền đưa đi &lt;a href=&quot;https://vi.wikipedia.org/wiki/H%E1%BB%8Dc_t%E1%BA%ADp_c%E1%BA%A3i_t%E1%BA%A1o&quot; title=&quot;Học tập cải tạo&quot;&gt;cải tạo&lt;/a&gt; (1975 – 1988).&lt;sup id=&quot;cite_ref-11&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-11&quot;&gt;[11]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Giữa tháng 12 năm 1978, chính quyền đã cho phép ông mở lớp Vovinam tại hồ bơi Hòa Bình tại Quận 8, Thành phố Hồ Chí Minh.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-6&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Thập niên 1990, ông giới thiệu, biểu diễn và truyền dạy Vovinam ở hơn 20 nước trên thế giới, bắt đầu từ &lt;a href=&quot;https://vi.wikipedia.org/wiki/Belarus&quot; title=&quot;Belarus&quot;&gt;Belarus&lt;/a&gt; (1990), &lt;a href=&quot;https://vi.wikipedia.org/wiki/Nga&quot; title=&quot;Nga&quot;&gt;Nga&lt;/a&gt; (1990), &lt;a href=&quot;https://vi.wikipedia.org/wiki/T%C3%A2y_Ban_Nha&quot; title=&quot;Tây Ban Nha&quot;&gt;Tây Ban Nha&lt;/a&gt; (1997), &lt;a href=&quot;https://vi.wikipedia.org/wiki/%C3%9D&quot; title=&quot;Ý&quot;&gt;Ý&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/%C4%90%E1%BB%A9c&quot; title=&quot;Đức&quot;&gt;Đức&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Ph%C3%A1p&quot; title=&quot;Pháp&quot;&gt;Pháp&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/M%E1%BB%B9&quot; title=&quot;Mỹ&quot;&gt;Mỹ&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/B%E1%BB%89&quot; title=&quot;Bỉ&quot;&gt;Bỉ&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Ba_Lan&quot; title=&quot;Ba Lan&quot;&gt;Ba Lan&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/%E1%BA%A4n_%C4%90%E1%BB%99&quot; title=&quot;Ấn Độ&quot;&gt;Ấn Độ&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Th%C3%A1i_Lan&quot; title=&quot;Thái Lan&quot;&gt;Thái Lan&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Singapore&quot; title=&quot;Singapore&quot;&gt;Singapore&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Campuchia&quot; title=&quot;Campuchia&quot;&gt;Campuchia&lt;/a&gt;.&lt;sup id=&quot;cite_ref-nguoiduatin_9-2&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-nguoiduatin-9&quot;&gt;[9]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Ngày 27 tháng 9 năm 2010, chưởng môn &lt;a href=&quot;https://vi.wikipedia.org/wiki/L%C3%AA_S%C3%A1ng&quot; title=&quot;Lê Sáng&quot;&gt;Lê Sáng&lt;/a&gt; qua đời. Võ sư Nguyễn Văn Chiếu được bầu làm Chánh chưởng quản Hội đồng võ sư môn phái Vovinam – Việt Võ Đạo, mang Bạch đai từ ngày 27 tháng 9 năm &lt;a href=&quot;https://vi.wikipedia.org/wiki/2015&quot; title=&quot;2015&quot;&gt;2015&lt;/a&gt;.&lt;sup id=&quot;cite_ref-Sự_kiện_lớn_trong_môn_phái_Vovinam_6-1&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-S%E1%BB%B1_ki%E1%BB%87n_l%E1%BB%9Bn_trong_m%C3%B4n_ph%C3%A1i_Vovinam-6&quot;&gt;[6]&lt;/a&gt;&lt;/sup&gt;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Tính đến khi qua đời, Nguyễn Văn Chiếu là võ sư có đẳng cấp Vovinam cao nhất Việt Nam, Hồng đai ngũ cấp (10 đẳng Vovinam quốc tế) (theo Trung tâm sách kỷ lục Việt Nam).&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-7&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Ông nguyên là Chánh chưởng quản Hội đồng võ sư, Chưởng quản môn phái Vovinam, Phó chủ tịch Liên đoàn Vovinam thế giới (WVVF), Phó chủ tịch Liên đoàn Vovinam Việt Nam, Chủ tịch hội Việt Võ Đạo TP. HCM, Giám đốc kỹ thuật quốc tế.&lt;sup id=&quot;cite_ref-nguoiduatin_9-3&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-nguoiduatin-9&quot;&gt;[9]&lt;/a&gt;&lt;/sup&gt; Ông từng làm Trưởng Phòng Thể dục thể thao &lt;a href=&quot;https://vi.wikipedia.org/wiki/Qu%E1%BA%ADn_8&quot; title=&quot;Quận 8&quot;&gt;Quận 8&lt;/a&gt;, &lt;a href=&quot;https://vi.wikipedia.org/wiki/Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh&quot; title=&quot;Thành phố Hồ Chí Minh&quot;&gt;Thành phố Hồ Chí Minh&lt;/a&gt;.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-8&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt;&lt;sup id=&quot;cite_ref-thanhnien2015_10-1&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thanhnien2015-10&quot;&gt;[10]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Qua đời[&lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;veaction=edit&amp;amp;section=2&quot; title=&quot;Sửa đổi phần “Qua đời”&quot;&gt;sửa&lt;/a&gt; | &lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;action=edit&amp;amp;section=2&quot; title=&quot;Sửa mã nguồn tại đề mục: Qua đời&quot;&gt;sửa mã nguồn&lt;/a&gt;]&lt;/h2&gt;\r\n\r\n&lt;p&gt;Ngày &lt;a href=&quot;https://vi.wikipedia.org/wiki/4_th%C3%A1ng_2&quot; title=&quot;4 tháng 2&quot;&gt;4 tháng 2&lt;/a&gt; năm &lt;a href=&quot;https://vi.wikipedia.org/wiki/2020&quot; title=&quot;2020&quot;&gt;2020&lt;/a&gt;, võ sư Nguyễn Văn Chiếu qua đời tại &lt;a href=&quot;https://vi.wikipedia.org/wiki/Th%C3%A0nh_ph%E1%BB%91_H%E1%BB%93_Ch%C3%AD_Minh&quot; title=&quot;Thành phố Hồ Chí Minh&quot;&gt;Thành phố Hồ Chí Minh&lt;/a&gt; sau một thời gian chống chọi với bệnh tật, không lâu sau &lt;a href=&quot;https://vi.wikipedia.org/wiki/Sinh_nh%E1%BA%ADt&quot; title=&quot;Sinh nhật&quot;&gt;sinh nhật&lt;/a&gt; lần thứ 71.&lt;sup id=&quot;cite_ref-12&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-12&quot;&gt;[12]&lt;/a&gt;&lt;/sup&gt;&lt;sup id=&quot;cite_ref-13&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-13&quot;&gt;[13]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Lễ nhập quan vào 15 giờ ngày 4 tháng 2 năm 2020 tại nhà riêng của ông ở Quận 8 Thành phố Hồ Chí Minh.&lt;sup id=&quot;cite_ref-14&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-14&quot;&gt;[14]&lt;/a&gt;&lt;/sup&gt; Lễ động quan diễn ra vào 4 giờ 30 phút ngày 8 tháng 2&lt;sup id=&quot;cite_ref-nldquangliem2020_15-0&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-nldquangliem2020-15&quot;&gt;[15]&lt;/a&gt;&lt;/sup&gt;, ngay sau đó, thi thể ông được &lt;a href=&quot;https://vi.wikipedia.org/wiki/H%E1%BB%8Fa_t%C3%A1ng&quot; title=&quot;Hỏa táng&quot;&gt;hỏa táng&lt;/a&gt; và tro cốt được an táng tại &lt;a href=&quot;https://vi.wikipedia.org/wiki/Ngh%C4%A9a_trang_%C4%90a_Ph%C6%B0%E1%BB%9Bc&quot; title=&quot;Nghĩa trang Đa Phước&quot;&gt;nghĩa trang Đa Phước&lt;/a&gt;, huyện &lt;a href=&quot;https://vi.wikipedia.org/wiki/B%C3%ACnh_Ch%C3%A1nh&quot; title=&quot;Bình Chánh&quot;&gt;Bình Chánh&lt;/a&gt;, Thành phố Hồ Chí Minh.&lt;sup id=&quot;cite_ref-nldquangliem2020_15-1&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-nldquangliem2020-15&quot;&gt;[15]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Võ sư Nguyễn Văn Chiếu theo đạo &lt;a href=&quot;https://vi.wikipedia.org/wiki/Thi%C3%AAn_Ch%C3%BAa_gi%C3%A1o&quot; title=&quot;Thiên Chúa giáo&quot;&gt;Thiên Chúa giáo&lt;/a&gt;.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-9&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Giải thưởng[&lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;veaction=edit&amp;amp;section=3&quot; title=&quot;Sửa đổi phần “Giải thưởng”&quot;&gt;sửa&lt;/a&gt; | &lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;action=edit&amp;amp;section=3&quot; title=&quot;Sửa mã nguồn tại đề mục: Giải thưởng&quot;&gt;sửa mã nguồn&lt;/a&gt;]&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;&lt;i&gt;Huy chương vì sự nghiệp Thể dục thể thao&lt;/i&gt; do &lt;a href=&quot;https://vi.wikipedia.org/wiki/T%E1%BB%95ng_c%E1%BB%A5c_Th%E1%BB%83_d%E1%BB%A5c_Th%E1%BB%83_thao_(Vi%E1%BB%87t_Nam)&quot; title=&quot;Tổng cục Thể dục Thể thao (Việt Nam)&quot;&gt;Tổng cục Thể dục Thể thao (Việt Nam)&lt;/a&gt; trao tặng năm &lt;a href=&quot;https://vi.wikipedia.org/wiki/1997&quot; title=&quot;1997&quot;&gt;1997&lt;/a&gt;&lt;sup id=&quot;cite_ref-vovinamus_chieu_3-3&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-vovinamus_chieu-3&quot;&gt;[3]&lt;/a&gt;&lt;/sup&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;Học vấn[&lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;veaction=edit&amp;amp;section=4&quot; title=&quot;Sửa đổi phần “Học vấn”&quot;&gt;sửa&lt;/a&gt; | &lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;action=edit&amp;amp;section=4&quot; title=&quot;Sửa mã nguồn tại đề mục: Học vấn&quot;&gt;sửa mã nguồn&lt;/a&gt;]&lt;/h2&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Cử nhân ngành Thể dục thể thao&lt;sup id=&quot;cite_ref-vovinamus_chieu_3-4&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-vovinamus_chieu-3&quot;&gt;[3]&lt;/a&gt;&lt;/sup&gt;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;Gia đình[&lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;veaction=edit&amp;amp;section=5&quot; title=&quot;Sửa đổi phần “Gia đình”&quot;&gt;sửa&lt;/a&gt; | &lt;a href=&quot;https://vi.wikipedia.org/w/index.php?title=Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu&amp;amp;action=edit&amp;amp;section=5&quot; title=&quot;Sửa mã nguồn tại đề mục: Gia đình&quot;&gt;sửa mã nguồn&lt;/a&gt;]&lt;/h2&gt;\r\n\r\n&lt;p&gt;Nguyễn Văn Chiếu lập gia đình với bà &lt;a href=&quot;https://vi.wikipedia.org/wiki/Tr%E1%BA%A7n_Th%E1%BB%8B_Thanh&quot; title=&quot;Trần Thị Thanh&quot;&gt;Trần Thị Thanh&lt;/a&gt; và có hai người con: một gái và một trai.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-10&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt;&lt;sup id=&quot;cite_ref-vovinamus_chieu_3-5&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-vovinamus_chieu-3&quot;&gt;[3]&lt;/a&gt;&lt;/sup&gt; Con gái (con đầu lòng) của ông tên là Nguyễn Thị Thanh Nhã, tức Thanh Nhã Berrier (mang quốc tịch Pháp), chồng là Francois Berrier người Pháp. Bà Nguyễn Thị Thanh Nhã là Tổng thư ký Liên đoàn Vovinam Châu Âu EVVF, Phó Tổng thư ký Liên đoàn Vovinam Thế giới WVVF.&lt;sup id=&quot;cite_ref-thethaohcm20200204_1-11&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-thethaohcm20200204-1&quot;&gt;[1]&lt;/a&gt;&lt;/sup&gt; Con trai Nguyễn Văn Chiếu tên là &lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_B%C3%ACnh&quot; title=&quot;Nguyễn Bình&quot;&gt;Nguyễn Bình&lt;/a&gt; Định (sinh năm 1982), Hồng Đai Nhất cấp Vovinam (5 Đẳng), hiện là Trưởng Bộ Môn Vovinam thuộc Sở Thể thao và Văn Hoá Thành phố Hồ Chí Minh.&lt;sup id=&quot;cite_ref-nguoiduatin_9-4&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-nguoiduatin-9&quot;&gt;[9]&lt;/a&gt;&lt;/sup&gt;&lt;sup id=&quot;cite_ref-16&quot;&gt;&lt;a href=&quot;https://vi.wikipedia.org/wiki/Nguy%E1%BB%85n_V%C4%83n_Chi%E1%BA%BFu#cite_note-16&quot;&gt;[16]&lt;/a&gt;&lt;/sup&gt;&lt;/p&gt;\r\n', '', 'Nguyễn Văn Chiếu (4 tháng 11 năm 1949 – 4 tháng 2 năm 2020, tên thánh: Phê-rô) là một võ sư người Việt Nam. Ông nguyên là Chánh Chưởng Quản Hội Đồng Võ Sư Chưởng Quản Môn phái Vovinam Việt Võ Đạo[5], được tấn phong đẳng cấp Bạch đai Chánh Chưởng Quản Môn phái Vovinam Việt Võ Đạo ngày 27 tháng 9 năm 2015. Ông cũng từng giữ chức vụ Trưởng phòng Thể dục Thể thao Quận 8, Thành phố Hồ Chí Minh.[6]', '', 'Nguyễn Văn Chiếu', '', '', '', '', '', '', '', '', 1, 1, 'tin-tuc', 1699494357, 1699494402, 12, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', 0, 0),
