(119, 0, 0, 0, 0, '', 0, 0, '', '', '', 'khoa-5', '', '', 'TRUNG TÂM THỂ DỤC THỂ THAO THÀNH PHỐ THỦ ĐỨC BỘ MÔN VOVINAM CỘNG HÒA XÃ HỘI CHỦ NGHĨA VIỆT NAM Độc lập – Tự do – Hạnh phúc ----o0o-----\r\n\r\nSố: 05-24/ĐL-VVN Thành phố Thủ Đức, ngày 19 tháng 02 năm 2024\r\n\r\nĐIỀU LỆ\r\n\r\nKỳ thi thăng cấp Vovinam - Việt Võ Đạo thành phố Thủ Đức\r\n\r\nKhóa 05 năm 2024\r\n\r\n- Căn cứ Quy chế hoạt động của trung tâm Thể dục thể thao thành phố Thủ Đức;\r\n\r\n- Căn cứ Quyết định số 51/QĐ-TDTT ngày 04 tháng 03 năm 2022 về việc phân công phụ trách bộ môn Vovinam – Việt Võ Đạo trung tâm Thể dục thể thao thành phố Thủ Đức;\r\n\r\n- Căn cứ theo Kế hoạch hoạt động của Bộ môn Vovinam – Việt Võ Đạo thành phố Thủ Đức năm 2024;\r\n\r\n- Bộ môn Vovinam - Việt Võ Đạo thành phố Thủ Đức ban hành Điều lệ kỳ thi thăng cấp Vovinam – Việt Võ Đạo thành phố Thủ Đức khóa 05 năm 2024 như sau:\r\n\r\nĐiều 1. Mục đích – yêu cầu:\r\n\r\n1.1 Mục đích:\r\n\r\n- Tiếp tục đẩy mạnh thực hiện cuộc vận động “Toàn dân rèn luyện thân thể theo gương Bác Hồ vĩ đại” giai đoạn 2021-2030 thường xuyên tập luyện và thi đấu thể thao để nâng cao sức khỏe, phát triển thể chất.\r\n\r\n- Phát triển và tuyển chọn tài năng thể thao, bổ sung cho lực lượng vận động viên năng khiếu của thành phố Thủ Đức tham dự giải Thể thao thành phố Hồ Chí Minh, giải quốc gia trong những năm tiếp theo.\r\n\r\n- Đánh giá quá trình huấn luyện, tập luyện môn võ Vovinam – Việt Võ Đạo tại các câu lạc bộ trực thuộc thành phố Thủ Đức.\r\n\r\n1.2 Yêu cầu:\r\n\r\n- Huấn luyện viên trưởng tại các câu lạc bộ Vovinam-Việt Võ Đạo quán triệt tinh thần kỳ thi thăng cấp Vovinam – Việt Võ Đạo thành phố Thủ Đức khóa 05 năm 2024 theo nội dung quy định của Điều lệ khóa thi.\r\n\r\n- Kỳ thi thăng cấp Vovinam – Việt Võ Đạo được tổ chức an toàn nhằm đảm bảo sức khỏe của môn sinh khi tham gia khóa thi.\r\n\r\nĐiều 2: Đối tượng và điều kiện dự thi:\r\n\r\n2.1 Đối tượng:\r\n\r\n- Dành cho các môn sinh đã học hết chương trình huấn luyện Vovinam – Việt Võ Đạo tại các câu lạc bộ trực thuộc bộ môn Vovinam – Việt Võ Đạo thành phố Thủ Đức.\r\n\r\n2.2 Điều kiện:\r\n\r\n- Môn sinh có đủ sức khỏe, đúng niên hạn thi thăng cấp, có trình theo chuyên môn theo quy định của môn phái Vovinam – Việt Võ Đạo, không vi phạm đạo đức, tác phong, kỷ luật tại các câu lạc bộ.\r\n\r\n- Được sự đồng ý của huấn luyện viên phụ trách tại các câu lạc bộ trực thuộc bộ môn Vovinam – Việt Võ Đạo thành phố Thủ Đức, nộp đầy đủ hồ sơ theo quy định.\r\n\r\nĐiều 3: Thời gian và địa điểm:\r\n\r\n- Thời gian: Lúc 07g30 ngày 26/05/2024 (Chủ nhật).\r\n\r\n- Địa điểm: Nhà thi đấu TT.TDTT thành phố Thủ Đức (Cơ sở 2 - Số 26, Chương Dương, phường Linh Chiểu, thành phố Thủ Đức).\r\n\r\nĐiều 4. Nội dung khóa thi :\r\n\r\n- Áp dụng theo Chương trình huấn luyện hiện hành của Liên đoàn Vovinam - Việt Võ Đạo TP.Hồ Chí Minh với các nội dung thi gồm:\r\n\r\n+ Võ thuật: Đòn căn bản, đơn luyện, song luyện, giao đấu đối kháng. Ở nội dung thi lên cấp lam đai sẽ phải thi thêm bài “Khởi quyền”.\r\n\r\nĐiều 5: Hồ sơ dự thi - địa điểm nộp hồ sơ:\r\n\r\n5.1 Hồ sơ dự thi gồm:\r\n\r\n- Danh sách tổng hợp dự thi thăng cấp theo mẫu có dán ảnh (ảnh mới 2x3 chụp trong vòng 6 tháng), có xác nhận của HLV phụ trách câu lạc bộ.\r\n\r\n+ Về Võ đạo: chương trình lý thuyết võ đạo theo từng cấp và kiến thức chung.\r\n\r\n+ Về Vovinam Việt Võ Đạo: được tiến hành thi trắc nghiệm (tại địa điểm thi).\r\n\r\n- Đăng ký danh sách theo file mẫu\r\n\r\n- Giấy cam kết đối vơi môn sinh đủ 18 tuổi , hoặc giấy cam kết phụ huynh đối với môn sinh dưới 18 tuổi (theo mẫu BTC)\r\n\r\n- Xuất trình thẻ Môn sinh .(không chấp nhận thẻ đẳng cấp ,kết quả khóa thi )\r\n\r\n- Nộp lệ phí thi: 350.000 đồng (đã bao gồm phí làm thẻ đẳng cấp của Liên đoàn Vovinam\r\n\r\n- Việt Võ Đạo TP.Hồ Chí Minh) và đai\r\n\r\n5.2 Địa điểm nộp hồ sơ:\r\n\r\n- Thời gian: Từ 09g00 đến 11g00, ngày 12/05/2024 (Chủ nhật) .\r\n\r\n- Địa điểm: Tại văn phòng bộ môn Vovinam – Việt Võ Đạo Thành Phố Thủ Đức (Cơ sở 2 - Số 26, Chương Dương, phường Linh Chiểu, thành phố Thủ Đức).\r\n\r\n- Lưu ý: Huấn luyện viên phụ trách gửi file đăng ký dự thi thăng cấp (theo mẫu) qua địa chỉ zalo (Hanhhuynh - 0898.995.167) trước 20g00 ngày 10/05/2024. Ban tổ chức khóa thi không nhận hồ sơ không đúng thủ tục và trễ hạn.\r\n\r\nĐể đảm bảo cho kỳ thi thăng cấp Vovinam – Việt Võ Đạo Thành Phố Thủ Đức khóa 05 năm 2024 được tổ chức thành công tốt đẹp, đề nghị các Câu lạc bộ trực thuộc Thành Phố Thủ Đức chuẩn bị tốt chương trình thi thăng cấp với chất lượng chuyên môn cao và triển khai tốt tinh thần Điều lệ khóa thi. Mọi thắc mắc xin liên hệ Võ sư cao cấp Đào Hoàng Tuấn – Phụ trách bộ môn (ĐT: 0903.381416) hoặc Võ sư Huỳnh Ngọc Hạnh – HLV trưởng Vovinam Tp.Thủ Đức (ĐT: 0898.995167).\r\n\r\nBộ môn Vovinam TP. Thủ Đức\r\n\r\nPhụ trách bộ môn\r\n\r\nNơi nhận:\r\n\r\n- Trung tâm TDTT TP.Thủ Đức (Duyệt);\r\n\r\n- Liên đoàn VVN-VVĐ TP.HCM (Báo cáo);\r\n\r\n- Các CLB trực thuộc bộ môn;\r\n\r\nLưu: VT.\r\n\r\nVõ Sư: Đào Hoàng Tuấn\r\n\r\nTHI TRẮC NGHIỆM LÝ THUYẾT VÕ ĐẠO VOVINAM.TP.THỦ ĐỨC\r\n\r\nI .TRÌNH ĐỘ TỰ VỆ VIỆT VÕ ĐẠO THI THĂNG CẤP LAM ĐAI (Xanh đậm)\r\n\r\n1.Vovinam là gì ?\r\n\r\n-Vovinam là từ viết tắt của cụm từ &lt; Võ việt nam &gt;\r\n\r\n- Về nội dung vovinam có hai phần :\r\n\r\n- Võ thuật Việt Nam (Việt võ thuật )\r\n\r\n- Vó đạo Việt Nam ( Việt võ đạo )\r\n\r\n-\r\n\r\n2. Khi &lt; Nghiêm Lễ&gt; Việt võ đạo sinh đặc bàn tay phải lên trái tim với ý nghĩa gì ?\r\n\r\nKhi Nghiêm Lễ Việt võ đạo sinh đặt bàn tay lên trái tim có ý nghĩa là bàn tay thép đặt lên trái tim từ ái ,đưc dung đi đôi với long nhân ,Võ thuật gắn liền với võ đạo ,việt võ đạo sinh chỉ được dung võ để cảnh cáo cảm hóa người ,chứ không phải để trừng phạt trả thù người .\r\n\r\n3.Vovinam Việt võ đạo có mấy màu đai ?\r\n\r\nViệt vó đạo có (4) màu đai : xanh , vàng , đỏ ,trắng .\r\n\r\n4. Vovinam thành lập năm nào, ỏ đâu ?\r\n\r\nVovinam được thành lập năm 1938 ,tại Hà Nội , do Cố võ sư sáng tổ Nguyễn Lộc Thành lập\r\n\r\nPhụ trách bộ môn\r\n\r\nVõ Sư Đào Hoàng Tuấn\r\n\r\n(Soạn thảo )\r\n\r\nTHI TRẮC NGHIỆM LÝ THUYẾT VÕ ĐẠO VOVINAM TP.THỦ ĐỨC\r\n\r\nII.TRÌNH ĐỘ CẤP LAM ĐAI THI THĂNG CẤP LAM ĐAI 1 (XANH ĐẬM 1)\r\n\r\n1. Điều tâm niệm từ 1 đến 5:\r\n\r\n1.Việt võ đạo sinh nguyện đạt tối cao độ của nghệ thuật để phục vụ dân tộc và nhân loại .\r\n\r\n2.Việt võ đạo sinh nguện trung kiên phát huy môn phái, xây dựng thế hệ thanh niên dấn thân hiến ích .\r\n\r\n3.Việt vó đạo sinh đồng tâm nhất trí ,tôn kính người trên ,thương mến đồng đạo\r\n\r\n4.Việt võ đạo sinh tuyệt đối tôn trọng kỹ luật ,nêu cao danh dự võ sĩ .\r\n\r\n5.Việt võ đạo sinh tôn trọng các võ phái khác, chỉ dung võ để tự vệ và bên vực lẻ phải .\r\n\r\n2. Ý nghĩa các màu đai của Vovinam –Việt Võ Đạo\r\n\r\n· Xanh : Biểu thị màu hy vọng, với ý nghĩa võ sinh bất đầu luyện tập võ thuật và tu dưởng tin thần võ đạo\r\n\r\n· Vàng : Biểu thị màu đát (màu da) với ý nghĩa võ thuật và võ đạo đã thấm vào da thịt trỏ thành bản thể vững chắc của người môn sinh Việt võ đạo .\r\n\r\n· Đỏ: Biểu thị màu lủa (màu máu ),với ý nghĩa võ thuật và võ đạo thấm vào máu, tỏa sáng đường đi của người môn sinh Việt võ đạo\r\n\r\n· Trắng: Biểu thị màu tinh khiết (màu xương tủy ),chân tịnh với ý nghĩa võ thuật và võ đạo đã thấm sâu vào xương tủy, đạt đến độ cao siêu vô hạn của người tượng trung cho môn phái .\r\n\r\n3. Hãy cho biết danh tánh, ngày sinh, nơi sinh, ngày qua đời, nơi qua đời của của cố võ sư Sáng tổ môn phái Vovinam – Việt Võ Đạo ?\r\n\r\nCố võ sư sáng tạo môn phái Vovinam –Việt Võ Đạo tên là Nguyễn Lộc. Ông sinh ngày mùng 8 tháng 4 năm Nhăm Tý (1912) tại làng Hữu Bằng, Huyện ThạchThất, Tỉnh Sơn Tây (nay thuộc Hà Nội ) và qua đời ngày mùng 4 tháng 4 năm Canh Tý (1960) tại Sài Gòn (nay là TPHCM)\r\n\r\n4. Hãy cho biết danh tánh Cố võ sư Chưởng môn của môn phái Vovinam –Việt Võ Đạo? Ông sinh năm nào tại đâu ?Mất ngày tháng năm nào tại đâu?\r\n\r\nCố võ sư Lê Sáng là chưởng môn đầu tiên và duy nhất của môn phái Vovinam-Việt Võ Đạo, Ông sinh vào mùa thu năm 1920 tại Hà Nội. Ông mất vào ngày 27/09/2010 (Dương Lịch - Nhằm ngày 20/08 năm Canh Dần) tại TPHCM.\r\n\r\n(Soạn thảo )\r\n\r\nVõ Sư Đào Hoàng Tuấn\r\n\r\nTHI TRẮC NGHIỆM LÝ THUYẾT VÕ ĐẠO VOVINAM .TP.THỦ ĐỨC\r\n\r\nIII.TRÌNH ĐỘ CẤP LAM ĐAI THI THĂNG CẤP LAM ĐAI 2 (XANH ĐẬM 2)\r\n\r\n1.5 điều tâm niệm từ 6 đến 10:\r\n\r\nĐiều 6: Việt võ đạo sinh chuyên cần học tập ,rèn luyện tinh thần ,trau dồi đạo hạnh .\r\n\r\nĐiều 7: Việt võ đạo sinh sống trong sạch ,giản dị trung thực và cao thượng\r\n\r\nĐIều 8:Việt võ đạo sinh kiện toàn một ý chí danh thép ,nổ lục tự thân cầu tiến .\r\n\r\nĐiều 9: Việt võ đạo sinh sáng suốt nhận định ,bền gan tranh đấu ,tháo vát hành động .\r\n\r\nĐiều 10:Việt võ đạo sinh tự tin ,tự thắng ,khiêm cung ,độ lượng ,luôm kiểm điểm để tiến bộ .\r\n\r\n2. Hãy trình bày hệ thống đẳng cấp hiện nay của Việt võ đạo ?\r\n\r\na.Tự vệ Việt võ đạo : đai màu áu thời gian luyện tập 3(ba) tháng .Nhập môn Việt võ đạo :đai xanh dương đậm ,thờig gian luyện tập 3(ba ) tháng .\r\n\r\nb.Lam đai :Đai xanh dương đậm có gạch vàng ,ba cấp mỗi cấp luyện tập sáu tháng\r\n\r\nc. Huyền đai : Đai đen một cấp thời gian luyện tập một năm\r\n\r\nd.Hoàng đai : Đai vàng có gạch đỏ,ba cấp ,mỗi cấp luyện tập hai đến ba năm\r\n\r\ne .Chuẩn hồng đai : Đai đỏ có hai viền vàng ,mmootj cấp luyện tập bốn năm\r\n\r\nf.Hồng đai : Đai đỏ có vạch trắng ,sáu cấp môi\\x cấp luyện tập năm năm\r\n\r\ng. Bạch đai : Đai trắng có bốn chỉ tứ sắc xanh , đen vàng ,đỏ ,một cấp ,thời gian luyện tập : vô định ,đây là đai cao nhất dành riêng cho võ sư chưởng môn môn phái.\r\n\r\n3.Hãy trình bày mục đích của Vovinam – Việt Võ Đạo ?\r\n\r\nMôn phái Vovinam – Việt Võ Đạo hoạt động nhằm 3 mục đích :\r\n\r\n1.Bảo tồn ,chấn hung và phát triễn môn phái Vovinam- Việt Võ Đạo do cố Võ Sư Nguyễn Lộc sáng tạo năm 1938 Vovinam – Việt Võ Đạo nêu cao tinh thần truyền thống bất khuất của dân tộc ,khai thác trọn vẹn hai phần cương và nhu của con người ,và phối hợp mọi tinh hoa võ thuật đã có trên thời giới\r\n\r\n2. Sưu tầm ,nghiên cứu và phát sinh các thế võ để tu bổ, xây dựng cho nển võ thuật Vovinam mỗi ngày một phong phú và tiến bộ.\r\n\r\n3. Huấn luyện môn sinh trên ba phương diện Võ lực-Võ thuật- Tinh thần Võ đạo\r\n\r\nVề Võ lực: Môn phái luyện tập cho môn sinh có một thân hình rắn rỏi, vững vàng, một sức lực mạnh mẻ dẻo dai có thể bền bỉ chịu đựng trước mọi khó khan, cực nhọc, đẩy lui các bệnh tật, giữ cho thân thể luôn luôn tráng kiện và lành mạnh.\r\n\r\nVề Võ thuật: Môn phái sẽ huấn luyện cho môn sinh một kỹ thuật tinh vi để tự vệ hữu hiệu và sẵn sàng bênh vực lẽ phải.\r\n\r\nVề Tinh thần Võ đạo: Môn phái sẽ rèn luyện cho môn sinh một tâm hồn cao thượng, một ý chí bất khuất, một tính tình hào hiệp, biết khép mình trong kỷ luật tự giác, biết sống hợp quần trong tình đồng đạo, biết hy sinh trong nếp sống vị tha và trở nên những công dân gương mẫu, phục vụ cho bản thân, gia đình, Tổ quốc và nhân loại.\r\n\r\nIV. TRÌNH ĐỘ LAM ĐAI 2 THI THĂNG CẤP LAM ĐAI 3 (Xanh đậm 3)\r\n\r\n( KIỂM TRA TẤT CẢ CÁC CÂU TRONG CHƯƠNG TRÌNH LÝ THUYẾT TỪ CẤP\r\n\r\nLAM ĐAI ĐẾN CẤP LAM ĐAI II )\r\n\r\n(Soạn thảo phần thi Lý thuyết khảo hạch ,trong Lý thuyết Võ đạo của môn phái)\r\n\r\nPHỤ TRÁCH BỘ MÔN\r\n\r\nĐào Hoàng Tuấn\r\n\r\n( soạn thảo )', '', '26/05/2024', '', 'Khóa 5', '', '', '', '', '', '', '', '', 1, 1, 'khoa-thi', 1711781350, 1715064841, 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', 0, 1),
