INSERT INTO `table_news` (`id`, `id_list`, `id_item`, `id_cat`, `id_sub`, `id_tags`, `noibat`, `tb`, `photo`, `icon`, `options`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `tenen`, `tenvi`, `tenko`, `tenkhongdauko`, `motako`, `noidungko`, `taptin`, `link`, `link_video`, `thoigian`, `stt`, `hienthi`, `type`, `ngaytao`, `ngaysua`, `luotxem`, `start`, `end`, `event_location`, `start_time`, `event_lecturer`, `end_time`, `color`, `id_club`) VALUES
(127, 16, 0, 0, 0, '', 0, 0, '', '', '{\"p\":\"\",\"w\":null,\"h\":null,\"m\":null}', 'cau-hoi-khao-hach-thi-len-dai', '', '', '&lt;h3&gt;Câu Hỏi Khảo Hạch Thi Lên Đai Xanh Đậm&lt;/h3&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h5&gt;10 Điều Tâm Niệm Của Việt Võ Đạo Sinh&lt;/h5&gt;\r\n\r\n&lt;ol&gt;\r\n	&lt;li&gt;VVĐS (Việt Võ Đạo Sinh) nguyện đạt tới cao độ của nghệ thuật để phục vụ dân tộc và nhân loại.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS nguyện trung kiên phát huy môn phái, xây dựng thế hệ thanh niên Việt Võ Đạo.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS đồng tâm nhất trí, tôn kính người trên, thương mến đồng đạo.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS tuyệt đối tôn trọng kỷ luật, nêu cao danh dự võ sĩ.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS tôn trọng các phái võ khác, chỉ dùng võ để tự vệ và bênh vực lẽ phải.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS chuyên cần học tập, rèn luyện tinh thần, trau giồi đạo hạnh.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS sống trong sạch, giản dị, trung thực và cao thượng.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS kiện toàn một ý chí đanh thép, thắng phục cường quyền bạo lực.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS sáng suốt nhận định, bền gan tranh đấu, tháo vát hành động.&lt;/li&gt;\r\n	&lt;li&gt;VVĐS tự tin, tự thắng, khiêm cung, độ lượng, luôn luôn kiểm điểm để tiến bộ.&lt;/li&gt;\r\n&lt;/ol&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;a id=&quot;ly-thuyet-lam-dai1&quot;&gt;&lt;/a&gt;Câu Hỏi Khảo Hạch Thi Lên Lam Đai I Cấp&lt;/h3&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 1&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;VOVINAM là gì? Tại sao gọi là VOVINAM?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;VOVINAM được viết tắt với 3 tiếng “Võ Việt Nam” với mục đích:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;ul&gt;\r\n				&lt;li&gt;Để phân biệt với các môn võ đã có ở trong nước, đều được gọi chung là Võ Việt Nam&lt;/li&gt;\r\n				&lt;li&gt;Để người ngoại quốc dễ đọc, dễ nhớ như người Việt Nam.&lt;/li&gt;\r\n			&lt;/ul&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 2&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Khi nghiêm lễ, Việt Võ Đạo Sinh đặt bàn tay lên tim có ý nghĩa gì?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Khi nghiêm lễ, VVĐS đặt bàn tay lên tim có nghĩa là bàn tay thép đặt trên trái tim từ ái, đức dũng phải đi đôi với lòng nhân, võ thuật phải đi đôi với võ đạo. Người môn sinh VVĐ chỉ được dụng võ khi đặt vào đó một tình thương.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 3&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Việt Võ Đạo Sinh phải ghi nhớ mấy điểm sơ khởi về kỷ luật võ đường? Hãy kể ra.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Việt Võ Đạo Sinh phải ghi nhớ 4 điểm kỷ luật võ đường:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;ul&gt;\r\n				&lt;li&gt;Đi tập đều đặn, đúng giờ.&lt;/li&gt;\r\n				&lt;li&gt;Khi nghỉ phải làm đơn xin phép hoặc thông báo HLV phụ trách biết.&lt;/li&gt;\r\n				&lt;li&gt;Ra, vô phòng tập chào chân dung Sáng-Tổ như nghiêm lễ đối với người trên cấp mình.&lt;/li&gt;\r\n				&lt;li&gt;Tôn trọng các võ phái khác.&lt;/li&gt;\r\n			&lt;/ul&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 4&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Quan niệm thông thường của mọi người học võ ra sao? Việt Võ Đạo Sinh học võ để làm gì?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Quan niệm thông thường của mọi người là học võ để tự vệ hoặc giỏi võ, còn VVĐS học võ để thân thể khỏe mạnh, trí tuệ minh mẫn, tâm hồn cao thượng.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 5&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Quan niệm dụng võ của VOVINAM gồm mấy điểm? Hãy kể ra.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Quan niệm dụng võ của VOVINAM gồm 4 điểm:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;ul&gt;\r\n				&lt;li&gt;Không thượng đài.&lt;/li&gt;\r\n				&lt;li&gt;Không gây lộn, không thử võ với người.&lt;/li&gt;\r\n				&lt;li&gt;Chỉ tự vệ.&lt;/li&gt;\r\n				&lt;li&gt;Chuộng lẽ phải.&lt;/li&gt;\r\n			&lt;/ul&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 6&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Việt Võ Đạo Sinh có được phép thượng đài không? Tại sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;VVĐS không được phép thượng đài, vì Môn Phái VOVINAM là một môn phái Võ-Đạo có đường lối, chủ trương rỏ rệt, nên muốn góp phần vào việc cải tạo xã hội, xây dựng con người toàn diện hơn là việc thượng đài chỉ có tính cách thể thao.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 7&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Trong trường hợp nào Việt Võ Đạo Sinh được phép dụng võ?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;VVĐS được phép dụng võ trong những trường hợp dưới đây:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;ul&gt;\r\n				&lt;li&gt;Khi danh dự bị xúc phạm, quyền sống bị đe dọa.&lt;/li&gt;\r\n				&lt;li&gt;Trọng công bằng chính trực, chống bất công để bênh vực kẻ yếu.&lt;/li&gt;\r\n			&lt;/ul&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 8&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tinh thần võ đạo mà môn phái VOVINAM chủ trương có mấy phần vụ? Hãy giải thích tổng quát.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Tinh thần võ đạo mà môn phái VOVINAM chủ trương gồm 3 phần vụ:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;ul&gt;\r\n				&lt;li&gt;Sống cho mình.&lt;/li&gt;\r\n				&lt;li&gt;Để người khác sống.&lt;/li&gt;\r\n				&lt;li&gt;Phải sống cho người.&lt;/li&gt;\r\n			&lt;/ul&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 9&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;VOVINAM có mấy màu đai? Ý nghĩa ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Môn phái VOVINAM có 4 màu đai căn bản và ý nghĩa như:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;ul&gt;\r\n				&lt;li&gt;Xanh : biểu thị cho màu hy vọng, với ý nghĩa võ sinh đang nuôi một hy vọng tiến sâu vào nghành võ thuật và tu dưỡng tinh thần võ đạo.&lt;/li&gt;\r\n				&lt;li&gt;Vàng : biểu thị cho màu da, với ý nghĩa võ thuật và võ đạo bắt đầu ngấm vào thân thể.&lt;/li&gt;\r\n				&lt;li&gt;Đỏ : biểu thị cho màu máu, với ý nghĩa võ thuật và võ đạo ngấm sâu vào máu huyết, lưu thông trong thân thể.&lt;/li&gt;\r\n				&lt;li&gt;Trắng : biểu thị cho màu xương, với ý nghĩa võ thuật và võ đạo đã ngấm sâu vào xương tủy, biến thành thân thái con người, tượng trưng tinh hoa môn phái.&lt;/li&gt;\r\n			&lt;/ul&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 10&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;VOVINAM có mấy đẳng cấp? Thời gian tập, mỗi cấp bao lâu?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt; &lt;/td&gt;\r\n			&lt;td&gt;Về đẳng: VOVINAM Việt Võ Đạo có:&lt;br /&gt;\r\n			Sơ Đẳng: (đai lưng màu xanh dương)&lt;br /&gt;\r\n			Trung Đẳng: (đai lưng màu vàng)&lt;br /&gt;\r\n			Cao Đẳng: (đai lưng màu đỏ)&lt;br /&gt;\r\n			Thượng Đẳng: (đai lưng màu trắng)Về cấp:&lt;br /&gt;\r\n			Sơ Đẳng có 3 cấp (đai xanh thêm 1, 2, 3 vạch vàng)&lt;br /&gt;\r\n			Trung Đẳng có 3 cấp (đai vàng thêm 1, 2, 3 vạch đỏ)&lt;br /&gt;\r\n			Cao Đẳng có 7 cấp (đai đỏ thêm từ 1 đến 7 vạch trắng)&lt;br /&gt;\r\n			Thượng Đẳng độc nhất, dành riêng cho vị Chưởng-Môn, lãnh đạoMôn-PháiNgoài ra, khi bắt đầu học võ phải qua lớp “tự vệ nhập môn” đai xanh như màu áo, mới lên bậc sơ đẳng. Và khi hết bậc trung đẳng “nếu trúng tuyển” môn sinh sẽ trở thành võ-sư trợ huấn (đai đỏ có 2 viền vàng) và chuyển lên học lớp dự bị cao đẳng. Từ lớp Tự Vệ Nhập Môn lên đến hết bậc Sơ Đẳng, thời gian từ 6 tháng đến một năm. Phần Trung Đẳng mỗi cấp từ 2 đến 3 năm (Chuẩn Hoàng Đai tương đương với Huyền Đai). Riêng cao đẳng 4 năm mới lên một cấp. Thượng đẳng vô địch vì chỉ vị Chưởng-Môn có nhiệm vụ lãnh đạo môn phái mới ở trình độ đó.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 11&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Hiện thời trong môn phái có mấy võ sư mang bạch đai thượng đẳng? Trong tương lai có thể có hai hoặc ba thượng đẳng không?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Hiện thời trong môn phái chỉ có một võ sư mang bạch đai thượng đẳng là võ-sư Chưởng-Môn. Trong tương lai nếu có thì cũng chỉ có một mà thôi, vĩ vị Võ sư đó kế nhiệm Chưởng Môn.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 12&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Căn cứ trên mấy điểm, môn phái VOVINAM đưa ra nhận định tổng quát về đức hạnh của người môn sinh? Hãy kể ra.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Đức hạnh của người môn sinh căn cứ trên 4 điểm:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;ol&gt;\r\n				&lt;li&gt;Tính nết, tốt hay xấu, dễ bảo hay ngổ nghịch.&lt;/li&gt;\r\n				&lt;li&gt;Cách đối xử, trong gia đình và ngoài xã hội.&lt;/li&gt;\r\n				&lt;li&gt;Tinh thần học tập và kỷ luật, với học đường và võ đường.&lt;/li&gt;\r\n				&lt;li&gt;Tinh thần trách nhiệm, khi được giao phó cho một công tác nào đó.&lt;/li&gt;\r\n			&lt;/ol&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 13&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Trong đại gia đình VOVINAM, các môn đồ đối xử với nhau ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Trong đại gia đình VOVINAM, các môn đồ thương yêu, kính trọng lẫn nhau. Sự kính trọng và lòng thương yêu ấy đan kết thành kỷ luật môn phái, một giềng mối vững chắc giúp các môn đồ đoàn kết chặt chẽ để nêu cao danh dự môn-phái và trở thành những con người toàn diện.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 14&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Võ sinh và môn sinh khác nhau thế nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Võ sinh : người mới tập võ, chưa làm Lễ Tuyên Thệ Nhập Môn.&lt;br /&gt;\r\n			Môn sinh: người đã qua một trình độ rèn luyện võ thuật, thấm nhuần tinh thần võ đạo và đã làm Lễ Tuyên Thệ Nhập Môn.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;a id=&quot;ly-thuyet-lam-dai2&quot;&gt;&lt;/a&gt;Câu Hỏi Khảo Hạch Thi Lên Lam Đai II Cấp&lt;/h3&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 1&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tại sao môn phái VOVINAM quan niệm tài và đức phải đi đôi với nhau?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Bởi vì người có tài mà thiếu đức (cũng như người võ biền) sẽ trở thành tàn bạo, độc ác. Nếu chỉ có đức mà thiếu tài sẽ trở thành yếu hèn, nhu nhược.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 2&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Nếu chỉ có tài mà thiếu đức thì kết quả ra sao? Ngược lại chỉ có đức mà thiếu tài sẽ thế nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Nếu chỉ có tài mà thiếu đức, tài ấy chỉ làm hại cho xã hội, không hữu ích cho chính bản thân, gia đình, quốc gia, xã hội. Nếu chỉ có đức mà thiếu tài tuy sẽ thành người tốt nhưng không đủ bản lãnh giữ được mãi chớ chưa nói tới sự phát huy và phổ cập những tính tốt đó cho mọi người.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 3&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Mục đích của môn phái VOVINAM có mấy điều? Hãy kể điều thứ 1 (hoặc thứ 2 hoặc thứ 3).&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Mục đích của môn phái VOVINAM gồm có 3 điều. Điều thứ 1 là: Bảo tồn, phát triển và quảng bá võ học Việt Nam, cùng khai thác trọn vẹn cả hai phần Cương và Nhu của con người để xiển dương môn phái VOVINAM, bằng cách lấy những môn võ và vật cổ truyền Việt Nam làm căn bản, và phối hợp, thái dụng mọi tinh hoa võ thuật đã và hiện có trên thế giới.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 4&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Về võ lực, môn phái VOVINAM luyện tập cho môn sinh ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Về võ lực, môn phái VOVINAM luyện tập cho môn sinh một thân hình dắn dỏi, vững vàng, một sức mạnh dẻo dai, để có thể chịu đựng mọi khó khăn cực nhọc, đẩy lui các bệnh hoạn, giữ cho thân thể luôn luôn tráng kiện và lành mạnh.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 5&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Về võ thuật, môn phái VOVINAM huấn luyện cho môn sinh ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Về võ thuật, môn phái VOVINAM huấn luyện cho môn sinh một kỷ thuật tinh vi để tự vệ hữu hiệu hầu đạt tới mức độ một nghệ thuật cao quý để phục vụ con người và sẵn sàng bênh vực lẽ phải.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 6&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Về võ đạo, môn phái VOVINAM rèn luyện cho môn sinh những gì?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Về võ đạo, môn phái VOVINAM rèn luyện cho môn sinh một tâm hồn cao thượng, một ý chí quật cường, một phong thái hào hiệp, một tinh thần kỷ luật tự giác vững chắc, một nếp sống hợp quần trong đồng đạo, một truyền thống hy sinh cao cả, một đức độ khoan dung từ ái, để phục vụ hữu hiệu cho bản thân, gia đình, dân tộc và nhân loại.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 7&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tôn chỉ của môn phái VOVINAM có mấy điểm?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Tôn chỉ của môn phái VOVINAM gồm có 5 điểm.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 8&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Mọi hoạt động của môn phái VOVINAM đều xây dựng trên nền tảng nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Mọi hoạt động của môn phái VOVINAM đều xây dựng trên nền tảng: Lấy con người làm cứu cánh, lấy đạo hạnh làm phương châm, lấy kỷ thuật và ý chí quật cường làm phương tiện.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 9&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Lịch sử môn phái VOVINAM chia ra làm mấy giai đoạn?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Lịch sử môn phái VOVINAM có thể chia ra làm 5 giai đoạn:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;ol&gt;\r\n				&lt;li&gt;Giai đoạn phôi thai.&lt;/li&gt;\r\n				&lt;li&gt;Giai đoạn thành lập và phát.&lt;/li&gt;\r\n				&lt;li&gt;Giai đoạn trưởng.&lt;/li&gt;\r\n				&lt;li&gt;Giai đoạn phân hóa.&lt;/li&gt;\r\n				&lt;li&gt;&lt;i&gt;Giai đoạn phục hưng.&lt;/i&gt;&lt;/li&gt;\r\n			&lt;/ol&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 10&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Danh tính của Cố Võ sư Sáng Tổ là gì? Người sinh ngày nào? Tại đâu?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Cố Võ sư Sáng Tổ tên Nguyễn Lộc, sinh ngày 8 tháng 4 năm Nhâm Tý (1912) tại làng Hữu Bằng, Huyện Thạch Thất, Tỉnh Sơn Tây (BV).&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 11&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Cố Võ sư Sáng Tổ hoàn thành việc nghiên cứu VOVINAM từ năm nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Có thể nói, suốt đời vị Võ sư Sáng Tổ VOVINAM, ông Nguyễn Lộc đã tận tụy hy sinh làm việc để phục vụ cho việc hoàn thành môn phái VOVINAM.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 12&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Cuộc biểu diễn VOVINAM lần đầu tiên được tổ chức tại đâu? Vào năm nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Cuộc biểu diễn VOVINAM lần đầu tiên được tổ chức tại nhà hát lớn, thành phố Hà Nội, vào mùa thu năm 1938.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 13&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Lớp VOVINAM công khai đầu tiên được mở tại đâu? Vào năm nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Lớp Vovinam công khai đầu tiên được khai giảng vào mùa Xuân năm 1940 tại trường Sư Phạm Hà Nội.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 14&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Cố Võ sư Sáng Tổ mất năm nào? An táng tại đâu?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Cố Võ sư Sáng Tổ mất ngày 4 tháng 4 năm Canh Tý (1960) di thể an táng tại nghĩa địa Đô Thành, đường Mạc Đỉnh Chi, Sài Gòn.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Hiện thời môn phái VOVINAM phát triển mạnh trong giới nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Có thể nói, VOVINAM Việt Võ Đạo là môn võ đang được sinh viên và học sinh Việt Nam yêu chuộng và theo tập nhiều nhất hiện nay.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;a id=&quot;ly-thuyet-lam-dai3&quot;&gt;&lt;/a&gt;Câu Hỏi Khảo Hạch Thi Lên Lam Đai III Cấp&lt;/h3&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h5&gt;Ý nghĩa về phù hiệu và kỳ hiệu của môn phái Vovinam Việt Võ Đạo&lt;/h5&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 1&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Ý nghĩa phù hiệu và kỳ hiệu của VOVINAM Việt Võ Đạo ra sao?&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Về màu sắc:&lt;/b&gt; Phù hiệu và kỳ hiệu đều dùng 4 màu đai làm căn bản là:&lt;br /&gt;\r\n			&lt;i&gt;Xanh&lt;/i&gt;        (tượng trưng cho biển cả và hy vọng).&lt;br /&gt;\r\n			&lt;i&gt;Vàng&lt;/i&gt;        (tượng trưng cho vương đạo Á Đông, màu của vinh quang hiển hách).&lt;br /&gt;\r\n			&lt;i&gt;Đỏ&lt;/i&gt;         (tượng trưng cho lửa sống và tranh đấu hào hùng &lt;b&gt;kiên quyết&lt;/b&gt;).&lt;br /&gt;\r\n			&lt;i&gt;Trắng&lt;/i&gt;        (tượng trưng cho sự thanh thiết, thanh tịnh cao cả, thâm viễn tuyệt vời, không hình không sắc).&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;&lt;b&gt;Về hình nét:&lt;/b&gt; Phù hiệu gồm 2 hình vuông ở trên và tròn ở dưới, ghép lại tượng trưng cho sự phối hợp giữa cương và nhu, biểu thị cổ truyền toàn chân toàn thiện.Cả phù hiệu và kỳ hiệu: Vòng tròn nhỏ (xanh, đỏ) biểu tượng cho âm và dương bản đồ màu vàng ở giữa bao hàm ý nghĩa tương thôi tương giao, tương binh và tương dịch, là hình thể một việt tích oai hùng, tự chủ, bất khuất, độc lập và thống nhất. Vòng tròn lớn màu trắng bao quanh vòng tròn (xanh, đỏ), biểu tượng cho thể huyền nhiệm không sắc không màu với sự phụ phối hợp khắc chế điều hòa bao dung.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h5&gt;Lược sử môn phái Vovinam Việt Võ Đạo&lt;/h5&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 2&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Lược sử Môn Phái Vovinam chia ra làm mấy giai đoạn? Hãy kể những sự chính trong từng giai đoạn.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Lược sử Môn Phái Vovinam Việt Võ Đạo chia ra làm 5 giai đoạn, đó là những giai đoạn:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;p&gt;&lt;b&gt;A. &lt;/b&gt;Những việc chính trong &lt;i&gt;giai đoạn phôi thai&lt;/i&gt; (từ năm 193&lt;b&gt;8)&lt;/b&gt;&lt;br /&gt;\r\n			Trước hai khuynh hướng: Cách mạng sắc máu của nhà chí sĩ cách mạng đương thời, và cách mạng ru ngủ quần chúng bằng cái vỏ tự do phóng khoán của bọn thực dân thống trị, từ thiếu thời Ông Nguyễn Lộc đã ấp ủ hoài bảo đứng ra đảm nhận trách nhiệm của người thanh niên trong lúc đất nước lâm nguy, do đó Ông cố gắng trau giồi học vấn, đạo đức, và võ thuật đồng thời Ông đưa ra một quan niệm mới hướng dẫn các thanh niên đương thời vào tâm thân cách mạng.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Trong &lt;i&gt;giai đoạn thành lập&lt;/i&gt; (1939-194&lt;b&gt;5)&lt;/b&gt;&lt;br /&gt;\r\n			Cuộc biểu diễn đầu tiên tại nhà Hát Lớn Hà Nội vào mùa thu năm 193&lt;b&gt;9.&lt;/b&gt;&lt;br /&gt;\r\n			( Lớp Vovinam công khai mở cho thanh niên Hà Nội tại &lt;i&gt;Trường Sư Phạm&lt;/i&gt; vào đầu xuân năm 194&lt;b&gt;0. &lt;/b&gt;Và cuộc biểu diễn tại đây đã biểu lộ tinh thần “uy vũ bất năng khuất” của võ sư Nguyễn Lộc.&lt;br /&gt;\r\n			( Phát động phong trào công khai chống Pháp bằng những cuộc đụng độ giữa các sinh viên, viên chức học Vovinam với các sinh viên và viên chức Pháp tại trường Đại học và Sở Canh Nông Hà Nội.&lt;br /&gt;\r\n			&lt;b&gt;C. &lt;/b&gt;Trong &lt;i&gt;giai đoạn trưởng thành&lt;/i&gt; (1945-194&lt;b&gt;6) &lt;/b&gt;môn phái VOVINAM đã:&lt;br /&gt;\r\n			( Hợp tác với chính phủ Trần Trọng Kim và tham gia các tổ chức ái-quốc.&lt;br /&gt;\r\n			( Giữ an ninh cho đồng bào nội thành và ngoại ô thành phố Hà Nội. Tuy tham gia và hoạt động tích cực các công tác ích quốc lợi dân như vậy, Ông vẫn không có tham vọng làm chính trị, mà chỉ đem sở trường đào luyện lớp thanh niên ưu tú làm thành trì cho cách mạng, nên Ông mở rất nhiều lớp ở các nơi như: Trường Bưởi, trường Thăng Long, trường Hổ Vũ và Việt Nam học xá, bãi Nhà đèn, bãi Septo.v.v..&lt;br /&gt;\r\n			&lt;b&gt;D. &lt;/b&gt;&lt;i&gt;Giai doạn phân hóa&lt;/i&gt; (1946-194&lt;b&gt;8)&lt;/b&gt;&lt;br /&gt;\r\n			( Ngày 19-12-1948, cuộc kháng chiến toàn quốc bùng nổ. Cũng như đa số các đoàn thể khác thời ấy, hàng ngũ Vovinam cũng bị phân hóa, do tình thế chiến tranh tạo nên. Lòng dân đang sôi động vì cuộc chiến tranh chống Pháp. Nhân, tài và vật lực của quốc gia giốc cả vào chiến tranh, nên khá đông môn đồ Vovinam đã tham gia cuộc chiến với tất cả lòng hăng say của người thanh niên yêu nước, muốn non sông gấm vóc khỏi rơi vào tay thực dân Pháp một lần nữa, chớ ít quan tâm tới khuynh hướng chính trị.&lt;br /&gt;\r\n			( Trải qua bao đợt phân hóa, Ông đưa vài môn đệ tâm huyết còn lại xuôi Phát Diệm, và tại đây Ông đã mở lớp, cử Môn đệ huấn luyện cho bộ đội Nhà Chung và những lớp cho thanh niên Phát Diệm.&lt;br /&gt;\r\n			&lt;b&gt;E. &lt;/b&gt;&lt;i&gt;Giai đoạn phục hưng&lt;/i&gt; (từ 1948-197&lt;b&gt;5)&lt;/b&gt;&lt;br /&gt;\r\n			( Sau ngày Cách Mạng 1-11-1963, Vovinam được phép công khai mở lại Trung Tâm Huấn Luyện Trung Ương tại đường Vĩnh Viễn Chợ lớn. Sau đó, môn phái Vovinam Việt Võ Đạo còn mở thêm những chi nhánh mới khắp nơi trong Đô Thành SAIGON, tổng số môn sinh càng ngày càng gia tăng nhất là sau ngày Việt Võ Đạo đi vào học đường của Bộ Văn Hóa Giáo Dục, và ngành CSQG rồi các đơn vị Quân Đội, Cán bộ PTNT v.v… Cuối năm 1967, để có thể hoạt động hữu hiệu và rộng rãi hơn, môn phái đã thiết lập 3 cơ cấu tổ chức:&lt;br /&gt;\r\n			– Tổng Hội VOVINAM Việt Võ Đạo.&lt;br /&gt;\r\n			– Tổng Cục Huấn Luyện.&lt;br /&gt;\r\n			– Tổng Đoàn thanh niên Việt Võ Đạo.&lt;/p&gt;\r\n\r\n			&lt;p&gt;Với những cố gắng không ngừng, tổng cục huấn luyện đã thiết lập được bốn cục huấn luyện tại bốn vùng chiến thuật.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 3&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Cố Võ Sư Sáng Tổ có chủ trương cách mạng sắc máu không? Người muốn hướng dẫn thanh niên Việt Nam theo con đường nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Không, vì nhận thấy các cuộc cách mạng sắc máu không thể thành công và nếu gặp thời thuận lợi có thành công cũng không bảo vệ nổi vì thiếu các lớp người có đầy đủ bản lãnh điều hành guồng máy, cai trị và kiến thiết đất nước, do đó Người hướng dẫn thanh niên theo con đường “cách mạng tâm thân” để tạo cái gốc vững chắc cho mọi cách mạng khác (không phủ nhận nguyên lý cách mạng, song ông quan niệm rằng: Muốn đưa cuộc cách mạng dân tộc đến chổ thành tựu, cần phải gây cho thanh niên một ý thức cách mạng, một tinh thần quật cường, một nghị lực quả cảm song song với một thân thể vững chắc đanh thép, mạnh mẽ, dẻo dai có đầy đủ khả năng để tự vệ, làm cách mạng thành công quả là một điều rất khó song bảo vệ được thành quả cách mạng để bước sang giai đoạn kiến thiết lại là một điều khó hơn).&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 4&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Hành động nào đã biểu lộ tinh thần “uy vũ bất năng khuất” của võ sư Sáng Tổ?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Trong buổi biểu diễn võ thuật tại trường Sư Phạm vào mùa thu năm 1940, tinh thần uy vủ bất năng khuất của cố võ sư Sáng Tổ được biểu lộ qua hành động:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;p&gt;&lt;b&gt;A. &lt;/b&gt;&lt;u&gt;Không cho&lt;/u&gt; môn đệ nghiêm lễ ở ngoài sân như thường lệ vì có viên chức Pháp ngồi trên khán đài, mà dẫn các môn đệ vào hậu trường nghiêng mình làm lễ trước bàn thờ Tổ Quốc đã được thiết lập sẵn.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Dám công khai chống đối các hư danh trao tặng huy chương của bọn thực dân thống trị, bằng cách gở bỏ tấm huy chương do Ducoroy gắn tặng vào trong túi trước mặt dân chúng và các đại diện của nền hành chánh bảo hộ.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 5&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Môn Phái Vovinam có làm chính trị không? Vậy môn phái Vovinam có quan điểm như thế nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Môn Phái Vovinam không làm chính trị, quan điểm của môn phái Vovinam rất rõ rệt bao gồm trong hai điểm:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;p&gt;&lt;b&gt;A. &lt;/b&gt;Môn phái Vovinam không phải là một đảng phái chính trị nên không hoạt động chính trị, nhưng không ngăn cấm môn sinh làm chính trị với tư cách công dân của mình.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Mặc dù mục đích của Môn Phái Vovinam chỉ nhắm vào việc xây dựng con người toàn diện trên căn bản võ thuật và tinh thần võ đạo. Nhưng khi thời buổi nước nhà đòi hỏi, môn phái Vovinam sẵn sàng tiếp tay với chính quyền hoặc các đoàn thể khác để thực hiện công cuộc cứu nước và cứu tế xã hội với tinh thần vị tha vô điều kiện. Tuy nhiên sự tiếp tay nầy nếu có, chỉ có nghĩa là môn phái Vovinam đã tích cực và trực tiếp phục vụ công ích cho dân tộc chứ không vì một cá nhân, một đoàn thể nào cả. Và các hoạt động đó chỉ có tính cách nhất thời.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 6&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Lập trường siêu đảng phái của Cố võ sư Sáng Tổ ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Lập trường siêu đảng phái của Cố võ sư Sáng Tổ là: Vượt ra khỏi các khuynh hướng của các đảng phái, đặt quyền lợi của Tổ Quốc lên trên hết, chỉ giúp ích cho dân tộc, đồng bào. Không đòi hỏi quyền lợi riêng tư cho cá nhân hay đoàn thể. Nói cách khác là môn phái Vovinam &lt;b&gt;&lt;u&gt;có thể hợp tác&lt;/u&gt;&lt;/b&gt; với các đảng phái chính trị ái quốc thực hiện những công cuộc ích quốc lợi dân. Nhưng &lt;b&gt;&lt;u&gt;không bao giờ dành ghế hoặc củng cố&lt;/u&gt;&lt;/b&gt; chính quyền cho họ.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 7&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Môn đồ Vovinam tham gia cuộc kháng chiến toàn quốc năm 1946 có phải vì tham vọng chính trị không? Vì sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Năm 1946, chiến tranh Việt Pháp bùng nổ. Môn đồ Vovinam than gia cuộc kháng chiến toàn quốc, không phải vì tham vọng chính trị mà là vì lòng yêu nước nhiệt thành của người thanh niên không muốn đất nước một lần nữa rơi vào tay thực dân thống trị.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 8&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tiêu chuẩn nào được nêu lên làm kim chỉ nam trong việc phục hưng Môn Phái?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Trong các cuộc thăng trầm vì thời cuộc, ý thức được hoàn cảnh cũng như ước vọng của vị Sáng Tổ nêu lên tiêu chuẩn làm kim chỉ nam trong việc phục hưng Môn Phái là Vovinam &lt;strong&gt;không hoạt động sôi nổi mãnh liệt&lt;/strong&gt; như thời toàn dân thức tĩnh vùng lên chống Pháp mà phải hoạt động theo từng nhịp bước vững chắc với sự chịu đựng bền bỉ để tiến tới việc xây dựng nền móng Việt Võ Đạo theo ước muốn của Cố Võ Sư Sáng Tổ.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h5&gt;Tác phong của Việt Võ Đạo Sinh&lt;/h5&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 9&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tại sao VVĐS phải giữ gìn tác phong ở mọi nơi, trong mọi trường hợp?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Việt Võ Đạo Sinh phải gìn giữ tác phong ở mọi nơi, trong mọi trượng hợp là vì mọi người thường nhìn vào tác phong của VVĐS để phán đoán và đánh giá phẩm cách của họ cùng danh dự môn phái.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 10&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Có mấy điều xấu cần tránh? Có mấy điều tốt nên làm? Hãy kể ra.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Có 5 điều xấu cần tránh là:&lt;br /&gt;\r\n			&lt;b&gt;A. &lt;/b&gt;Tránh huênh hoang, tự đắc rằng mình là người “có võ” ở giữa đám đông người.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Tránh dèm pha thanh danh các võ phái khác.&lt;br /&gt;\r\n			&lt;b&gt;C. &lt;/b&gt;Tránh mọi hành động khiêu khích, để người ngoài có thể hiểu lầm rằng môn phái ta chỉ cốt huấn luyện võ sinh đi gây chuyện với thiên hạ.&lt;br /&gt;\r\n			&lt;b&gt;D. &lt;/b&gt;Tránh mọi đụng độ vô lý, chỉ cốt “lấy le” với thiên hạ trong một lúc.&lt;br /&gt;\r\n			&lt;b&gt;E. &lt;/b&gt;Tránh tinh thần quốc gia quá khích, bài xích các môn võ nước ngoài du nhập, dù người đối thoại là bạn thân hay người nhà.Có 5 điều tốt nên làm là:&lt;br /&gt;\r\n			&lt;b&gt;A. &lt;/b&gt;Thực tập tinh thần Việt Võ Đạo trong đời sống, để được mọi người mến phục.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Gây tình cảm thân hậu với các môn phái khác, để họ hiểu ta, quý mến ta, sẵn sàng hợp tác với môn phái ta, trong việc phát triển võ đạo và võ thuật.&lt;br /&gt;\r\n			&lt;b&gt;C. &lt;/b&gt;Thấy việc phải làm ngay, không chờ người nhắc nhở.&lt;br /&gt;\r\n			&lt;b&gt;D. &lt;/b&gt;Dám lãnh trách nhiệm, tận tâm giúp để người, không so bì hơn thiệt.&lt;br /&gt;\r\n			&lt;b&gt;E. &lt;/b&gt;Ôn luyện, học hỏi không ngưng để tiến bộ.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 11&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Hãy kể những đồng điểm và dị điểm giữa tác phong VVĐS và tác phong của người công nhân?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Đồng điểm – Cùng chung mục đích phục vụ dân tộc và đồng bào. Dị điểm – người công nhân có thể chỉ biết tới dân tộc và đồng bào họ, nhưng Việt Võ Đạo Sinh, ngoài nghĩa vụ đối với dân tộc và đồng bào, còn có nghĩa vụ đối với môn phái và nhân loại.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 12&lt;/td&gt;\r\n			&lt;td&gt;&lt;strong&gt;Khi học tập, Việt Võ Đạo Sinh phải có tác phong nào?&lt;/strong&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Có 3 phương châm cần phải ghi nhớ khi học tập, là: Kỷ luật, kính thầy, yêu bạn.&lt;br /&gt;\r\n			&lt;b&gt;A. &lt;/b&gt;Kỷ luật: Trọng kỷ luật võ đường; tại võ đường, từ lúc đến phòng tập, thay võ phục, học võ và thụ huấn tinh thần võ đạo, phải tự chứng tỏ là lúc nào cũng tôn trọng kỷ luật chung.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Kính thầy: Lúc tới và sau buổi học võ phải chào võ sư và huấn luyện viên theo nghi thức Việt Võ Đạo. Trong buổi học, châm chú theo dõi, không làm ồn để tâm trí tản mát. Tuyệt đối tuân theo lệch của võ sư và huấn luyện viên.&lt;br /&gt;\r\n			&lt;b&gt;C. &lt;/b&gt;Yêu bạn: Luôn luôn vui vẽ, hòa nhả với các bạn đồng lớp. Nếu bạn yếu kém, phải nương tay, chỉ dẫn, khuyến khích bạn. Khi bạn bị té đau, phải đỡ dậy săn sóc. Gặp trường hợp bị bạn lỡ tay đánh quá mạnh, cũng không giận dữ, cáu kỉnh. Tuyệt đối tránh những ý nghĩ thù hận, đố kỵ. Khi thụ huấn về tinh thần võ đạo, luôn luôn giúp đỡ bạn và học hỏi ở bạn. Tránh tranh luận ồn ào, cướp lời bạn một cách lổ mảng.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 13&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Trong gia đình, Việt Võ Đạo Sinh phải cư xử thế nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Trong gia đình Việt Võ Đạo Sinh phải kính mến người trên, yêu mến người ngang hàng, thương mến người dưới.&lt;br /&gt;\r\n			&lt;b&gt;A. &lt;/b&gt;Đối với người trên là: Ông bà, cha mẹ, chú, bác, cô, dì, cậu mợ, ta phải lễ độ và dâng theo lời dạy bảo.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Đối với người ngang hàng là: Anh chị em trong nhà, ta phải chí tình, luôn luôn vui vẽ, hòa thuận.&lt;br /&gt;\r\n			&lt;b&gt;C. &lt;/b&gt;Đối với người dưới là: Con cháu, người làm phải rộng lượng, tận tâm chỉ bảo với thái độ ôn tồn, hòa nhả.Tuyệt đối tránh sự dùng võ khi trong gia đình không may có chuyện bất hòa, vì đó chẳng những là một thái độ vô ý thức mà còn gây sự hiểu lầm về việc giáo dục tinh thần của môn phái ta.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 14&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tác phong của Việt Võ Đạo Sinh khi làm việc ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Khi làm việc, VVĐS phải ghi nhớ tác phong &lt;b&gt;“con nhà võ”&lt;/b&gt; với tinh thần Việt Võ Đạo: Thận trọng nhưng mau lẹ. Muốn thế, phải tập phân biệt các giai đoạn của sự việc. Lúc tính việc, lúc vào việc, lúc xong việc.&lt;br /&gt;\r\n			&lt;b&gt;1. &lt;/b&gt;Lúc tính việc phải có tinh thần thực tiễn, bắt lấy những sự kiện, không suy luận mò mẫm, dám mạo hiểm xung phong với lòng nhiệt thành và tâm hồn chí công vô tư.&lt;br /&gt;\r\n			&lt;b&gt;2. &lt;/b&gt;Lúc vào việc đã quyết định rồi, là làm ngay. Tháo vác, kiên nhẫn và can đảm, không chiếm việc, tranh công, anh hùng cá nhân chủ nghĩa. Không đòi hỏi, mặc cả, tự coi mình là thứ nhân công trước chủ nhân.&lt;br /&gt;\r\n			&lt;b&gt;3. &lt;/b&gt;Lúc xong việc, phải kiểm điểm lại từng phần vụ:&lt;br /&gt;\r\n			&lt;b&gt;A. &lt;/b&gt;Tự kiểm mình trước để biết cái tốt, xấu, đúng, sai hầu rút kinh nghiệm.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Kiểm người để nhận biết những ưu khuyết điểm.&lt;br /&gt;\r\n			&lt;b&gt;C. &lt;/b&gt;Kiểm việc để biết đâu là ưu điểm mà ta phát huy thêm, đâu là nhược điểm, khuyết điểm để khắc phục, bồi đắp. Hầu hoạch định và cải tiến công việc sẽ tới, phải làm thế nào cho có kết quả hơn.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 15&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Khi biểu diễn võ thuật VVĐS phải chuẩn bị tinh thần và cách thể hiện ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Khi biểu diễn&lt;/b&gt; võ thuật VVĐS phải chuẩn bị: &lt;b&gt;Về tinh thần&lt;/b&gt;, chỉ khi nào có sự cắt cử của môn phái. &lt;b&gt;Khi biểu diễn&lt;/b&gt;, trước hết phải nghĩ đến danh dự môn phái, để hết tinh thần vào cuộc biểu diễn, để truyền vào cảm quan khán giả những đòn thế tinh luyện với sự diễn tả tận tình, hăng say nhưng nhu nhã, dữ dội mãnh liệt, mà vẫn uyễn chuyển, nhịp nhàng. Phải giữ được sự huyền nhiệm và biểu dương được những nét độc đáo, đặc sắc về võ thuật và tinh thần võ đạo. Về cách thể hiện, phải trang, tề, đạm, lễ, kỷ.&lt;br /&gt;\r\n			Trang         – Võ phục trang nhả, gọn gàng.&lt;br /&gt;\r\n			Đạm         – Sắc diện điềm đạm, vui vẽ.&lt;br /&gt;\r\n			Tề         – Cử chỉ tề chỉnh, đàng hoàng.&lt;br /&gt;\r\n			Lễ         – Nói chuyện lễ độ, khiêm nhường.&lt;br /&gt;\r\n			Kỷ         – Triệt để tuân hành kỷ luật cuộc biểu diễn do người điều khiển đề ra.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 16&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Khi giao tiếp với mọi người VVĐS phải có tác phong nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Khi giao tiếp với mọi người, Việt Võ Đạo Sinh phải có thái độ, cách đối thoại, cử chỉ xứng đáng với tinh thần Việt Võ Đạo.\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;p&gt;&lt;b&gt;A. &lt;/b&gt;Về thái độ phải ôn tồn, lễ độ. Nhưng không do dự, sợ thảo luận, ta phải cởi mở nhưng không bạ đâu nói đó, tiết lộ chuyện nội bộ của môn phái cho người ngoài hay. Niềm nở nhưng không nịnh bợ, cầu cạnh, suồng sả. Khiêm nhường nhưng không quì lụy, khúm núm.&lt;br /&gt;\r\n			&lt;b&gt;B. &lt;/b&gt;Về cách đối thoại phải điều hòa được tình cảm của mình, đừng nóng nảy hay thờ ơ. Phải hiểu rõ tâm lý và hoàn cảnh của người nghe chuyện, trình bày câu chuyện rõ ràng, biết cách minh chứng và đối lý để thuyết phục người đối thoại.&lt;br /&gt;\r\n			&lt;b&gt;C. &lt;/b&gt;        Về cử chỉ phải thẳng thắn và chững chạc, biết làm dịu tình hình bằng phong thái uy nghi, hòa dịu, biết ứng biến trước nghịch cảnh bất ngờ.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 17&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Khi tham gia công tác xã hội VVĐS phải có tác phong nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Việt Võ Đạo Sinh phải có tinh thần vị tha vô điều kiện và tuyệt đối tránh việc kể ơn hay có những thái độ, ngôn ngữ, cử chỉ có thể làm người mang ơn ta, tủi thân hoặc hiểu lầm những việc làm tốt đẹp của ta. Khi tiếp xúc hay giúp đỡ họ, ta phải khéo léo giữ gìn ý tứ hòa nhã và lễ độ. Có thế hoạt động xã hội của ta mới có ý nghĩa và làm sáng danh môn phái.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 18&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Trong những buổi sinh hoạt môn phái VVĐS phải có tác phong nào?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Trong những buổi sinh hoạt môn phái, Việt Võ Đạo Sinh phải có tác phong: Thân ái, hồn nhiên, cởi mở và bao dung. Vì buổi sinh hoạt môn phái lá dịp để các võ sinh đồng môn có dịp tìm hiểu lẫn nhau từ tâm sự, hoàn cảnh tới tài năng chí hướng của nhau. Cởi mở vì buổi sinh hoạt nầy có mục đích tạo niềm thông cảm, sự hòa dịu tình cảm của các võ sinh để tình đồng đạo mỗi ngày thêm bền vững. Hồn nhiên vì buổi sinh hoạt nội bộ có tính cách gia đình để mọi người có thể phát huy những cá tính đặc biệt của mình, hồn nhiên nhưng không bừa bải quá trớn. &lt;b&gt;Bao dung&lt;/b&gt; vì không khí trong buổi sinh hoạt nội bộ là cơ hội để cho võ sinh có thể tương trợ nhau, thanh toán những hiểu lầm ngộ nhận. Vì vậy khi ta có những kinh nghiệm gì quý báu, ta nên đem ra phổ biến để mọi người lãnh hưởng. Ngược lại khi đồng đạo có gì lầm lỗi, ta tha thứ. Khi đồng đạo thi triển tài năng, ta nên khuyến khích cổ vũ để tăng nhuệ khí của bạn.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n	&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;a id=&quot;ly-thuyet-hoang-dai&quot;&gt;&lt;/a&gt;Thi lên Chuẩn Hoàng Đai (Huyền Đai)&lt;/h3&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;h5&gt;&lt;b&gt;Ý Nghĩa 10 Điều Tâm Niệm Của Việt Võ Đạo Sinh&lt;/b&gt;&lt;/h5&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n\r\n&lt;table&gt;\r\n	&lt;tbody&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 1&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Ý nghĩa điều tâm niệm thứ nhất của Việt Võ Đạo Sinh (VVĐS) ra sao? Hãy giải thích đại cương.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Điều tâm niệm thứ thất nói về hoài bảo và mục đích của VVĐ&lt;b&gt;S. &lt;/b&gt;Mang hoài bão đạt tới cao độ của nghệ thuật với mục đích phục dân tộc và nhân loại.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 2&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tại sao không mang hoài bão lớn lao mà nguyện đạt tới tuyệt độ của nghệ thuật?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;VVĐS không mang hoài bão lớn lao nguyện đạt tới tuyệt độ của nghệ thuật vì nghệ thuật thì không cùng, mà VVĐS chỉ hoài bão những gì hợp tình và hợp lý có thể thực hiện được chứ không cuồng vọng, không tưởng.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 3&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Những người giỏi võ quan niệm về sự học võ ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Những người giỏi võ quan niệm học võ để trau dồi về cả tinh thần thượng võ và ý thức hệ võ đạo. Do đó họ luôn luôn bình tĩnh để giải quyết sự việc, họ không có mặc cảm tự ti là bị người coi thường, họ rất ghét sự gây gổ và có sự chịu đựng hơn người.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 4&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Ý nghĩa điều tâm niệm thứ 2 ra sao? Hãy giải thích đại cương.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Điều tâm niệm thứ 2 nói về nghĩa vụ của VVĐS đối với Môn Phái và Dân Tộc. Đối với môn phái, VVĐS phải trung kiên phái huy môn phái. Đối với dân tộc, VVĐS phải xây dựng một thế hệ thanh niên Việt Võ Đạo (VVĐ).&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 5&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Quan niệm về Trung Kiên của VVĐS ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Trung kiên là trung kiên phát huy môn phái chứ không phải trung kiên riêng với cá nhân nào. Tuy nhiên, nếu có một cá nhân chấp chưởng công việc phát huy môn phái, thì VVĐS có nghĩa vụ là phải tiếp tay góp sức.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 6&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Muốn phát huy môn phái VVĐS phải làm gì? Có mấy cách phát huy môn phái?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Muốn phát huy môn phái, VVĐS phải:&lt;br /&gt;\r\n			– Dày công khổ luyện để trở thành Huấn Luyện Viên hay Võ Sư để trực tiếp truyền võ thuật và võ đạo cho quần chúng.&lt;br /&gt;\r\n			– Thực tập tinh thần Việt Võ Đạo trong đời sống. Nghĩa là ở trong gia-đình thì phải cha từ, con hiếu, anh hiền, em thảo, với bạn bè phải giữ tín nghĩa, với hàng xóm phải luôn luôn tìm dịp giao hòa giúp đỡ.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 7&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tạo sao nghĩa vụ của VVĐS đối dân tộc là “xây dựng thế hệ thanh niên Việt Võ Đạo”?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Đối với dân tộc VVĐS phải xây dựng thế hệ thanh niên VVĐ vì thế hệ thanh niên VVĐ bao giờ cũng là bức tường thành kiên cố để bảo vệ đất nước và xây dựng tương lai. Chính tinh thần võ đạo đã khơi mở tấm lòng yêu nước và làm cho dân tộc trường tồn mãi mãi.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 8&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Ý nghĩa điều tâm niệm thứ 3 ra sao? Hãy giải thích đại cương.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Điều tâm niệm thứ 3 nói về tinh thần đoàn kết trong môn phái. Muốn có tình đoàn kết VVĐS đồng tâm nhất trí đối với người trên phải tôn kính, đối với tình đồng đạo phải thành thật thương mến nhau.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 9&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Tại sao tình đoàn kết lại được đề cập trước nhất trong một đoàn thể?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Tình đoàn kết lại được đề cập trước nhất trong một đoàn thể vì nó là một yếu tố quan trọng để quyết định sự hùng mạnh hoặc tan rã của một đoàn thể.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 10&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Muốn phát huy tình đoàn kết trong môn phái VVĐS phải làm gì?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Muốn phát huy tình đoàn kết trong môn phái VVĐS phải dẹp bỏ mọi mặc cảm, thành kiến, tiêu trừ mọi tự ái sai lầm, mọi ý nghĩ cá nhân riêng rẽ, không bao giờ có sự thù hận với đồng môn, nếu có những thắc mắc phải giải quyết ngay với ý tưởng xây dựng.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 11&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Ý nghĩa điều tâm niệm thứ 4 ra sao? Hãy giải thích đại cương.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Điều tâm niệm thứ 4 nói về võ kỷ và danh dự võ sĩ. VVĐS phải tuyệt đối tôn trọng kỷ luật môn phái và luôn luôn nêu cao danh dự võ sĩ.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 12&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Có mấy thứ kỷ luật? Sự khác biệt giữa kỷ luật của Vovinam Việt Võ Đạo (VVN-VVĐ) với kỷ luật của Quân Đội và các Đảng Phái bí mật ra sao?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Có 3 loại kỷ luật:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;p&gt;– Kỷ luật tự giác: Tự mình tìm hiểu lấy trong gương người và bắt chước.&lt;br /&gt;\r\n			– Kỷ luật sắt: Áp dụng trong quân đội, thi hành trước khiếu nại sau.&lt;br /&gt;\r\n			– Kỷ luật máu: Các đảng phái bí mật thì thanh toán, khi một đảng viên nào vi phạm điều lệ đảng hoặc sai lệch trong việc thi hành công tác.&lt;/p&gt;\r\n\r\n			&lt;p&gt;Kỷ luật của VVN-VVĐ là kỷ luật tự giác, nghĩa là người trên bảo người dưới làm gương thì người dưới phải làm gương tuy nhiên khi đã thấy sự gương mẫu của người trên rồi mà người dưới không tuân theo thì phải bị trừng phạt hoặc đào thải.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 13&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Thế nào là “anh hùng cá nhân”?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Anh hùng cá nhân là người có tài nhưng vô kỷ luật, vô trật tự, không bao giờ chịu khép mình trong khuôn khổ, làm việc một cách tùy hứng vì không có chí hướng nhất định.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 14&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Danh dự võ sĩ là gì?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Danh dự võ sĩ là danh dự chung của tập thể một thứ bênh người yếu chống kẻ mạnh, một thứ danh dự vượt lên trên khỏi tự ái cá nhân để hòa mình vào võ đạo.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 15&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Ý nghĩa điều tâm niệm thứ 5 ra sao? Hãy giải thích đại cương.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Điều tâm niệm thứ 5 nói về ý thức dụng võ của VVĐ&lt;b&gt;S. &lt;/b&gt;VVĐS luôn luôn tôn trọng các võ phái khác, chỉ dụng võ để tự vệ và bênh vực lẽ phải.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 16&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Nếu võ phái khác có một phần tử hư hỏng, chúng ta có quan niệm nào khi bắt buộc phải trừng trị?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Khi bắt buộc phải trừng trị một phần tử hư hỏng của võ phái khác, VVĐS chỉ coi đó là một việc làm bất đắc dĩ để khuyến thiện một vài cá nhân hư hỏng nhưng không vơ đũa cả nắm và không bao giờ có ý định xúc phạm tới toàn thể võ phái họ.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 17&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Ý nghĩa điều tâm niệm thứ 6 là gì? Hãy giải thích đại cương.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Điều tâm niệm thứ 6 nói về ý hướng học tập và đời sống tinh thần của VVĐ&lt;b&gt;S. &lt;/b&gt;VVĐS phải chuyên cần học tập, rèn luyện tinh thần và trau dồi đạo hạnh tức phẩm hạnh VVĐ.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 18&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Thế nào là chuyên cần?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;– Chuyên: Chuyên chú tập trung tâm trí vào một việc, một sự nghiệp.&lt;br /&gt;\r\n			– Cần: Cần mẫn lo và làm hết sức mình không quản khó nhọc.&lt;br /&gt;\r\n			– Chuyên cần: Tập trung tâm trí để vào một việc và ráng làm hết sức không nề hà khó nhọc gian khổ.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 19&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Muốn học tập Chuyên Cần, VVĐS phải thực hiện mấy điểm căn bản? Đó là những điểm gì?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Muốn chuyên cần học tập, VVĐS phải thực hiện 5 điểm căn bản là:&lt;br /&gt;\r\n			&lt;b&gt;1) &lt;/b&gt;Học cho rộng (võ thuật lẫn võ đạo, lý thuyết lẫn thực hành)&lt;br /&gt;\r\n			&lt;b&gt;2) &lt;/b&gt;Hỏi cho kỹ (chừng nào hiểu thì thôi, tránh tự ái chán nản)&lt;br /&gt;\r\n			&lt;b&gt;3) &lt;/b&gt;Nghĩ cẩn thận (nghiền ngẫm những điều đã học và làm)&lt;br /&gt;\r\n			&lt;b&gt;4) &lt;/b&gt;Luận cho sáng (so sánh, phân tích, tổng hợp, biện luận và phản luận)&lt;br /&gt;\r\n			&lt;b&gt;5) &lt;/b&gt;Làm hết sức (cố gắng thực tập võ thuật, ham hoạt động, nhiệt thành, phấn khởi)&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 20&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Rèn luyện tinh thần có mấy đức tính? Hãy kể ra và giải thích đại cương.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Muốn rèn luyện tinh thần VVĐS phải rèn luyện 5 đức tính:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;p&gt;&lt;b&gt;1) &lt;/b&gt;Sống khỏe: Về cả tinh thần lẫn vật chất.&lt;br /&gt;\r\n			&lt;b&gt;2) &lt;/b&gt;Đức độ: Luôn luôn bao dung, điều hòa, khắc chế mình và tha nhân để cùng tiến bộ.&lt;br /&gt;\r\n			&lt;b&gt;3) &lt;/b&gt;Cương trực: Cương quyết và thẳng thắn.&lt;br /&gt;\r\n			&lt;b&gt;4) &lt;/b&gt;Trần tĩnh: Chìm lắng và bình tĩnh để tránh những trường hợp sôi-nổi, nóng-nảy và vội-vàng.&lt;br /&gt;\r\n			&lt;b&gt;5) &lt;/b&gt;Tháo vát: Lanh lợi, quyền biến để có thể ứng phó được với mọi hoàn cảnh, mọi trường hợp bất ngờ.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 21&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Đạo hạnh là gì? Tại sao VVĐS phải trau giồi đạo hạnh?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Đạo hạnh là 2 tiếng gọi tắt của 5 chữ: Phẩm Hạnh Việt Võ Đạo. VVĐS phải trau giồi đạo hạnh vì đó là phẩm hạnh căn bản đầu mối của mọi đức tính, nó vô cùng quan trọng cho sự rèn luyện tâm thân trong cả đời công cũng như trong đời tư, vừa phù hợp với võ đạo và võ thuật, vừa thích ứng được với mọi hoàn cảnh.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 22&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Ý nghĩa điều tâm niệm thứ 7 ra sao? Hãy giải thích đại cương.&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Điều tâm niệm thứ 7 nói về tâm niệm sống của VVĐS là sống trong sạch, giản dị, trung và cao thượng.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 23&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Quan niệm về đức tính Trong Sạch của VVĐS ra sao? Có hoàn toàn giống với quan niệm của các vị tu sĩ không?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Quan niệm của đức tính Sống Trong Sạch của VVĐS là: giữ mình cho trong sạch nhưng không tiêu cực, bưng tai bịt mắt trước mọi tội lỗi của xã hội mà trái lại phải lắng tai, phải nhìn thẳng vào mọi việc, mọi xấu xa của đời sống để tìm hiểu, giải quyết và cải thiện nó. Quan niệm sống trong sạch của VVĐS rất tích cực, ngang nhiên và linh hoạt, hoàn toàn khác với quan niệm sống của các vị tu sĩ là tiêu cực, chìm lắng vào nội tâm (mắt không nhìn những gì ô uế, tai không nghe những lời tà mị, óc không nghĩ những gì vấy đục để ngăn chặn những hành động xấu xa ngay từ gốc rễ).&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 24&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Hãy phân tích sự khác biệt giữa đức tính Giản Dị của VVĐS với đức tính Giản Dị của các vị tu sĩ?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Sự khác biệt giữa đức tính Giản Dị của VVĐS và các vị tu sĩ:\r\n			&lt;p&gt; &lt;/p&gt;\r\n\r\n			&lt;p&gt;&lt;b&gt;1) &lt;/b&gt;Giản Dị của các tu sĩ: ăn ở trang phục đều nghiêm trang, đơn sơ, đạm bạc mặc dù nhiều khi họ có đủ điều kiện để hưởng những tiện nghi hoa mỹ.&lt;br /&gt;\r\n			&lt;b&gt;2) &lt;/b&gt;Giản Dị của VVĐS: có điều kiện thì hưởng những tiện nghi hoa mỹ, không thì thôi, không hạch sách, đòi hỏi, gây phiền toái, gây khó chịu cho mọi người.&lt;/p&gt;\r\n			&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 25&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Quan niệm về Trung Thực của VVĐS ra sao? VVĐS trung thực với ai? Trung thực thế nào? Có thể là không được biết tới sự gian trá và hứng chịu mọi âm mưu, thủ đoạn của người không?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;VVĐS trung thực với môn phái, với người trên, và với tất cả mọi người. Nhưng trung thực không có nghĩa là không biết tới sự gian trá, nhưng tự thắng mình để không nhiểm tính gian trá, đó mới là phẩm cách của VVĐS&lt;b&gt;. &lt;/b&gt;Đối với người ngoài, trung thực cũng không có nghĩa là ngây thơ, đần độn, để hứng chịu mọi âm mưu lừa đảo và khuynh đảo. Trong những trường hợp cần thiết, người trung thực phải chứng tỏ cho kẻ gian trá hiểu rằng lối sống và những thủ đoạn gian trá của họ không thể thành công. Đó là đức tính trung thực của VVĐS.&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Câu Hỏi 26&lt;/td&gt;\r\n			&lt;td&gt;&lt;b&gt;Thế nào là đức tính cao thượng? Thái độ bất chợt nhường-nhịn, tha thứ cho người trong một lúc có phải là cao thượng không?&lt;/b&gt;&lt;/td&gt;\r\n		&lt;/tr&gt;\r\n		&lt;tr&gt;\r\n			&lt;td&gt;Đáp:&lt;/td&gt;\r\n			&lt;td&gt;Cao thượng là công phu hàm dưỡng lâu dài để ứng dụng trong những trường hợp đặc biệt (thí dụ như bị người làm nhục, đến khi có thể trả thù được nhưng không làm, vì người thành thật hối cải). Thái độ bất chợt nhường nhịn, tha thứ chỉ là tính khí bốc đồng nhưng không định hướng chớ không thể nào cao ', '', 'Câu Hỏi Khảo Hạch Thi Lên Đai', '', 'Câu Hỏi Khảo Hạch Thi Lên Đai', '', '', '', '', '', '', '', '', 1, 1, 'tin-tuc', 1712986637, 0, 17, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '', '', '', '', 0, 0);
