(14, 0, 0, 0, 'chieu-sinh-6853.png', '', '', '', '&lt;p&gt;&quot;PHÁT TRIỂN THÂN TÂM TUỆ&quot;&lt;/p&gt;\r\n', '', 'CLB VOVINAM TIN - VÕ TAM BÌNH', '', '', '', 'http://tambinh.websinhvien.net/account/dang-ky-khoa-hoc', 'http://tambinh.websinhvien.net/account/dang-ky-khoa-hoc', '', '', '', '', '', '', '', '', '', '', 'slide', 'photo_multi', 1, 1, 0, 0),
(13, 0, 0, 1, '', '', '', '', '', '', 'Hướng dẫn sử dụng', '', '', '', '', NULL, 'https://www.youtube.com/watch?v=oKXkXCgICvc', '', '', '', '', '', '', '', '', '', 'video', 'photo_multi', 1, 1, 0, 0),
(16, 0, 0, 0, 'logo-hoadon-fascon-4602.png', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '{\"watermark\":{\"position\":\"9\",\"per\":\"\",\"small_per\":\"\",\"max\":\"\",\"min\":\"\"}}', 'watermark', 'photo_static', 0, 1, 1634729764, 1634729779),
(17, 0, 0, 0, '17298b5d289dfcc3a58c-8182.jpg', '', '', '', '&lt;p&gt;&lt;b&gt;Học vấn: &lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Cử nhân Kiến Trúc Đại Học Kiến Trúc TP.HCM&lt;/p&gt;\r\n\r\n&lt;p&gt;HLV Vovinam. Giáo viên dạy vẽ luyện thi Kiến Trúc - Mỹ Thuật.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;b&gt;Phong cách/Phương pháp giảng dạy: &lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Đơn giản và logic hoá các bước để dễ dàng truyền tải và hướng dẫn cho học viên, phù hợp với nhiều đối tượng người học khác nhau. Đồng thời khuyến khích sức sáng tạo và tận hưởng niềm vui vẽ tranh&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;b&gt;Chia sẻ câu chuyện bản thân: &lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Việc thực hành nghệ thuật đem lại cho bản thân mình nhiều cảm xúc hơn hết thảy những công việc khác. Từ niềm vui khi được tạo ra cái đẹp, hoặc đôi khi là nỗi thất vọng vì những tác phẩm còn dang dở, thất bại hay còn chưa hoàn hảo. &lt;/p&gt;\r\n\r\n&lt;p&gt;Và khi đi dạy, chứng kiến những kiến thức của bản thân cũng góp phần truyền tải niềm vui vẽ tranh cho người khác khiến mình thêm tự hào và tự tin vào lẽ sống của bản thân.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n', '', 'Linh Nguyễn', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', 'mentors', 'photo_multi', 1, 0, 0, 0),
(18, 0, 0, 0, 'robert-kiyosaki-44740.jpeg', '', '', '', '', '', 'Robert Kiyosaki', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', 'mentors', 'photo_multi', 2, 0, 0, 0),
