INSERT INTO `table_static` (`id`, `photo`, `options`, `link`, `tenkhongdauvi`, `tenkhongdauen`, `noidungen`, `noidungvi`, `motaen`, `motavi`, `tenen`, `tenvi`, `tenko`, `motako`, `noidungko`, `link_video`, `taptin`, `type`, `ngaytao`, `ngaysua`, `hienthi`) VALUES
(1, 'screenshot1621050568-6820.png', '{\"p\":\"screenshot1621050568-6820.png\",\"w\":564,\"h\":328,\"m\":\"image\\/png\"}', '', 'sbi-nang-tam-thinh-vuong-tai-chinh', 'sos-vienam', '&lt;p&gt;sos vienamsos vienamsos vienamsos vienamsos vienam&lt;/p&gt;\r\n', '&lt;p&gt;&lt;strong&gt;Màn trình diễn đỉnh cao trong bất kỳ tình huống nào&lt;/strong&gt;&lt;br /&gt;\r\n&lt;strong&gt;Thay đổi tình hình hiện tại. Thay đổi hành vi. Đạt kết quả chưa từng có&lt;/strong&gt;&lt;br /&gt;\r\n&lt;strong&gt;Người biến đổi&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Trong suốt gần 3 thập kỷ, Blair Singer đã truyền sức mạnh cho hàng ngàn người trên toàn thế giới, giúp đỡ họ vượt qua chính mình và đạt được thành công tột đỉnh. Những đóng góp lớn lao này đã đưa danh tiếng của ông lên tầm thế giới và được biết đến là chuyên gia trong lĩnh vực bán hàng, kinh doanh và phát triển cá nhân.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Diễn giả, nhà đào tạo và nhà điều phối bậc thầy&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Là một diễn giả tràn đầy năng lượng và theo nhu cầu của công chúng, Blair Singer sở hữu khả năng đặc biệt có thể giúp nhiều người và doanh nghiệp thay đổi tình hình hiện tại, thay đổi hành vi và đạt kết quả chưa từng có. Khách hàng của ông đến từ 25 quốc gia, 5 châu lục và từ những doanh nghiệp lớn nằm trong danh sách 500 doanh nghiệp giàu có nhất thế giới như Singapore Airlines, Deutsche Bank, Redken, HSBC, IBM, City Group, UPS Stores, Mrs. Fields Cookies, Dunkin’ Donuts, United Healthcare và Westin Hotel tới những chủ doanh nghiệp nhỏ, doanh nhân, đội nhóm bán hàng và những người bình thường. Ông áp dụng những quy tắc phù hợp với những doanh nghiệp lớn cho việc kinh doanh thường ngày để giúp những người khát khao thành công.&lt;/p&gt;\r\n\r\n&lt;figure&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; height=&quot;473&quot; sizes=&quot;(max-width: 472px) 100vw, 472px&quot; src=&quot;https://bstacademy.vn/wp-content/uploads/2018/03/blair-singer.png&quot; srcset=&quot;https://bstacademy.vn/wp-content/uploads/2018/03/blair-singer.png 472w, https://bstacademy.vn/wp-content/uploads/2018/03/blair-singer-150x150.png 150w, https://bstacademy.vn/wp-content/uploads/2018/03/blair-singer-300x300.png 300w, https://bstacademy.vn/wp-content/uploads/2018/03/blair-singer-460x460.png 460w, https://bstacademy.vn/wp-content/uploads/2018/03/blair-singer-64x64.png 64w, https://bstacademy.vn/wp-content/uploads/2018/03/blair-singer-100x100.png 100w&quot; width=&quot;472&quot; /&gt;&lt;/p&gt;\r\n&lt;/figure&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Vua Bán Hàng, Diễn Giả Quốc Tế&lt;/strong&gt;&lt;br /&gt;\r\n&lt;strong&gt;Blair Singer&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Tác giả sách bán chạy nhất&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Singer là cố vấn cấp cao của bộ sách “Cha giàu” được viết bởi Robert Kiyosaki và là tác giả của ba cuốn sách bán chạy nhất: Salesdogs – Những chú chó bán hàng, You don’t have to be an Attack dog to be successful in sales – Bạn không cần trở thành chú chó ưa thích tấn công để trở nên thành công trong bán hàng, Team Code of Honor – Quy tắc danh dự đội nhóm và cuốn sách gần đây nhất của ông Little Voice Mastery: How to win the war between your ears in 30 seconds or less and have an extraordinary life! – Làm chủ giọng nói trong đầu: Làm thế nào để chiến thắng trận chiến giữa 2 tai trong vòng 30 phút hoặc ít hơn và tận hưởng cuộc sống tuyệt vời! Trong cuốn sách này, Blair tiết lộ cách bạn lấy ra những phiền toái trong cơ thể để biến chúng thành năng lượng tiềm năng. Trong khi bạn muốn tăng doanh thu bán hàng, tìm kiếm tình yêu đích thực hay để có một cơ thể cường tráng hơn, Singer có 21 kỹ thuật đã được chứng minh có thể tái lập trình giọng nói nhỏ để bạn có thể vượt qua rào cản bản thân và làm việc hiệu quả hơn.&lt;/p&gt;\r\n\r\n&lt;figure&gt;\r\n&lt;p&gt;&lt;img alt=&quot;&quot; height=&quot;300&quot; sizes=&quot;(max-width: 600px) 100vw, 600px&quot; src=&quot;https://bstacademy.vn/wp-content/uploads/2018/03/sale-dogs-nhung-chu-cho-ban-hang-blair-singer-01.jpg&quot; srcset=&quot;https://bstacademy.vn/wp-content/uploads/2018/03/sale-dogs-nhung-chu-cho-ban-hang-blair-singer-01.jpg 600w, https://bstacademy.vn/wp-content/uploads/2018/03/sale-dogs-nhung-chu-cho-ban-hang-blair-singer-01-300x150.jpg 300w&quot; width=&quot;600&quot; /&gt;&lt;/p&gt;\r\n&lt;/figure&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;strong&gt;Bạn muốn tăng doanh thu bán hàng và thu nhập ngay lập tức?&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Bạn muốn xây dựng đội ngũ tuyệt vời có thể Bán hàng?&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Bạn muốn hướng tới sự cam kết, hiệu suất và kết quả làm việc?&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;“Khi làm việc cùng Blair, chúng tôi đã tăng doanh thu bán bảo hiểm cao cấp lên hơn 600 triệu đô, tăng gấp đôi so với năng lực tìm kiếm khách hàng của chúng tôi.”- Jason Tyne (Tập đoàn tài chính thế giới – World Financial Group)&lt;/p&gt;\r\n\r\n&lt;p&gt;“Blair Singer là một nhà truyền thông tuyệt vời, một giáo viên tuyệt vời và là một cá tính tuyệt vời. Đúng như những gì ông nói, chiến thắng chính là làm chủ giọng nói nhỏ của bạn.”- Robert Kiyosaki (Tác giả của&lt;strong&gt; Cha giàu, Cha nghèo&lt;/strong&gt;, giảng viên, doanh nhân)&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Chủ đề diễn thuyết:&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Tăng doanh số bán hàng trong 6 tuần;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Làm chủ “Giọng nói nhỏ”;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Bí mật xây dựng một đội nhóm vô địch;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Làm chủ nghệ thuật bán hàng và lãnh đạo;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Xây dựng đội nhóm bán hàng số 1;&lt;/p&gt;\r\n\r\n&lt;p&gt;– Cách thức lãnh đạo, đào tạo, và tạo cảm hứng.&lt;/p&gt;\r\n\r\n&lt;h4&gt;&lt;strong&gt;Người sáng lập&lt;/strong&gt;&lt;/h4&gt;\r\n\r\n&lt;p&gt;Tôi là Nguyễn Phương Hoài Hương. Tên Thánh của tôi hay Nickname của tôi là Theresa. Tôi đã có trên 20 năm kinh nghiệm làm việc ở các vị trí hoạch định kế hoạch tiếp thị thương mại, bán hàng &amp; phát triển kinh doanh cho một số Tập đoàn đa quốc gia như PepsiCo, Avon Cosmetics, Best World Lifestyle và Sunrider.&lt;/p&gt;\r\n\r\n&lt;p&gt;Trong suốt thời gian này, tôi đã cùng với đội nhóm của mình tạo ra những thành tích kinh doanh tăng trưởng lên đến hai con số liên tục trong nhiều năm liền. Lúc bấy giờ, những gì tôi nỗ lực có được, kể cả chiếc ghế cao nhất của một Tập Đoàn Mỹ Phẩm và Dược Phẩm Hoa Kỳ, chắc chắn là khát khao, cuộc sống trong mơ của rất nhiều người; vì lúc đó chính tôi và tôi nghĩ rằng cũng có nhiều người như tôi, có cùng suy nghĩ rằng đó là chính mục đích sống trong cuộc đời của mình.&lt;/p&gt;\r\n\r\n&lt;p&gt;Tuy nhiên, vào thời điểm thành công của mình, khi tôi còn đương nhiệm tại Avon thì “ẦM” . . . chỉ vì một quyết định của một Vị Tân Chủ Tịch Tập Đoàn, trong vòng 30 ngày, toàn bộ những gì chúng tôi đã cống hiến và gầy dựng cho AVON phải bị xoá sạch trên bản đồ Việt Nam. . .Một cú sốc rất lớn đối với tôi, với gần 200 nhân viên văn phòng và hàng nghìn . . .hàng nghìn, nghìn . . . những nhà phân phối và đại diện kinh doanh của công ty.&lt;/p&gt;\r\n\r\n&lt;p&gt;Tôi quá sốc và không thể tin vào những gì đang diễn ra . . . Thế rồi, chợt nhận được một lời mời của Công ty Babylons đến tham dự chương trình gặp gỡ Vua Bán Hàng Blair Singer. Lúc đó, tôi thực sự tò mò, vì suốt hành trình nhiều năm đi làm cho những Tập Đoàn Quốc Tế, được gặp gỡ rất nhiều người tài giỏi nhưng tôi chưa từng nghe có ai nói họ là Vua Bán Hàng hay được gọi bằng cái tên đại khái là như thế. Cho nên, tôi tò mò đi tham dự vì muốn biết xem Ông Vua Bán Hàng Thế Giới trông thế nào.&lt;/p&gt;\r\n\r\n&lt;p&gt;Chỉ sau gần 3 tiếng đồng hồ, ngồi trong một khán phòng khoảng gần 1,000 người, tôi bắt đầu cảm nhận được sự khiêm tốn, chân thành và uyên bác khác thường của Blair Singer và tôi quyết định đăng ký tham dự chương trình chuyên sâu Bán Hàng và Lãnh Đạo do thầy trực tiếp huấn luyện.&lt;/p&gt;\r\n\r\n&lt;p&gt;Sau 2 ngày học từ sáng đến sáng với khoảng 357 học viên đến từ các nước trong khu vực Châu Á của mình mà năm đó Việt Nam đăng cai tổ chức, bạn biết điều tôi học được là gì không? Tôi học được là mình chẳng biết bán hàng là gì cả. Dẫu rằng lúc đó cũng có mười mấy năm kinh nghiệm làm Marketing và Sales. Tôi bắt đầu được Thầy làm cho ngộ ra hết từ bất ngờ này đến bất ngờ khác, đặc biệt là với phần bùng nổ doanh sốthực sự bằng tiền thật của cả lớp.&lt;/p&gt;\r\n\r\n&lt;p&gt;Nhưng cú bất ngờ nhất là lúc kết thúc lớp học. Trước khi chuẩn bị kết lớp, Thầy bảo với chúng tôi rằng: Tôi đến đây không phải để dạy bán hàng. . .  Hả??? Một ông thầy Tây da trắng mũi lõ, biết bao người phong là Vua Bán Hàng Thế Giới, bay cả nửa vòng trái đất qua đây huấn luyện 2 ngày hết mình thế này mà bây giờ bảo là không phải để dạy bán hàng? Và thầy từ tốn bảo chúng tôi rằng: nếu Anh Chị nào muốn biết tôi qua đây làm gì, hãy cho tôi 45 phút quý báu của các Anh Chị, tôi sẽ chia sẻ.&lt;/p&gt;\r\n\r\n&lt;p&gt;Lúc bấy giờ độ khoảng 1:30 AM, theo bạn thì tôi nên ở lại không? Vâng, về nhà lúc 2:30 AM hay 3:30 AM thì có gì khác đâu. Huống chi, không biết bao giờ gặp được Thầy nữa nên tôi quyết định ngồi lại. Khi đó, trong khán phòng chỉ còn khoảng hơn 110 người. Thầy ngồi ở ghế trên sân khấu, hai tay nhẹ nhàng đặt lên thành ghế, nhìn chúng tôi trìu mến . . . từ trái sang phải . . .chậm rãi . . .rồi nhẹ nhàng bảo: “Tôi đến đây không phải để dạy bán hàng. Tôi đến đây vì 95% dân số chưa nói được tiếng Anh hoặc không nói được tiếng Anh lưu loát . . .Tôi đến đây để tìm kiếm những ai sẵn sàng cho tôi 18 tháng quý báu của mình để tôi truyền lại toàn bộ 33 năm kinh nghiệm và kiến thức của mình để các bạn có thể chia sẻ cho người Việt Nam bằng ngôn ngữ mẹ đẻ của mình những bài học về kinh doanh đã được minh chứng ở trên 25 quốc gia; Với những bài học thực tế đó họ có thể giàu có hơn, có được cuộc sống hạnh phúc hơn so với những gì họ đang phải cần mẫn, lam lũ sáng đêm mà chưa biết tương lai sẽ ra sao và đi về đâu.”&lt;/p&gt;\r\n\r\n&lt;p&gt;Trong phút giây lắng đọng đó, ánh mắt của tôi chợt chạm sâu vào ánh mắt của Thầy . . . và tôi nhận ra đây chính là con đường mình thực sự mong muốn và khát khao sống trong những ngày tháng còn lại của cuộc đời mình. Thế rồi tôi theo Thầy đi học, Thầy đi đâu, tôi theo đó.&lt;/p&gt;\r\n\r\n&lt;p&gt;Và sau gần 2 năm, vào ngày 01/8/2015, cũng tại khách sạn nơi ngày xưa tôi được gặp Thầy lần đầu, Thầy trao cho tôi tấm bằng tốt nghiệp và bảo với tôi rằng: “Hôm nay không phải là ngày con tốt nghiệp. Đây cũng không phải là tấm bằng tốt nghiệp thầy trao cho con của con. Hôm nay là ngày khởi đầu một hành trình mới của con. Thầy trao cho con nhiệm vụ là hãy đi, đi và tìm kiếm cho quê hương Việt Nam của con những nhà lãnh đạo và những người thầy thực thụ – Là những người có khả năng thay đổi và chuyển đổi chất lượng cuộc sống của từng người, hàng triệu người dân Việt Nam của con, giúp họ sống cuộc sống của chính họ, đáng sống hơn, lớn lao hơn, giàu có hơn và tốt đẹp hơn.”&lt;/p&gt;\r\n\r\n&lt;section&gt;\r\n&lt;p&gt;Và cũng đúng ngày 1/8/2015 Học viện Blair Singer Việt Nam bắt đầu thành hình. Kể từ ngày đó, được thừa hưởng toàn bộ kho tàng 33 năm của Thầy cùng với sự kèm cặp ân cần hàng ngày, tôi và đồng đội của tôi đã và đang đi khắp các nẻo đường của quê hương, đến những nơi, gặp những con người, những tổ chức đang cần những bài học và trải nghiệm thực tế để thay đổi chất lượng cuộc sống, để giúp họ nhận ra rằng giáo dục đúng nghĩa vẫn tồn tại, vẫn đóng một vai trò then chốt làm thay đổi cuộc sống, thay đổi số phận của con người, vẫn làm con người và cuộc sống của họ tốt hơn. Hoàn toàn không phải như những gì người ta đang nghĩ và đang thấy; là nhồi nhét thông tin, là thành tích, là các kiểu bằng cấp… chẳng giúp cải thiện cuộc sống của người học. Thậm chí, còn gieo thêm hoang mang sợ hãi, mầm mống tiêu cực cho cả người học lẫn người dạy.&lt;/p&gt;\r\n&lt;/section&gt;\r\n\r\n&lt;section&gt;\r\n&lt;hr /&gt;\r\n&lt;hr /&gt;\r\n&lt;hr /&gt;\r\n&lt;hr /&gt;\r\n&lt;blockquote&gt;\r\n&lt;p&gt;Thế giới này cần những nhà lãnh đạo và những người thầy thực thụ&lt;/p&gt;\r\n&lt;/blockquote&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;BLAIR SINGER&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;&lt;/section&gt;\r\n\r\n&lt;section&gt;\r\n&lt;p&gt;Kim chỉ nam và cũng là tiêu chí hoạt động của chúng tôi là lời thầy dặn:&lt;br /&gt;\r\n“Thế giới không quan tâm con có bao nhiêu tiền, bao nhiêu nhà hay bao nhiêu xe; cũng chẳng quan tâm con giỏi không hay có bao nhiêu bằng cấp, vị thế nào trong xã hội; Thế giới của chúng ta chỉ muốn biết con có phải là một người Lãnh đạo, một người Thầy thực thụ hay không – Người muốn và có khả năng thay đổi cuộc sống của bản thân; đồng thời muốn giúp thay đổi cuộc sống của một người, của nhiều người; làm trỗi dậy con người anh hùng, lớn lao bên trong của họ”.&lt;/p&gt;\r\n&lt;/section&gt;\r\n', '', '', 'sos vienam', 'SBI NÂNG TẦM THỊNH VƯỢNG TÀI CHÍNH', '', '', '', '', '', 'gioi-thieu', 1621050346, 1638856894, 1),
(2, '', '{\"p\":\"\",\"w\":null,\"h\":null,\"m\":null}', '', 'chinh-sach-ban-si-cua-mitumark', '', '', '&lt;h2&gt;&lt;strong&gt;A. Điều kiện bán sỉ&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;+ Số lượng sản phẩm từ 5 trở lên&lt;/p&gt;\r\n\r\n&lt;p&gt;+ Mua càng nhiều số lượng càng rẻ&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;B. Chính sách bán sỉ&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;Vận chuyển&lt;/strong&gt;&lt;/h3&gt;\r\n\r\n&lt;p&gt;+ Thời gian giao hàng từ 3 – 5h (tại TPHCM) và từ 1 – 2 ngày (khách hàng ở tỉnh) đối với hàng có sẵn.&lt;/p&gt;\r\n\r\n&lt;p&gt;+ Giao hàng tận nơi tại TPHCM và gửi qua chành xe đối với khách hàng ở tỉnh.&lt;/p&gt;\r\n\r\n&lt;p&gt;+ Miễn phí vận chuyển&lt;/p&gt;\r\n\r\n&lt;h3&gt;&lt;strong&gt;Thanh toán&lt;/strong&gt;&lt;/h3&gt;\r\n\r\n&lt;p&gt;+ Khách hàng tại TPHCM có thể thanh toán tiền mặt khi nhận hàng.&lt;/p&gt;\r\n\r\n&lt;p&gt;+ Khách hàng ở tỉnh phải chuyển khoản trước khi giao hàng.&lt;/p&gt;\r\n\r\n&lt;p&gt; &lt;/p&gt;\r\n', '', '', '', 'Chính sách bán sỉ của Mitumark', '', '', '', '', '', 'chinh-sach-ban-si', 1621050376, 1621050421, 1),
(3, '', '', '', '', '', '', '&lt;p&gt;&lt;span style=&quot;color:#c0392b;&quot;&gt;&lt;span style=&quot;font-size:20px;&quot;&gt;&lt;strong&gt;HIỆP HỘI NĂNG LƯỢNG SẠCH VIỆT NAM&lt;/strong&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Số điện thoại tiếp nhận thông tin:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png&quot; width=&quot;16&quot; /&gt;Anh ĐÀO DUY DƯƠNG – ĐT: 0989800066&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png&quot; width=&quot;16&quot; /&gt;Anh PHAN NGỌC ÁNH – ĐT: 0901898539&lt;/p&gt;\r\n', '', '', '', '', '', '', '', '', '', 'lienhe', 1621050514, 1628645639, 1),
(4, '', '', '', 'sos-viet-nam', '', '', '&lt;p&gt;VCEA HCM&lt;/p&gt;\r\n\r\n&lt;p&gt;Địa chỉ: &lt;/p&gt;\r\n\r\n&lt;p&gt;Hotline:&lt;/p&gt;\r\n\r\n&lt;p&gt;Website: vinasos.org&lt;/p&gt;\r\n\r\n&lt;p&gt;Email: vinasos@gmail.com&lt;/p&gt;\r\n', '', '', '', 'SOS Việt Nam', '', '', '', '', '', 'footer', 1621050558, 1628670333, 1),
(5, '', '{\"p\":\"\",\"w\":null,\"h\":null,\"m\":null}', '', 'huong-dan-su-dung', '', '', '&lt;p&gt;&lt;b&gt;QUYẾT ĐỊNH THÀNH LẬP BAN CÔNG TÁC XÃ HỘI HỖ TRỢ CHỐNG DỊCH COVID 19 TRỰC THUỘC HIỆP HỘI NĂNG LƯỢNG SẠCH VIỆT NAM (VCEA)&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tf1/1/16/1f4af.png&quot; width=&quot;16&quot; /&gt;Với sự uy tín của các đơn vị cùng đồng hành lần này, quý vị có thể hoàn toàn yên tâm tin tưởng.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t87/1/16/1f340.png&quot; width=&quot;16&quot; /&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t87/1/16/1f340.png&quot; width=&quot;16&quot; /&gt;Với mong muốn được chia sẻ gánh lo mùa dịch với người dân thành phố, chúng tôi kêu gọi mọi người cùng chung tay và lan tỏa thông điệp bằng cách chia sẻ Fanpage cũng như Group này công khai đến với tất cả mọi người.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t87/1/16/1f340.png&quot; width=&quot;16&quot; /&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t87/1/16/1f340.png&quot; width=&quot;16&quot; /&gt;Người tặng sẽ được cho đi nhiều hơn và người nhận sẽ được trao kịp thời để cùng nhanh chóng đẩy lùi dịch bệnh.&lt;/p&gt;\r\n\r\n&lt;p&gt;Qui trình xin được nhắc lại quy trình tặng và nhận để quý vị nắm rõ.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f4d7.png&quot; width=&quot;16&quot; /&gt;QUY TRÌNH &quot;TẶNG&quot;&lt;/p&gt;\r\n\r\n&lt;p&gt;Các mạnh thường quân có hàng hóa nhu yếu phẩm muốn trao tặng cho người dân gặp khó khăn nhưng không có điều kiện đi lại vì phải chấp hành nghiêm chỉ thị 16. Hãy thực hiện các bước sau:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;⭐️&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/1/16/2b50.png&quot; width=&quot;16&quot; /&gt;Bước 1: Đăng đăng ký tài khoản website và xác nhận tài khoản qua email ( để bạn có thể theo dõi báo lịch sử quyên góp của bạn đảm bảo tính minh bạch cho những gì bạn đã quyên góp)&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;⭐️&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/1/16/2b50.png&quot; width=&quot;16&quot; /&gt;Bước 2: Bạn chọn chức năng &lt;strong&gt;&quot;HỖ TRỢ&quot;&lt;/strong&gt;, chọn mặt hàng và số lượng muốn quyên góp sau đó xác nhận thông tin, địa điểm lấy hàng.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;⭐️&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/1/16/2b50.png&quot; width=&quot;16&quot; /&gt;Bước 3: Chúng tôi sẽ liên hệ xác nhận và điều động xe đến tiếp nhận hàng hóa an toàn và nhanh chóng.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t1f/1/16/1f4d7.png&quot; width=&quot;16&quot; /&gt;QUY TRÌNH &quot;NHẬN&quot;&lt;/p&gt;\r\n\r\n&lt;p&gt;Quy trình thực hiện đơn giản:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;⭐️&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/1/16/2b50.png&quot; width=&quot;16&quot; /&gt;Bước 1: Đăng đăng ký tài khoản website và xác nhận tài khoản qua email ( để bạn có thể theo dõi báo trạng thái các yêu cầu hỗ trợ của bạn)&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;⭐️&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/1/16/2b50.png&quot; width=&quot;16&quot; /&gt; Bước 2: Chủ tịch, Phó chủ tịch Phường, Công an khu vực, người chỉ huy chốt phong tỏa cung cấp các thông tin, hình ảnh, giấy tờ cần thiết cho chúng tôi như sau để bảo đảm tính công khai minh bạch trong việc tiếp nhận các nguồn tài trợ liên quan đến hoạt động thiện nguyện:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png&quot; width=&quot;16&quot; /&gt;Hình ảnh giấy Quyết định phong tỏa khu phố, khu vực của phường.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;⭐️&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/1/16/2b50.png&quot; width=&quot;16&quot; /&gt; Bước 3: Bạn chọn chức năng&lt;strong&gt; &quot;NHẬN HỖ TRỢ&quot;&lt;/strong&gt;, chọn mặt hàng và số lượng cần quyên góp sau đó xác nhận thông tin, địa điểm lấy hàng.Thông tin đăng ký nhận hàng từ thiện (cung cấp hình ảnh CCCD và chức vụ) &lt;/p&gt;\r\n\r\n&lt;p&gt;Số điện thoại tiếp nhận thông tin:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png&quot; width=&quot;16&quot; /&gt;Anh ĐÀO DUY DƯƠNG – ĐT: 0989800066&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;????&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/t51/1/16/1f449.png&quot; width=&quot;16&quot; /&gt;Anh PHAN NGỌC ÁNH – ĐT: 0901898539&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;⭐️&quot; height=&quot;16&quot; referrerpolicy=&quot;origin-when-cross-origin&quot; src=&quot;https://static.xx.fbcdn.net/images/emoji.php/v9/tb4/1/16/2b50.png&quot; width=&quot;16&quot; /&gt; Bước 3: Ban công tác xã hội hỗ trợ chống dịch Covid-19 sẽ xác nhận và điều phối xe đến tận nơi để trao tặng các phần quà nhu yếu phẩm cho bà con.&lt;/p&gt;\r\n', '', '', '', 'Hướng dẫn sử dụng', '', '', '', '', '', 'huong-dan', 1628324607, 1628645402, 1),
(6, '', '', '', 'tam-nhin-su-menh', '', '', '&lt;p&gt;&lt;span style=&quot;font-size:12.0pt;&quot;&gt;TẦM NHÌN&lt;br /&gt;\r\nTrường doanh nhânh Sài Gòn phấn đấu trở thành một tập đoàn giáo dục - đào tạo - nghiên&lt;br /&gt;\r\ncứu khoa học - tư vấn có uy tín cao mang tầm cỡ quốc gia, vươn ra&lt;br /&gt;\r\nkhu vực và quốc tế.&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;font-size:12.0pt;&quot;&gt;SỨ MỆNH&lt;br /&gt;\r\nHội nhập quốc tế là cạnh tranh về kinh tế; cạnh tranh về kinh tế là&lt;br /&gt;\r\ncạnh tranh về trí thức và khoa học công nghệ; cạnh tranh về trí thức&lt;br /&gt;\r\nvà khoa học công nghệ là cạnh tranh về nhân tài; cạnh tranh về nhân&lt;br /&gt;\r\ntài là cạnh tranh về giáo dục. Sứ mệnh của FCI:&lt;br /&gt;\r\n- Góp phần nâng cao giá trị chất lượng học vấn Việt Nam.&lt;br /&gt;\r\n- Tạo ra lực lượng lao động trí thức, tài năng để có thể đối đầu với mọi&lt;br /&gt;\r\nthách thức, thích ứng mọi thay đổi, đi đến thành công, qua đó nâng&lt;br /&gt;\r\ncao năng lực cạnh tranh cho các tổ chức kinh tế.&lt;br /&gt;\r\n- Góp phần làm phồn vinh đất nước và thúc đẩy tiến trình hội nhập&lt;br /&gt;\r\ncủa nền kinh tế tri thức.&lt;/span&gt;&lt;/p&gt;\r\n', '', '', '', 'Tầm nhìn sứ mệnh', '', '', '', '', '', 'tam-nhinh-su-menh', 1658821841, 0, 1),
(7, '', '{\"p\":\"\",\"w\":null,\"h\":null,\"m\":null}', '', 'tam-nhin-su-menh', '', '', '&lt;p&gt;- Góp phần nâng cao giá trị chất lượng học vấn Việt Nam.&lt;br /&gt;\r\n- Tạo ra lực lượng lao động trí thức, tài năng để có thể đối đầu với mọi thách thức, thích ứng mọi thay đổi, đi đến thành công, qua đó nâng cao năng lực cạnh tranh cho các tổ chức kinh tế.&lt;br /&gt;\r\n- Góp phần làm phồn vinh đất nước và thúc đẩy tiến trình hội nhập của nền kinh tế tri thức.&lt;br /&gt;\r\n &lt;/p&gt;\r\n', '', '', '', 'Tầm nhìn sứ mệnh', '', '', '', '', '', 'tam-nhin-su-menh', 1658821967, 1658822419, 1);
